INSERT INTO `folders` VALUES (1,2,'dfb02b2d-fd26-3985-b0d8-b7ca627dd992','Étudiant','2021','Université d’Abomey-Calavi','Agrobusiness','Sans activité professionnelle','Intermédiaire','Je voudrais suivre la formation afin de me perfectionner dans le domaine du codage.','Avoir une bonne base du langage HTML et CSS','Dans 3ans, je vise aider des dizaines d’entreprises dans le domaine de développement de code','Le métier de développeur codeur est un métier prometteur car c\'est un métier de plus en plus transversal : télévision, transports, art, médias, sciences, le codeur est partout. Une pierre angulaire des entreprises modernes.','Par un ami',NULL,NULL),(2,3,'50069b43-10bf-3271-a025-449283e8e2ea','Étudiant','2019','LyTA/BSAA','DEAT','Sans activité professionnelle','Débutant','J\'aimerais suivre cette formation afin de mettre fin au chômage','Garantie d\'un avenir meilleur','En réalité tout ça dépend','A vrai dire ça me donne beaucoup d\'idées mais je ne sais de quoi cela peut être vraiment.','Par un ami',NULL,NULL),(3,4,'df3b4f85-4dc6-36a7-84c7-c87edf26bbb6','Étudiant','2022','École Supérieure d’Administration, d\'Economie, de Journalisme et des Métiers de l\'audiovisuel','Administration générale territoriale','Étudiant','Débutant','Je suis un jeune étudiant j’ai fais ma soutenance en administration générale territoriale. Je ne cache pas que j’ai perdu du temps mais je suis jeune et je pense que j’ai le temps . Depuis tout petit en regardant la télévision j’ai vu ce qu’était capable de faire un informaticien un codeur pour ainsi dire ,petit à petit c’est devenu un rêve. Créer des logiciels c’est mon rêve. Créer un Logiciel capable de révolutionner le monde c’est  ce que j’ai envie de faire , or le codage est le seul moyen d’y arriver je n’ai pas eu l’opportunité de faire ce que je voulais à l’université. mais j’ai l’intime conviction que si vous me laissez y participer je vais me surpasser , me battre devenir le meilleur et réaliser mon rêve.','Mes attentes par rapport a cette formation \r\nApprendre tout d’abord , avoir de l’expérience être formé pour faire ce que j’aime le plus au monde, me faire encadrer afin de progresser de devenir le meilleur dans mon domaine , si possible former d’autres personnes et qui sait devenir l’un des meilleurs codeur du monde. Je sais que à high-five je peux le faire.','J’ai L’ambition de créer déjà une appli pour téléphone portable une appli de téléphonie mobile capable de concurrencer avec ceux de la Facebook Whatsapp instagram , mais je vise haut et en m’acharnant je pourrais déjà crée un bon programme informatique dans l’idéal concepteur de jeux vidéo ou être un as de la sécurité informatique ,grâce à tout ce que je vais apprendre à highfive. Bien sûr il faut aller pas à pas mais je sais ce que je veux et j’y arriverai  coûte que coûte.','Un codeur c’est quelqu’un qui conçoit des programmes , il est à la base de la création des logiciels et le fais dans des langages de programmation Java , c+ , python etc c’est grâce à ça que le codeur arrive à confectionner des programmes informatiques. Le métier de codeur selon moi est le plus important à notre époque puisque la technologie a évoluée. Un codeur est un expert des langages informatiques, retranscrire tout en ligne de code pour crée des programmes époustouflants.','Par un ami',NULL,NULL),(4,6,'bc9aabb0-6633-3349-89b0-43093fa4a5b7','License','2022','Haute École de Commerce et de Management (HECM)','Entrepreneuriat et Gestion de Projet','Sans activité professionnelle','Débutant','Je voudrais suivre cette formation pour acquérir de nouvelles connaissances et s’adapter à toutes situations  pour être utiles dans la société','Que cette formation soit pour nous une utilité dans la vie.\r\nUne bonne qualité des cours qui seront dispensés','Être indépendant grâce au métier de développeur codeur','Un métier d’avenir','Par un ami',NULL,NULL),(5,7,'81d9f445-62d8-39ff-941f-70aba2275fd1','License','2016','Institut Universitaire de la Côte','Automatique et informatique industrielle','Sans activité professionnelle','Débutant','Parce que je suis passionné par le code et souhaite faire carrière dans le développement d’application','Apprendre à développer des applications web et mobile et devenir un développeur fullstack','Dans 3 ans je me vois développeur senior et également en train de lancer ma propre boîte','Il s’agit de résoudre des problèmes grâce au code informatique. Développer des solutions pour des clients','Internet',NULL,NULL),(6,8,'94f5d943-8d81-3842-b103-b9280b174665','License','2021','Les cours sonou','Comptabilité et finance d\'entreprise','Sans activité professionnelle','Intermédiaire','J\'aimerais suivre cette formation parceque à l\'ère du 21 ème siècle le numérique et le digital sont d\'une grande importance alors c\'est une opportunité pour moi d\'intégrer votre école','Mes attentes par rapport a cette formation, c\'est être capable de comprendre les contours du codage et développeur, être capable d\'appliquer ce qu\'on m\'a appris dans la vie professionnelle','Dans 5 ans je veux créé une formation en développeur codeur pour partager mes expériences dans cet domaine si je suis retenu avec les jeunes passionné par le numérique, leur offrir une formation telle qu\'on m\'a formé à ces jeunes','Pour moi le développeur codeur c\'est celui qui faire le codage en informatique','Internet',NULL,NULL),(7,9,'9e795ea5-6905-38a3-ad7b-e44e981906ef','Étudiant','2021','École supérieure de génie civil VERECHAGUINE A.K','Baccalauréat','Étudiant','Débutant','Pour développer plus mes potentiels dans d\'autres domaines professionnels','Je veux qu\'on nous donne le meilleur','Savoir faire quelque chose \r\nAvoir mes diplômes \r\nÊtre indépendant','Moi je crois que c\'est une bonne idée ce métier ici chez chez nous au Bénin ça peut nous aider en tant que jeune à élargir notre connaissance dans d\'autres domaines professionnels','Par un ami',NULL,NULL),(8,10,'ca74c81f-d8ef-3736-a618-d4e52dfc7a51','License','2018','West African Union University','Banque finance et assurance','Sans activité professionnelle','Débutant','La formation ainsi inovée vient combler mes attentes. Elle me permettrait d\'avoir les compétences nécessaires afin de me lancer dans la domaine des tics','Pouvoir acquérir des compétences efficaces, connaître complètement le codage informatique','Avoir une structure personnelle dans le codage','Toujours est-il que rien n\'est jamais facile, comme toute activité, le codage aura ses difficultés dont le codeur serait exposé ainsi les avantages','Internet',NULL,NULL),(9,11,'48b5acb8-1c88-3c23-ac11-85ca1956f6af','License','2018','ESTG','Réseau Informatique et Télécom','Sans activité professionnelle','Courant','Pour me perfectionner et améliorer mon niveau','Parvenir à maitriser tous les systèmes de codage et de programmation \r\nArriver à fabriquer des robos','Je me projette dans 05 ans être capable de fabriquer des robos','Un bon métier d\'avenir et prometteur car nous sommes à l\'air du numérique','Par un ami',NULL,NULL),(10,12,'96fe3fe6-016f-3116-bb31-8bd21cc60239','License','2020','ESCAE BÉNIN','Licence professionnelle en Diplomatie relations internationales','Sans activité professionnelle','Débutant','Le choix de ma précédente formation est en effet par contrainte, ne pouvant pas payer tout les frais pour une formation en systèmes informatiques et développement web. Votre volonté est tout d\'abord partager. La création de contenu web est une passion pour moi , cette formation me permettra d\'acquérir plus de connaissances et aptitudes pour atteindre mes objectifs professionnels.','Au cours de la formation j\'aimerais familiariser avec l\'ensemble des parties prenantes afin de m\'imprégner dans le domaine avec l\'aide des formateurs et camarades. En fin de formation, il s\'agirait de pouvoir faire une rétrospective excellente, répondre aux attentes de l\'institution, mettre au service des entreprises le savoir acquis, participer à de nombreuses Panels de professionnels.','Le but est d\'être indépendant et autonome, servir et représenté de grandes marques et produits web, apporter sa contribution à l\'effectivité du web sécurité. Je pense accompagner et soutenir des promotions de codeurs plus jeune pour asseoir au Bénin un incubateur puisant et inter compétitive','Ce métier est tout d\'abord complexe et nécessite beaucoup d\'attention et de labeur , un développeur codeur est la personne ressource pour tous entreprises qui se voit concurrentiel d\'où la responsabilité de celui ci est engagée. Le codeur doit trouver des solutions pour palier au vision de sa clientèle a satisfaire nécessairement','Internet',NULL,NULL),(11,13,'262d3578-094f-3d7c-a2c7-5db8a362ffdd','License','2022','Université d\'Abomey-Calavi','Sociologie Anthropologie de la santé','Sans activité professionnelle','Débutant','Je veux suivre cette formation tout d\'abord parceque l\'information est un secteur en perpétuelle évolution qui laisse place à l\'innovation, et offre de belles perspectives de carrière.\r\nJe suis intéressée car je pense apprendre des compétences bien approfondies dans le domaine de l\'informatique au cours de cette formation pour évoluer professionnellement','Mes attentes par rapport à cette formation est de pouvoir apprendre à développer de nouveaux produits (logiciels, réseaux, progiciels) pour permettre un développement de la compétitivité des entreprises.','-Dans 3 à 5 ans je dois pouvoir faire parler ma créativité avec l’informatique;\r\n-Être meilleure dans le domaine de l\'informatique;\r\n-Pouvoir améliorer la productivité et l\'organisation d\'une société grâce à l\'outil informatique;\r\n-Aider les  entreprises à stocker leurs données en toute sécurité;','De nos jours presque toutes les entreprises exigent que leurs employés puissent utiliser l\' ordinateur. De plus en plus de postes nécessitent l\'utilisation de l\'outil.\r\nLe métier de développeur codeur est un métier créatif. Le développement offre de nombreuses possibilités pour résoudre des problèmes logiques de multiples façons.\r\nUn métier ultime qui permet de trouver du travail facilement.\r\n Un développeur lui, apprend quelque chose de nouveau tous les jours.','Par un ami',NULL,NULL),(12,14,'d958d9d0-fb33-3e05-b842-514ef5ce9c06','License','2022','Les Cours Sonou Cotonou Caboma','Système Informatique et Logiciel','Sans activité professionnelle','Débutant','Pour me perfectionner','Devenir un informaticien performant en génie logiciel','Passer l\'examen d\'état cette année, avoir un master en informatique dans un établissement renommé et avoir un bon boulot','Cool et passionnant','Par un ami',NULL,NULL),(13,15,'bc207c2a-77a9-35bd-b2a0-a0a6a6b1048a','Étudiant','2019','Abomey Calavi','Droit privé','Salarié','Débutant','Je voudrais suivre cette formation parceque j\'aime tout ce qui à rapport au monde du numérique et du digital','Je voudrais apprendre les bases du codage pouvoir coder et créer des sites web dans le but de pouvoir mettre à profit mes acquis et mes compétences sur le marché du numérique','Dans 5 ans je m\'imagine être déjà un codeur à partir entière et mettant mes compétences à disposition des entreprises ayant besoin de ces aptitudes','Je pense que c\'est un métier d\'avenir qui commence déjà à avoir de l\'impact dans la vie courante au vue de la digitalisation que nous observons aujourd\'hui dans plusieurs secteurs d\'activités','Par un ami',NULL,NULL),(14,16,'d94e8e52-9fa1-3db7-9519-87466152f9ec','License','2018','Hecm','Réseau informatique et télécommunications','Salarié','Intermédiaire','Je voudrais suivre cette formation pour être plus utile et plus serviable sur le plan professionnel car le monde devient de plus en plus numérique chaque jour. Je pourrais donc participer au développement des entreprises sur le plan numérique afin qu’elles soient plus autonomes tout en étant efficaces.','Mes attentes par rapport a cette formation sont :\r\n-maîtriser les langages de développement \r\n-être en mesure de développer des applications ou site web\r\n-développer de plus amples compétences pour mieux servir','Dans 3 ans je me vois en tant que développeur dans une entreprise comme Vipp Interstis Benin  où je travaille déjà ,pour la conception d’application pouvant facilité les échanges, le travail et aussi la productivité au sein de cette dernière. Dans 5ans avoir une équipe de développeurs.','Par rapport au métier de développeurs, étant donné que serai appelé à concevoir des applications, des sites ou plateformes web, je l’imagine comme un métier d’avenir qui me permettra d’être utile à toutes entreprises et qui permettra aux entreprises pour lesquelles je travaillerai d’augmenter la productivité ,leurs permettre d’être plus performantes et de pouvoir satisfaire leurs clients','Internet',NULL,NULL),(15,17,'25338776-0e50-3765-81fd-0728f29b8873','License','2016','IUT Parakou','Gestion commerciale','Entrepreneur','Intermédiaire','Afin de pouvoir décrocher mon diplôme à cisco','Meilleures approches du monde informatique','Ouverture de ma boîte offrant des services de sécurité dans le domaine informatique... Réseau, développeur, hacking et autres','Pas du tout facile mais remplie d\'un univers extraordinaire','Par un ami',NULL,NULL),(16,18,'cf23fbe0-efa3-3d89-a918-10d6e7811f6a','Étudiant','2018','Lycée technique Coulibaly','ELECTROTECHNIQUE','Entrepreneur','Intermédiaire','Pour apporter un de plus à mon pays dans le numérique ,car je suis assoiffés de la connaissance surtout dans le codage','Acquérir beaucoup de  connaissances,','Je peux apporter de solutions au entreprise en étant un bon développeurs codeur','Un métier d\'avenir','Internet',NULL,NULL),(17,19,'7b963899-d223-3184-8cab-064205e4798c','License','2012','Eneam','DTS Gestion des Transports et Logistique','Salarié','Intermédiaire','J\'ai une passion pour le développement web','Obtenir tous les rudiments nécessaire pour maîtriser les exigences du développement web et surtout être autonome et indépendant pour créer les sites web et mes applications mobiles','Un meilleur développer web','Un métier d\'avenir','Internet',NULL,NULL),(18,20,'09d2d10c-e14d-3d77-a915-4d5274bf1db0','License','2016','Institut Universitaire de Technologie de Lokossa','Génie électrique et informatique industrielle','Salarié','Débutant','J\'ai une passion pour le codage informatique. Et il est aujourd\'hui au centre de nos vies et on ne peut pas vivre sans ansi ma détermination est de trouver des solutions informatiques aux problématiques rencontrés dans nos secteurs d\'activité.','Être capable d\'élaborer un cahier de charge et d\'écrire des lignes de code puis compiler des plateformes qui vont apporter une solution à un problème bien déterminé et spécifique.','Devenir un ingénieur en développeur codeur et piloter des projets qui apportent des solutions à notre monde. Des solutions qui informatisent et dynamisent nos secteurs d\'activité.','Un développeur s\'occupe de l\'élaboration de solutions à des problèmes informatiques avec des lignes de code.','Internet',NULL,NULL),(19,21,'44733a29-a610-3576-9cd5-e8045ca1577e','Étudiant','2022','HECM','Entrepreneuriat et gestion de projet','Étudiant','Débutant','je veux suivre cette formation parce qu\'elle constitue un avantage pour moi dans l\'entrepreneuriat et surtout parce que je suis à la quête de plus en plus d\'expérience professionnelle.','Mes attentes sont simples : recevoir juste les formations telles qu\'elles ont été décrites dans la fiche de lecture ou de renseignement.','Dans 3ans ,5ans je me vois déjà à un niveau considérable du professionnalisme , autrement, à ma perfection dans les domaines ou j\'étudie','je crois que ce métier précisément au Bénin répondrait aux besoins quelconques de jeunes étudiants et entrepreneurs de nos jours.','Par un ami',NULL,NULL),(20,23,'f339bf7e-2e56-3ed9-a0f0-2443852e4499','License','2013','Université Africaine de Technologie et de Management','Banque, Finance et Assurance','Sans activité professionnelle','Débutant','Bonjour,\r\nEn effet, je suis passionnée par du digital et mon seul désir c\'est de pouvoir me spécialiser dans le domaine du digital.','Mes attentes, c\'est de pouvoir apprendre,comprendre et avoir les connaissances nécessaires dans le domaine du codage et pour pas être une experte.','Je ne pourrai répondre avec certitude mais mon ambition actuel c\'est de me former et de me spécialiser dans le domaine du digital afin d\'être polyvalente.','Selon moi un développeur codeur, c\'est une personne qui est chargé d\'écrire un code sans faille afin de créer un logiciel fonctionnel.','Internet',NULL,NULL),(21,24,'f51d7011-af9c-37fd-b2d1-680b2e7512c4','License','2019','Les COURS SONOU','Banque Finance et Assurance','Sans activité professionnelle','Intermédiaire','Pour devenir un expert dans ledit domaine. Le monde du digital a toujours été une passion pour moi','Pourvoir acquérir la compétence nécessaire pour exercer dans le domaine.','J\'aurais déjà acquis les compétences nécessaires pour atteindre mes objectifs.','Le développeur codeur est un technicien informatique, un ingénieur chargé de concevoir des sites internet, des applications et autres.','Par un ami',NULL,NULL),(22,25,'a18fb1e6-2fb8-365e-bd52-43510534158a','License','2022','Faculté des Sciences Agronomiques de l\'Université d\'Abomey Calavi','Licence en Sciences Agronomiques','Salarié','Courant','Pour diversifier mes compétences','Pouvoir maîtriser tout ce qui est dit','Meilleur codeur d\'Afrique','C\'est un très bon métier','Internet',NULL,NULL),(23,26,'cba90088-29ca-3619-ad38-559816d2fd67','License','2022','Université d’Abomey Calavi','Géographie et Aménagement du Territoire','Sans activité professionnelle','Débutant','J’aimerais suivre cette formation car l’informatique est un secteur qui laisse place  à l’innovation.\r\nJe suis intéressée parce que j’aimerais approfondir mes connaissances dans le domaine de l\'informatique au cours de cette formation pour évoluer professionnellement.','En ce qui concerne mes attentes par rapport à cette formation c’est de pouvoir apprendre à développer de nouveaux produits (logiciels, réseaux, progiciels) pour permettre un développement de la compétitivité des entreprises.','- je dois pouvoir faire parler ma créativité avec l’informatique;\r\n- je dois pouvoir être la  meilleure dans le domaine de l\'informatique;\r\n- je dois pouvoir améliorer la productivité et l\'organisation d\'une société grâce à l\'outil informatique;\r\n- je dois pouvoir également aider les  entreprises à stocker leurs données en toute sécurité;','L’utilisation d’un ordinateur devient de nos jours indispensables dans toutes les entreprises. Le métier de développeur codeur est un métier créatif. Le développement offre de nombreuses possibilités pour résoudre des problèmes logiques de multiples façons.\r\nUn métier ultime qui permet de trouver du travail facilement.\r\n Un développeur lui, apprend quelque chose de nouveau tous les jours.','Par un ami',NULL,NULL),(24,27,'d070238d-d7c9-3c4e-9f8e-33e54bcfb29e','License','2021','ESM BENIN','Systèmes Informatiques et logiciels','Sans activité professionnelle','Intermédiaire','Mon objectif est d\'élargir mes horizons, en apprendre plus. Je veux avoir les compétences nécessaires car je sais que je suis encore novice pour répondre aux besoins des entreprises en besoin.','Je pense que cette formation m\'aidera à assimiler correctement les prérequis indispensables pour les spécialités propre aux développeurs codeurs.','Je me vois déjà atteindre une maîtrise parfaite des bases de l\'informatique et du code me permettant ainsi l\'analyse et la conception avec l\'innovation technologique nécessaire pour la réalisation de programmes informatiques au détriment des langages utilisés. Je serai un acteur des plus demandés dans le domaine du codage.','L\'avantage d\'être développeur codeur, c\'est qu\'il y a énormément de possibilités, la créativité, les casses têtes qui sont finalement résolus représente une victoire à chaque fois. Réaliser des programmes qui faciliteront le quotidien des internautes et des entreprises, savoir que c\'est moi qui est fais tels programmes et que des personnes en sont dépendant me rendrait heureux.','Par un ami',NULL,NULL),(25,28,'3673bd74-17d5-3e9c-8670-3c675f0237f8','License','2021','Université de Parakou','Droit','Sans activité professionnelle','Courant','Pour concrétiser ma passion car je me suis toujours amusé par des activités en ligne dont certaines me sont même pécuniaires.','J\'attends une parfaite maîtrise des métiers du digital.','Je me projette à être le meilleur du Benin en développeur codeur.','C\'est un métier indispensable pour l\'effectivité des sites internets dans toutes ses dimensions.','Internet',NULL,NULL),(26,29,'078bf793-2d2e-337f-a1c8-2c9f02cd21f2','Étudiant','2022','École Supérieure le Faucon','Système informatique et logiciels','Étudiant','Intermédiaire','Je veux suivre cette formation pour bien maîtriser le codage et me perfectionner, afin de réaliser de gros projet qui vont simplifier et faciliter le développement de la technologie','Bien maîtriser le rêve web','Dans 3 ans, je me vois participer à la réalisation des projets avec d\'autres entreprises et dans 5 ans je me vois crée déjà mon entreprise et réaliser les plus gros projets liés au digital et surtout le web,au Bénin et dans la sous région.','Mon métier de rêve,\r\nUn métier très élégant et passionnant.','Internet',NULL,NULL),(27,30,'6976c509-7bb0-3f47-866f-204a5bc58283','License','2016','Université de Parakou','Licence en Gestion des Entreprises','Entrepreneur','Intermédiaire','Acquisition de nouvelle compétence','Êtres en mesure de :\r\n- réaliser une analyse technique.\r\n- crée, concevoir et  programmer un site internet, un module ou un développement spécifique.\r\n- avoir la capacité d\'élaborer plusieurs tests de vérification.\r\n- Corriger des bugs.','Devenir un bon développeur web','Le développeur web est un technicien informatique, un ingénieur chargé de concevoir des sites internet en s’adaptant aux besoins spécifiques d’un client.','Internet',NULL,NULL),(28,31,'08cb791b-5878-32e5-b218-be3651d6f5c0','License','2019','Les Cours Sonou','Informatique (Système Informatique et Logiciels)','Entrepreneur','Intermédiaire','Je m\'appelle Christophe je suis un développeur web étant passionné des nouvelles technologie je me suis spécialisé dans le domaine de la programmation pour pouvoir réaliser mes rêve.','Pour cette formation j\'aimerais approfondir mes connaissance dans le domaine de technologie sur le domaine de la programmation.','Dans 3, 5ans je veux être un développeur professionnel confirmer','Le métier de développeur est un métier passionnant que j\'aime très bien.','Internet',NULL,NULL),(29,32,'765c8db6-b2a7-3e6a-8da7-8d9a7423f6f3','Étudiant','2017','IS FOPASE','BTS','Entrepreneur','Débutant','Je voudrais suivre cette formation afin d\'avoir les meilleurs compétences et d\'être plus compétitives.','Décrochez un emploi de qualité.','Dans 3 ans je pense maitriser correctement les langages indispensables, être capable de concevoir les applications dynamiques et complexes et décrocher un emploi prometteur.','Passionnant et rigoureux','Par un ami',NULL,NULL),(30,33,'d92f35df-cc91-3e67-be75-53fcf35f1870','Étudiant','2019','Université d\'Abomey-Calavi','Administrateurs des finances','Entrepreneur','Débutant','Je voudrais suivre cette formation parcequ\'elle représente pour moi les filières d\'avenir.','Mes attentes par rapport à cette formation est de sortie avec en poche le diplôme de développeur et de trouver un job pouvant le permettre de subvenir à mes besoins.','Dans 3ans , 5ans je me projette en étant un développeur codeur principal du e très grande entreprise de renommée internationale comme la société réseau GSM MTN par exemple','Le métier de développeur codeur est hyper excitant car ses un métier qui vous éloigne des stress de l\'administration.','Internet',NULL,NULL),(31,34,'85ddb04f-e67f-37c7-a751-ec6d2c664768','Étudiant','2020','UAC','ANGLAIS','Étudiant','Intermédiaire','Je dirai que l\'informatique a toujours été une chose qui m\'a tant passionné en particulier le codage et j\'aimerais réellement faire de cette passion une réalité en apprenant  plus et pouvoir comprendre plus au délà d\'un simple utilisateur.','Pouvoir en tiré le maximum et être capable de faire preuve des connaissances acquises à tout moments','L\'acquision effective de ses compétences me donnera une idée plus claire de mettre mes savoirs au sein des stars up  dans ce domaine  et d\'être plus utile.','C\'est un métier passionnant mais aussi qui demande beaucoup d\'attention, de concentration et d\'innovation.','Internet',NULL,NULL),(32,35,'386e6e25-a4de-3083-9246-47bd9359cfdb','Étudiant','2022','Université d\'Abomey-calavi','Lettres modernes','Étudiant','Intermédiaire','Je voudrais suivre cette formation car je le suis rendu compris que le monde cours vers le numérique aujourd\'hui.\r\nPour moi,se faire former dans un tel domaine, c\'est garantir son avenir.','À la fin de cette formation,je souhaite  avoir une maîtrise parfaite de plusieurs systèmes informatiques en la matière.','Je me vois en tant que manager ou inventeur d\'une application ou d\'un site d\'information.','Je pense au créateur des sites web et des applications,des programmeurs web.','Internet',NULL,NULL),(33,36,'c2a533fb-d801-3734-8343-592cd7a30cf2','Étudiant','2022','Université de Parakou','Gestion','Étudiant','Débutant','Je veux suivre cette formation car je trouve que c\'est une opportunité pour moi d\'apprendre sur le numérique. J\'ai de forte motivation pour ce domaine.','À la fin de cette formation je veux être en mesure de créér des sites web, de créer des applications, de savoir sur la cyber sécurité.','Je pense que d\'ici 3 ans je dois apporter de nouveau dans le numérique.','J\'imagine que c\'est un métier passionnant','Internet',NULL,NULL),(34,37,'09e2e508-9239-39b6-8d1f-4c73a269f270','License','2010','UAC','Géographie et Aménagement de territoire','Salarié','Débutant','Pour avoir plus d\'aptitude et m\'offrir plus d\'opportunités.','D\'abord réussi brillamment et être utile à mon entreprise','Le meilleur développeur et encodeur du Bénin','Intéressant et passionnant','Internet',NULL,NULL),(35,38,'f75e9b04-c75e-3918-a4e4-03a997d5ec7b','License','2012','IRgib Africa university','Licence professionnelle en TIC','Salarié','Intermédiaire','Je suis particulièrement intéressé par cette formation dans un premier temps parce que je vux réellement monter en competence dans développement et le codage mais aussi parce que c\'est la toute première fois que j\'entends parler d\'un programme de formation dispensée par une université de votre rang au Benin.Je suis donc enthousiaste à l\'idée de faire partir de cette aventure.','A l\'issue de cette formation j\'aimerais etre capable de créer aisément une application , de travailler sur des projet de développement de systèmes informatique en qualité de développeur','D\'ici 3 ans déjà je devrais être en mesure de d\'intégrer équipe de développeurs et tres vite devenir un tech lead pour coordonner des mission de codages','Le métier de développeur pour moi est un métier qui permet réellement d\'appliquer notre savor faire informatique aux besoins de nos utilisateurs.  Il n\'est pas basé sur des principes rigides car il nous mets aux services des autres(demandeurs)','Internet',NULL,NULL),(36,39,'445055b9-58ab-3d16-8b0e-645b090e5614','Étudiant','2022','École Supérieure de Gestion, d\'Informatique et des Sciences (ESGIS-BENIN)','Informatique, Réseaux et Télécommunications/ Architecture Logiciel ( IRT/AL)','Étudiant','Débutant','J\'aimerais suivre cette formation parce que je suis un passionné de la programmation','Mes attentes par rapport à cette formation sont l\'acquisition de nouvelles connaissances et une facilité d\'insertion professionnelle','Dans 3 à 5 ans je me voir comme un grand Développeur full stack en freelance','Pour moi un développeur est un informaticien qui réalise des logiciels et les mets en œuvre à l\'aide de langages de programmation','Par un ami',NULL,NULL),(37,40,'cd14dd55-0445-3771-8bcf-4c71ba858f59','License','2022','FAST/UNSTIM','Mathématiques et informatique','Étudiant','Intermédiaire','Je voudrais suivre cette formation pour améliorer mes compétences en coding et aussi pour régler des problématiques grâce au codage','J\'attends de cette formation qu\'elle soit beaucoup pratique et qu\'elle permette une véritable insertion professionnelle','Dans 3ans ou 5ans, je me vois en tant que développeuse codeuse, aidant des entreprises et des personnes à résoudre des problématiques grâce à des programmes informatiques, mettant mes connaissances de coding à disposition pour mettre en place des algorithmes de Machine Learning. Embrasser aussi la carrière de Data Scientiste.','Rédiger des codes à des fins utiles, développer des programmes faciles en prendre main et être prêt à innover','Par un ami',NULL,NULL),(38,41,'a7724c72-b33c-3fc1-b588-2a4779f60242','License','2020','ISM Adonaï','Droit des Affaires','Étudiant','Débutant','Acquérir et développer des compétences nouvelles. Éveiller la curiosité.','Ouverture de nouvelles perspectives professionnelles. Obtention d’un diplôme reconnu ( gage d’employabilité ).','Être épanouie professionnellement et personnellement.','Exigeant, Énigmatique','Internet',NULL,NULL),(39,42,'ec4c25a5-6530-3e74-b4ff-80afcccd6f9f','License','2018','Université d’Abomey- Calavi','Espagnol','Sans activité professionnelle','Débutant','Je suis un homme honnête  , rigoureux ,assidue qui aime apprendre. \r\nJe veux suivre cette formation pour acquérir plus d’expérience  dans le domaine du web  afin de pourvoir réaliser mes projets. Puisque tous mes projets sont dans ce domaine .','Mes attentes par rapport à cette formation est  de sortir de cette formation avec un niveau élevé dans le domaine du  développeur web pouvant me permettre de gagner ma vie.','Dans 3 ans je me vois être un super développeur codeur , avec  une entreprise.','Comme un métier assez passionnant,qui nécessite assez de patience et beaucoup de recherche.','Internet',NULL,NULL),(40,43,'af919a7a-125e-3b95-b0a4-f24914b27b93','Étudiant','2022','Esgis','Informatique réseau et télécommunication','Étudiant','Intermédiaire','Oui. Même si la véritable formation se fait de façon personnelle à travers les recherches, j’aimerais bien suivre pour en apprendre d’avantage','Devenir meilleur qu’avant. Faire de moi un des meilleurs codeurs du pays','Avoir mon studio de codeur','Selon moi c’est un travail assez relax. Il faut juste réfléchir à des solutions digitales pour régler les problèmes des gens','Par un ami',NULL,NULL),(41,44,'c6c9ecc7-0692-38b2-87c1-0a143cd23112','Étudiant','2015','Esgiss','BTS','Sans activité professionnelle','Débutant','Pour réussir ma vie et m\'ensortir.','Devenir un lideur dans mon domaines.','Voyage vers mon lieu de travail.','Passionnant et très innovent.','Par un ami',NULL,NULL),(42,45,'3861cc9f-a8c0-3037-a967-3d516bbf6d71','Étudiant','2022','UATM-GASA','Système Informatique et Logiciel','Étudiant','Débutant','Je veux suivre cette formation pour approfondir mes connaissances dans le domaine de la programmation qui est une passion pour moi dans un premier temps, utiliser les compétences que j\'aurai acquises pour résoudre des problèmes courant dans ma société mais aussi profiter de l\'assurance d\'être recruté juste après afin d\'avoir quand même un avenir rassuré.','En premier lieu la rigueur et du sérieux au cours de la formation, une bonne implication de chaque participants et bien sûr avoir un maximum d\'acquis à la fin, sans oublier un diplôme qui me permettra de me positionner sur le marché de l\'emploi.','Dans 3 ans , 5ans, j\'aurais bien sûr déjà terminé ce cursus si je suis retenu évidemment et je l\'espère bien, être ensuite parmi les étudiants recrutés. Quelques soit l\'issue, la programmation étant ma passion je me vois développeur-codeur dans  les trois prochaines années. L\'important c\'est d\'être en mesure en ce moment là d\'apporter des solutions techniques aux différentes problématiques de la société.','C\'est un métier où on ne finis jamais d\'apprendre, il faut se cultiver chaque jours, savoir se débrouiller tout seul, c\'est pas un métier fait pour une personne peu motivée.','Par un ami',NULL,NULL),(43,46,'33e1f3fd-a22f-3493-8478-40f0b1cee049','Étudiant','2018','HECM-Bénin','Banque et Finance d\'Entreprise','Sans activité professionnelle','Intermédiaire','Il y a quelques années que j\'ai découvert les métiers du numérique et depuis lors ma passion à toujours été de travailler en tant que concepteur et créateur de programme/code, car j\'ai beaucoup d\'imaginations. Mon objectif est de créer des solutions ou participer à la création de solutions pouvant aider le développement des Hommes. J\'ai donc commencé à chercher des cours et des programmes en ligne pour mieux m\'informer, apprendre et maitriser la programmation/codage.\r\nJe veux suivre cette formation parce qu\'en plus d\'être ma passion je suis convaincu qu\'il y aura un programme de cours bien structurer de façon pédagogique et aussi des experts qualifiés à ma disposition pour m\'aider à bien atteindre mon objectif de devenir développeur/ codeur.','Par rapport à cette formation, mes attentes sont les suivants :\r\n\r\n- Avoir et développer des compétences dans le domaine du développement/codage.\r\n- Apprendre de l\'expérience des formateurs et des autres apprenants.\r\n- Vivre ma propre expérience.\r\n- Pouvoir participer à de projets réels et gagner en compétence et en expérience. \r\n- Développer des compétences relationnelles et mieux comprendre le travail en équipe dans le domaine du développement/codage\r\n- Renforcer ma personnalité.\r\n- Travailler mes capacités d’évolution et d’adaptation.','Dans 3 ans, 5 ans, je m\'imagine avoir passé avec succès les examens de la formation développement/codage de HIGHFIVE University, et que je travaille sur un projet avec une équipe d\'expert dans les locaux de HIGHFIVE University ou une structure en collaboration avec HIGHFIVE University.','J\'imagine le métier de développeur codeur comme un métier pour lequel celui qui l\'exerce doit être passionné, curieux, autodidacte, autonome, rigoureux, sociable, imaginatif et créatif.','Par un ami',NULL,NULL),(44,47,'9d9c6e02-4f77-33e6-a331-e13b6c019ff7','License','2017','Abomey Calavi','Économie Appliquée','Salarié','Débutant','Je veux suivre cette formation pour diversifier mes connaissances, avoir plus de cordes à mon arc afin d\'être plus compétitif sur le marché de l\'emploi.','À la fin de cette formation j\'aimerais bien être capable de rédiger un langage informatique pour développer un site internet, un logiciel ou une application.','D\'ici 3 ans j\'aimerais bien avoir au moins un site wep bien élaboré à mon actif, être incontournable dans mon domaine et surtout productif dans l\'entreprise dans laquelle je serai. D\'ici 5ans j\'aimerais avoir pourquoi pas un cabinet d\'expert en codage pour non seulement aller à la conquête des grands marchés nationaux et internationaux, être un créateur d\'emploi et partager mes expériences avec les jeunes qui désirent exercer dans le domaine.','Pour moi c\'est un métier d\'avenir qui doit être vraiment passionnant puisque l\'objectif est de rendre la tâche beaucoup plus facile aux entreprises dans l\'atteinte de leurs résultats, et nécessiter beaucoup plus de concentration, de curiosité, de créativité et de l\'innovation.','Par un ami',NULL,NULL),(45,49,'57c9ab4c-1d9c-3fcb-9a58-3d659c5dfeb7','License','2017','Université d\'Abomey-calavi','Entrepreneuriat et Gestion des PME (EGPME)','Salarié','Courant','Je suis prêt à tout quitter pour intégrer votre université.\r\nJe suis Melchior Bankole, \r\nJe suis jeune, curieux et passionné pas la technologie. J\'ai développé une passion pour le codage lorsque je cherchais à acquérir des compétences pratiques dans un secteur d\'avenir. J\'ai pas eu la chance de faire une école d\'informatique. Je me suis donc lancer dans le codage en auto-apprentissage pour acquérir les bases de la programmation. Votre formation constitue pour moi une occasion, non pas pour approfondir mes connaissances en codage, mais pour apprendre ce métier et en faire une carrière.','-Une formation de qualité et professionnelle,\r\n-Une rigueur et un bon suivi.','Je me vois gagner ma vie avec le métier de développeur en créant une startup.','C\'est un métier d\'avenir, offrant la possibilité de travailler en freelance. C\'est un métier qui demande d\'avoir un bon sens d\'analyse et d\'être disposé à passer la majeure partie de son temps devant les écrans d\'ordinateur.','Internet',NULL,NULL),(46,50,'c7b6f6e2-9fbe-36d9-94ae-dbcc772e5f48','License','2020','École Supérieure des Sciences de Gestion et d\'Informatique','Comptabilité Contrôle Audit','Salarié','Bilingue','Il est sans équivoque, aujourd\'hui, que toutes activités quel qu\'elle soit ne peut fonctionner sans l\'informatique. Cela étant l\'alphabet de demain ne sera pas celui qui ne saura pas lire ni écrire mais celui qui ne saura pas coder. Je voudrais alors me former très tôt pour répondre au besoin de la programmation qui se fait déjà sentir.','Je m\'attends qu\'à l\'issue de cette formation je sache bien développé des applications, créer  des logiciels et surtout concevoir des Intelligences Artificielle.','D\'ici 5ans je me vois à la tête d\'une entreprise qui a pour métier de créér des outils informatiques adaptés au besoin de chaque entreprise.','J\'ai toujours vu le métier de développeur codeur comme un métier de créateur de solution. \r\nNous avons toujours voulu  faire nos courses, accomplir des tâches et régler nos problèmes en deux temps trois mouvements via des applications et des logiciels.\r\nLe métier de Codeur réponds à ce besoin.\r\nJ\'ai toujours imaginé ce métier comme la colonne vertébrale de toute activité dans le futur.','Par un ami',NULL,NULL),(47,51,'ad18738c-ca7b-39f4-b77f-033347a71dfa','License','2020','Ecole Nationale d’économie appliquée et de management','Administration des réseaux informatiques','Salarié','Intermédiaire','Cette formation cadre parfaitement avec mon background universitaire et me permettra d’être un développeur aguerri aux normes internationales.','À la fin de cette formation je veux être capable de développer des applications web évolutives  et sécurisées pouvant répondre à des problématiques ou à des besoins spéciaux.','Dans 3 ans je serais un développeur aguerri ayant un emploi bien rémunéré. \r\nDans 5 ans je serais sûrement à un poste de responsabilité et j’aurais plus d’expérience via l’accroissement  des connaissances acquises via les travaux en  entreprise.','Le codeur c’est celui qui rend la plus facile grâce des outils numériques faciles d’utilisation et sécurisées','Par un ami',NULL,NULL),(48,52,'c62f8fea-3270-3b49-9dda-7f2da8be4434','License','2018','Faculté des Sciences Économiques et de Gestion','Comptabilité Audit et contrôle de Gestion','Étudiant','Intermédiaire','Le métier de développeur à toujours été pour moi une grande passion, car après l\'obtention de mon bac je voulais m\'inscrire dans une université privée en informatique mais faute de moyens j\'ai du faire une formation en comptabilité.\r\nAussi malgré cette formation et comme mon projet est de devenir développeur web, j\'ai du suivre des tutoriels en ligne afin de me familiariser avec HTML 5 et CSS 3 , j\'ai aussi en partenariat d\'autres amis créer des sites et écrire des lignes de code.\r\nEt je me sens un peu plus aisé dans ce domaine que la comptabilité.\r\nAvoir la chance d\'apprendre d\'avantage avec l\'opportunité que vous pourrez me donner constitut pour moi une grande chance d\'atteindre mon projet professionnel qui est de devenir développeur web.','Mes attentes en suivant cette formation sont:\r\nApprendre le PHP sur sa version la plus récente avec la version 8\r\nApprendre les syntaxes modernes du langage\r\nMaitrisez toutes les bases du langage avec les types, les tableaux et les fonctions\r\nDécouvrir comment utiliser MySQL dans vos applications\r\nMe Familiarisez avec les fonctionnalitées natives du langage\r\nMaitrisez la programmation orientée objet avec les classes, les traits et les interfaces\r\nApprendre à mettre vos applications en production avec Nginx, PHP-FPM et HTTPS\r\nDécouvrir comment Composer et l\'autoloading','Dans 3 ans j\'aimerais déjà être capable de créer des grands sites web et de développer beaucoup d\'applications utiles.\r\nDans 5 ans j\'aimerais être PDG d\'une boîte de codeur ou développeur web.','Le metier de développeur codeur est selon moi le metier qui permet de créer des sites Web dynamiques et performants aussi des applications et jeux et beaucoup d\'autres choses.\r\nC\'est un métier au coeur de l\'avenir de nos jours.','Internet',NULL,NULL),(49,53,'8996b9d2-9d3b-3665-b34d-ee4fec8ca3f2','Étudiant','2020','FASHS-Adjarra','Anglais','Sans activité professionnelle','Intermédiaire','Je veux me former parce que j’ai envie de découvrir un nouveau métier et parce que c’est un métier d’avenir. \r\nJe veux être capable créer et d’innoverJ’aimerais avoir un bon enseignant qui va m’aider à atteindre mon objectif','Je voudrais avoir un bon enseignant qui va m’aider à atteindre mon objectif, celui d’être développeuse codeuse, pourvoir créer et innover.','Dans 5ans je me vois être une développeuse full stack','J’imagine que c’est un métier très recherché par les entreprises et qui ne cesse d’évoluer. C’est un métier autonome','Internet',NULL,NULL),(50,54,'35d66bea-f796-3c04-bba8-3840ba45d457','License','2020','Haute École Régionale de Commerce International (Herci)','Commerce international','Étudiant','Intermédiaire','J\'ai toujours rêver évoluer dans le monde du digital. C\'est donc une opportunité à saisir.','Aller en profondeur du commerce mondial. Maîtriser les améliorations apportées par l\'informatique à ce domaine.','Une développeuse incontournable maîtrisant les nœuds du commerce mondial','Un métier très passionnant. Rien qu\'à y penser j\'apprécie déjà.','Par un ami',NULL,NULL),(51,55,'cccabbdc-cbf9-32ee-8c57-1713b81e0a24','Étudiant','2020','Université d’Abomey-Calavi','Anglais','Étudiant','Bilingue','J’aimerais suivre cette formation pour acquérir des connaissances dans le digital et en faire un travail dans le futur','La compétence et l’efficacité','Être un expert en domaine de codage','Très bon et prometteur d’un futur meilleur','Par un ami',NULL,NULL),(52,56,'42bf3488-a47f-31dd-ba90-2d68daba983a','License','2022','HECM Calavi','Système Informatique et logiciel','Sans activité professionnelle','Intermédiaire','Pour avoir plus de connaissances dans le domaine et montrer ce que je peux faire.','Me permettre de développer mes compétences','Être vraiment compétent pour être capable de fournir mes services à une entreprise ayant besoin de mes compétences','En un mot : Extraordinaire','Par un ami',NULL,NULL),(53,57,'0641b771-6e11-3009-90da-8c93eeddee4b','License','2014','Université d\'Abomey-Calavi','Maîtrise en Droit','Salarié','Débutant','Je suis passionné par tout ce qui a relation au web','Cette formation me permettra de devenir un expert dans le domaine','Je veux être un expert dans le domaine de développeur codeur','Être tout le temps entrain d\'apprendre et se surpasser','Internet',NULL,NULL),(54,58,'eba1a564-e555-334c-ab42-82fc7f2eb413','License','2019','Haute École de Commerce et de Management (HECM)','Banque, Finance et Assurance','Entrepreneur','Intermédiaire','Je suis de nature un passionné de l\'informatique et en particulier la programmation informatique et j\'aimerais vraiment développer cet aspect de moi et aussi apporté un plus au monde de l\'informatique si possible.','Mes attentes par rapport à cette formation est de pourvoir en maîtriser la programmation informatique et concevoir des applications pour téléphone ou logiciel pour ordinateur et faire plein d\'autres choses avec','Je veux pouvoir déjà être engagé dans diff