sez passionnant qui nécessite beaucoup de travail et de rigueur si l\'on veut se perfectionner et qui peut nourrit son homme','Par un ami',NULL,NULL),(58,62,'1013f20e-d3b2-3de1-9fb6-8cbbed099ab6','Étudiant','2022','UAC','Mathématiques fondamentales','Étudiant','Intermédiaire','Pour bénéficier des compétences informatiques liées codage. Je suis passionné du numérique et je veux apprendre sur le codage pour avoir ces compétences que je pourrai utiliser pour atteindre certains objectifs','Je m\'attends à un contenu de qualité, un contenu qui contient tous le nécessaire à savoir. Un contenu qui me permettra d\'être un codeur ou un développeur.','Si j\'ai la grâce d\'obtenir cette bourse de formation je me vois à m\'imposer dans différents entreprises avec ma compétence, non seulement au Bénin mais également à l\'extérieur.','Je trouve que c\'est un métier qui demande l\'intellect. J\'imagine qu\'on peut faire de grandes choses aujourd\'hui avec les codes. Le monde d\'aujourd\'hui a besoin des informaticiens. Tout se développe aujourd\'hui à travers la technologie.','Par un ami',NULL,NULL),(59,63,'87b1123e-0216-3f92-a8b3-6cc6879206eb','Master','2009','GASA FORMATION','MASTER EN TÉLÉCOMMUNICATION ET RESEAUX','Sans activité professionnelle','Intermédiaire','Cela fait plusieurs années que je fais mon autoformation en développement sans réaliser de manière concrète un vrai projet de développement. Alors que l\'avenir de la planète se résume à l\'intelligence Artificielle. Je voudrais faire partir de ceux là qui pourront contribuer à l\'émergence de mon cher pays que notre président est entrain de moderne. Grâce à cette formation je pourrai contribuer au développement mon pays comme le fait en ce moment notre président','Plus de projets dans la pratique en adéquation avec les besoins du marché béninois et international','Je serai parmi les meilleurs développeur béninois','C\'est un métier qui a toute sa place au coeur du Bénin actuel et dans le développement des nations.','Internet',NULL,NULL),(60,64,'d99eef35-fa1f-3690-b1f5-0e07747e2de0','License','2021','ESGT','Entrepreunariat et Gestion des projets','Sans activité professionnelle','Débutant','Avec l\'évolution de la technologie et mon ambition qui est la gestion des projets je veux me perfectionner dans la technologie et me mettre vraiment sur le marché de l\'emploi','Réussi à développer une application et à avoir la maîtrise de l\'informatique ainsi être formateur à la base sur TIC','Dans 3ans voir 5 ans être développeur professionnel et recherché sur le marché de l\'emploi','Le métier du développeur est très important et recherché pour la nouvelle génération ainsi que dans nos entreprises','Par un ami',NULL,NULL),(61,65,'3f1f5137-da2c-3ae2-86d9-fbbe6d351cc7','License','2017','Abomey calavi','Mathématiques fondamentales','Étudiant','Intermédiaire','Je m\'appelle Marcel HOUETO titulaire d\'une licence en mathématiques fondamentales et aussi technicien en maintenance informatique et GSM .je suis depuis toujours intéressé pas le domaine de la technologie notamment le numérique .je crois que votre formation me donnera une solide connaissance dans le domaine du numérique et je me rends très disponible pour y participer.','Je souhaiterais avoir une bonne base dans le codage','Mon rêve est de créer un centre de maintenance informatique et de développement d\'applications mobiles et aussi la sécurité informatique.','Le développeur codeur créé des sites web et internet ,des applications mobiles grâce à l\'utilisation des languages de programme comme Python, Java, PHP et bien d\'autres.','Par un ami',NULL,NULL),(62,66,'4668e89e-eb08-30b5-be11-931af35d1784','Master','2019','Université d\'Abomey-Calavi','Réseaux Informatiques et Systèmes d\'information','Entrepreneur','Bilingue','Suivre votre formation serait, pour moi, l’opportunité de bénéficier d’un environnement de travail de qualité, de compléter ma formation, de renforcer mes connaissances et d’acquérir de solides compétences en Analyse et Programmation informatique','A la fin de cette formation , je voudrais être apte  à répondre de façon efficace et efficiente  aux besoins des entreprises/institutions privées comme publiques en matière de conception/développement de solutions  informatique','je voudrais être développeur Codeur dans une entreprise/institution nationale  et/ou internationale , ou à défaut ouvrir mon propre cabinet de développement.','Un développeur Codeur est un informaticien spécialisé dans la conception (imagination, création, réalisation, écriture, tests et documentation) des applications à l’aide d\'un ou de plusieurs langages de programmation','Internet',NULL,NULL),(63,67,'93fc721e-9aaa-3e62-b89c-3e4376f6b883','Étudiant','2019','Abomey-calavi','Sociologie-Anthropologie','Étudiant','Intermédiaire','D’abord le métier développeur codeur fait partir de ma passion parce que j’aime tous ce qui touche à la technologie et ensuite c’est une opportunité pour moi de réaliser mes rêves.','J’espère être à la hauteur si réellement je suis sélectionné et donner elle meilleur de moi même par rapport à cette opportunité et j’espère que les formateurs vont faire de nous des cadres dans le domaine.','J’imagine que je serai un expert en matière de développeur codeur.','J’imagine que c’est un métier en rapport avec l’homme et la technologie vu que j’ai fais la sociologie anthropologie une science qui étudie les rapports de l’homme dans la société.','Par un ami',NULL,NULL),(64,68,'70fdd0a8-0029-371e-a979-4907f210de04','Étudiant','2019','UAC','Sociologie','Étudiant','Intermédiaire','Pour acquérir plus de connaissances et être recruté par une entreprise','J\'espère le positif','Je me vois travailler à vipp Interstis et être un bon employé','Je vois ce métier comme l\'un des meilleurs métiers en secteur technologique','Internet',NULL,NULL),(65,69,'2b72f56c-c259-389c-84ca-51d74414bab3','License','2019','Université Catholique de l\'Afrique l\'Ouest','INFORMATIQUE DE GESTION','Sans activité professionnelle','Intermédiaire','Pouvoir développer une vrai carrière de data analyste ou d\'analyste programmeur, voilà quelle est mon ambition depuis 2020 déjà. Malheureusement, d\'une part je me heurte  au système éducatif en place et d\'autre part je suis confronté à ma propre situation financière. HIGHFIVE à travers ce programme viens donc me permettre de débuter cette carrière sans avoir à être confronté à cette réalité qui m\'empêchais de faire mes premiers pas.','Un encadrement de qualité et une pédagogie permettant une réelle immersion dans le quotidien professionnel d\'un programmeur.','En plein cœur de l\'analyse et du traitement massif de données au sein d\'une grande équipe stimulante? Et centre des prises de décision dans de grandes firmes (Banque, data center, telecom, start up, OI...)? Travaillant à mon propre compte? Plusieurs perspectives d\'avenir que j\'aurai le temps d\'assoir tout au long de mon parcours.','Un monde où la limite de l\'imagination et de la créativité n\'est définit que par celui qui le gouverne. Un métier capable de simplifier et de rendre des tâches plus autonome favorable ainsi à une meilleure productivité.','Internet',NULL,NULL),(66,70,'6e5c746a-5a49-3c07-8465-932c313ac06a','License','2019','Haute École de Commerce et de Management','Réseaux Informatiques et Télécommunications','Sans activité professionnelle','Intermédiaire','Bien souvent la formation professionnelle est synonyme d\'évolution mais elle peut également rimer avec réorientation. Allez vers le monde du numérique c\'était un choix pour moi depuis la base et j\'aime être au cœur (au centre) de la technologie, donc ajouter cette formation de développeur à ma carrière fera partir des métiers sollicités dans l\'avenir.','Mes attentes pour cette formation c\'est de répondre à une exigence professionnelle, renforcer mes capacités et apprendre de l\'expérience collective pour devenir une organisation apprenante','D\'ici dans 3ans à 5ans si une entreprise me recrute pas je serai à mon propre compte et actuellement je suis en free-lance et je touche à tout ce qui réseau et maintenance informatique.','C\'est un métier sollicité mais la plupart aujourd\'hui ne code plus parce qu\'ils utilisent des raccourcis pour écrire les programmes et ça devrait pas être ainsi. Quand on parle de développeur il faut aller à un rythme pour coder, écrire tout le code et non par des raccourcis.','Internet',NULL,NULL),(67,71,'1eda8030-35fb-36ad-80a3-87c32fe43f11','License','2021','HECM Haut École de Commerce et de Management','Marketing Communications et Commerce','Sans activité professionnelle','Débutant','C\'est un rêve pour moi. Les métiers du digital ont toujours suscité mon intérêt. J\'ai pour ambition d\'aider considérablement mon pays et l\'Afrique dans son développement durable et pour moi les métiers du digital sont les meilleurs moyens d\'y arriver. Mon continents est en retard sur la scène du digital et les opportunités comme celle ci sont rares, il faut donc en profiter pour relever le défi.','Avoir le maximum d\'armes possible pour être parmi les meilleurs développeur.','Je me vois entrain d\'être soliciter par les plus grosses boîtes pour mon expertise.','Je n\'en sais pas grande chose mais je crois qu\'il doit être passionnant et remplir de challenge.','Par un ami',NULL,NULL),(68,72,'ff2e7690-5e61-3fcb-801b-df55d33850cf','License','2020','Université d\'Abomey-Calavi','Analyses biomédicales','Étudiant','Intermédiaire','Je me passionne pour le métier de développeur et je nourris des projets d\'innovation digitale dans le domaine de la santé.','Acquérir un maximum de connaissances et d\'outils dans le domaine pour en faire un métier et les appliquer à des projets personnels.','Comme une professionnelle du développement et du codage, révolutionnant le milieu de la santé grâce à ses capacités acquises','Un développeur codeur est en quête permanente d\'innovation et de créativité.','Internet',NULL,NULL),(69,73,'4c67bb6f-c65e-34b6-81af-0c6bf4c33ece','License','2022','ENAM','Administration générale et territoriale','Étudiant','Débutant','Pour plus apprendre tout d\'abord et saisir l\'occasion de donner le meilleur de moi même.','Réussir à pourvoir utiliser cette formation pour devenir une meilleure codeur au sein des entreprises','Avoir une situation financièrement stable, apprendre plus pour acquérir de nouvelles connaissances, être quelqu\'un de meilleure dont on entendrait parler pour être une source de motivation pour les jeunes.','C\'est en quelque sorte analyser les besoins de l\'entreprise, c\'est quelqu\'un qui peut écrire du code','Par un ami',NULL,NULL),(70,74,'3b90afc9-877b-390c-8d84-7be1840e3d36','License','2020','EPAC, Université d\'Abomey-Calavi','Génie biomédical et hospitalière (GBM)','Sans activité professionnelle','Débutant','Je suis vraiment passionné par le numérique et j\'ai longtemps cherché un moyen d\'apprendre ce métier en plus de ma formation dans le domaine médical. Mon but principal, c\'est de combiner la puissance de l\'informatique à la médecine pour révolutionner le secteur.','Je veux que la formation soit claire et bien cibler, une formation qui répond aux demandes sur le marché','Dans 3 ans, je veux déjà avoir dans mon pays une petite entreprise avec une équipe constitué des beninois(e)s comme moi qui sera spécialisée dans la conception des jeux vidéos. C\'est ce que j\'ai en tête pour l\'instant, mais je compte sur la formation pour mieux m\'orienter ( il y a peut-être plus mieux)\r\nDans 5 ans, je compte vraiment devenir indépendant, maîtriser les rouages du code et gagner ma vie tout en étant développeur codeur.','Le code, c\'est de l\'art et tout ce qui relève de l\'art demande de travail et de la persévérance pour arriver à bout. Le développeur codeur, c\'est celui qu\'il faut pour révolutionner notre pays, le Bénin plus principalement dans la digitalisation des données.','Par un ami',NULL,NULL),(71,75,'3288d2de-b0b2-3714-ac7c-5c1a7c16ba6f','License','2014','Université de\'Abomey Calavi','Statistique-économétrie','Sans activité professionnelle','Débutant','Je suis passioné du developpement depuis quelques années et j\'essaye de m\'autoformer sur des plateformes tel que openclassrom. J\'ai toujours voulu avoir une formation structurée mais je ne dispose pas de moyens conséquent pour me la payer. Ainsi votre offre est une opportunité pour moi car une fois retenu je pourrais réaliser mon rêve celui de devenir un data analyste.','Développer des compétences en développement afin de les faire valoire .','D\'ici 3 ans je souhaiterais être apte pour exercer le métier de data analyste.\r\nD\'ici 5ans intégré une grande entreprise pour faire valoir mes compétences.','Une domaine de ceux qui trouve des solution innovante basé sur le numérique','Internet',NULL,NULL),(72,76,'958d23e1-b4e8-3181-afa3-7785cf98be3e','Étudiant','2017','UAC','Physique Chimie','Sans activité professionnelle','Débutant','Pour acquérir de nouvelles compétences et faire une réorientation professionnelle','Acquérir de nouvelles compétences, Avoir des opportunités d\'emploi...','Travailler dans une structure qui me permettra de grandir dans ma carrière professionnelle','Le métier développeur permet de créé des solutions informatiques et digital .','Par un ami',NULL,NULL),(73,77,'8f6ec619-062f-3d67-a9b1-f89510641f54','License','2019','Abomey- Calavi','Licence en économie option analyse et politique de Développement (APD)','Sans activité professionnelle','Débutant','Je veux suivre cette formation car nous allons de plus en plus en profondeur dans un monde du digital','Finir un bon développeur','Une excellente source dans le digital.','C\'est un bon métier','Internet',NULL,NULL),(74,78,'8df52f14-21f1-306a-b187-ccb8d591d0b5','License','2015','Ecole Nationale d\'Economie Appliquée et du Management - ENEAM))','Gestion des transports et logistique','Salarié','Intermédiaire','Le digital est au cœur de tous les secteurs d\'activité.\r\nEn ma qualité de technicien de l\'aviation à l\'aéroport de Cotonou, j\'ai pu noter l\'importance du digital dans le quotidien des activités aéroportuaires notamment au niveau de l\'exploitation sur la plateforme. Plusieurs logiciels peuvent être mis en place pour faciliter la gestion et améliorer le rendement des agents.\r\nPour le moment grâce à ma petite connaissance en Excel, j\'essaye de proposer des tableaux de bords mais recevoir une formation en digital ameliorera encore plus mes propositions et renforcera mes capacités pour apporter au secteur de l\'aviation civile au Bénin un plus considérable en matière d\'outils.','-Réaliser une interface web dynamique pouvant stocker et récupérer des données pour faciliter la gestion à l\'exploitation sur la plateforme aéroportuaire \r\n- Réaliser une interface web en adéquation avec les besoins utilisateurs en termes d\'ergonomie et d\'accessibilité.','Développer plusieurs applications pour booster le secteur aéronautique au Bénin notamment dans les domaines de l\'exploitation, de la sûreté, de la sécurité....','Le métier de développeur codeur est de nos jours incontrôlable pour faire évoluer les différents secteurs en leurs proposant des applications et logiciels qui répondent à leur réalité de travail.Le développeur doit avoir l\'esprit de synthèse, d\'analyse, la capacité à résoudre des problématiques, l\'autonomie et la débrouillardise afin de monter en compétences et de surmonter les difficultés techniques rencontrées.Il fait de la veille technologique pour se renseigner et ne pas se laisser dépasser par l\'innovation constante du milieu de l\'informatique.','Internet',NULL,NULL),(75,79,'1a271c81-7045-354e-a4dc-83229e698594','License','2016','Irgib Africa','Procédé de production','Sans activité professionnelle','Courant','J\'ai toujours voulu faire l\'informatique mais j\'ai eu d\'autres orientation. Ceci est une chance pour moi de me rattraper surtout que ma formation de base ne m\'a pas encore permis de m\'insérer professionnelle depuis que j\'ai fini.','L\'informatique est notre quotidien, j\'aimerais pouvoir apprendre à exploiter ce domaine qui est notre outil de tous les jours. Et surtout pouvoir être capable de faire valoir les compétences que j\'aurai à acquérir dans ce domaine.','Je me vois déjà avec ma propre équipe de codeur à travailler d\'arrache-pied sur différent projet.','Les compagnies que recrute des développeurs son nombreuse dans le monde. Avec cette compétence je serai capable de travailler de chez moi pour n\'importe quelle compagnie qui aurait besoin de ce service. Aussi c\'est un domaine pas trop développé dans notre pays alors je voudrais pouvoir faire parti des premiers.','Par un ami',NULL,NULL),(76,80,'738f615e-5734-38a9-bfc1-6368d2c2dde6','Étudiant','2022','PIGIER BENIN','Gén Logiciel et Réseau','Étudiant','Débutant','Je veux suivre cette formation parce que j’ aime le développement web. J’aime l’informatique.','Mes attentes sont de sorti meilleur de ma promotions \r\nAcquérir des connaissances en informatique \r\nSorti entant que grand développeurs','Dans 3ans ou 5ans je serai un grand développeur codeur rechercher dans le monde .Oui c’est mon objectif','C’est le meilleur .C’est le métier de l’avenir . Non seulement sa c’est mon avenir .','Par un ami',NULL,NULL),(77,81,'1b690819-0485-3dec-9745-9b5db5274fb6','Master','2018','ESGIS','Master Professionnel Sécurité Réseaux et Système','Salarié','Intermédiaire','Avoir des connaissances approfondies en développement d\'applications et web.','Etre en mesure de développer de bout en bout des applications (web et autres)','Responsable IT avec des connaissances en réseaux système, sécurité et génie logiciel','passionnant et très promoteur','Par un ami',NULL,NULL),(78,82,'d9a7e50b-7a90-3c06-8160-65375ba44ed9','Étudiant','2019','Ucao','Droit','Entrepreneur','Débutant','Je voudrais m\'inscrire à cette formation parce que j\'ai toujours été passionné par l\'univers de la tech mais je n\'avais pas de possibilité pour m\'y former et pas d\'accès à une bonne formation. Au