tion en web design mais mes moyens étaient limités. Mon désire était là mais je n\'avais personne pour me soutenir.','Maîtriser tous les coins et recoins du codage. À savoir HTML, CCS...;\r\nÊtre compétitif sur le marché l\'emploi;','Devenir un Start-up.','Le métier de développeur codeur est le spécialiste de la programmation web.','Internet',NULL,NULL),(104,112,'774b92e6-6e16-3ee2-b9fa-8e72d4852428','Étudiant','2017','UAC','CBG','Entrepreneur','Intermédiaire','Aujourd\'hui le numéro étant un secteur phare du développement de presque toute activité, et dans l\'option d\'une reconversation professionnelle, j\'ai fais une formation professionnelle organiser en développement web a l\'IFRI a l\'UAC en collaboration avec EIG-Bénin. \r\nCette formation me permettra d\'avoir plus de notions, de connaissance et de m\'améliorer.','Mon attente est d\'avoir plus la main dans le codage des sites dynamique et de pouvoir créer mes propres identifiant dans mes codes.','Dans 5ans, monnplus grand rêve est de créer des Platforms premièrement médical pouvant aider les gens à s\'orienter vers les hôpitaux selon leurs spécificités et de savoir les pharmacies de garde et secondo social pouvant rivaliser avec les Facebook, WhatsApp, tik-tok sur le plan mondial.','C\'est juste passionnant de voir tout ce qui est derrière ce que le client ou l\'internaute voir.','Par un ami',NULL,NULL),(105,113,'fb5bd592-75f5-3f47-90d3-98dea2c8c0a8','Master','2020','ESGT-BÉNIN','Finance Comptabilité Audit','Entrepreneur','Débutant','Explorez le digital','Devenir un professionnel en matière digital','Avec une expérience et compétence accrue','Très intéressant','Internet',NULL,NULL),(106,114,'d17e0586-faa8-3627-84ed-44c0d0c88fca','Étudiant','2016','Université Polytechnique Internationale Obiang Nguema Mbasogo','Diplôme Universitaire de Technologie en Génie des Télécommunications et Réseaux','Sans activité professionnelle','Intermédiaire','Toujours à la quête d’acquisition de nouvelles compétences, d\'expériences et aussi un grand passionné du monde digital, je désire suivre cette formation, dans le but d\'augmenter ma plus value et de pouvoir les faire valoir sur le marché de l\'emploi digital.','A la fin de cette formation, j\'aimerais pouvoir être capable de dérouler tout seul, des projets de conception web, de développement et de programmation.','Dans 3 ans, 5 ans , je m\'imagine être un développeur certifié avec une grand portfolio capable de lancer sa start-up ou son agence 360° de communication a succès du pays pourquoi pas de la sous-région ... et par la même créer de l\'emploi pour les talents qui souhaiteraient faire carrière dans le secteur.','Comme tous les métiers de la nouvelle ère informatique d\'ailleurs, je l\'imagine étant un métier d\'avenir, dont les acteurs sont indispensables pour toutes entreprises ou particuliers qui souhaiteraient faire connaître leur activités business à la face du monde entier. Je pense aussi qu\'il faut faire preuve de beaucoup de créativité pour arriver à se démarquer de la flopée de développeurs qui arrivent dans le métier.','Par un ami',NULL,NULL),(107,115,'9ebe72b4-6c75-3db3-8b27-60d63cd6c165','License','2021','UATM GASA Formation','GÉNIE ÉLECTRIQUE ET INFORMATIQUE','Sans activité professionnelle','Intermédiaire','J’aimerais suivre cette formation parce que je suis passionné par le codage informatique (J’ai eu à bidouiller quelques lignes de code et je trouve ça amusant) et je cherche un moyen de me professionnaliser dans ce secteur afin de vivre de ma passion.\r\nAussi j’aime aider les autres à atteindre leurs objectifs et je crois qu’avec toutes les compétences que j’aurais à acquérir à HIGHFIVE University, je pourrais apporter ma modeste contribution à l’évolution de la technologie en Afrique et dans le monde.','- Maîtriser les bases des langages informatiques.\r\n- Être capable à la fin de mon cursus de développer des applications ou des sites internets de A à Z.\r\n- Être capable d’intégrer une équipe de développement et de collaborer efficacement avec les autres membres de l’équipe sur des projets.','- D’ici 3 ans j’aspire être un développeur full-stack opérationnel (Diplômé de HIGHFIVE UNIVERSITY) travaillant sur des projets challengeants dans une multinationale ou une startup.\r\n- Et dans 5 ans j’espère être d’une part un développeur expérimenté, manager d’une équipe de développement dans une multinationale ou promoteur d’une startup innovante dans la technologie; D’autre part Formateur à HIGHFIVE ou dans d’autres universités du Bénin et de la sous-région afin de transmettre ma passion et les bonnes pratiques du métier aux plus jeunes.','Le Développeur Codeur est une personne qui comprend les besoins d’un client, conçoit, réalise et teste des applications, sites internets et des logiciels.  Aussi c’est quelqu’un qui aime résoudre des problèmes complexes et nouveaux en apportant des solutions innovantes ce qu’il trouve d’ailleur très gratifiant, qui collabore avec d’autres développeurs et corps de métiers.','Internet',NULL,NULL),(108,116,'c21954de-31b4-3629-89f6-429f43dc75ab','License','2021','PARAKOU','Droit public','Sans activité professionnelle','Intermédiaire','Je suis déjà une formation en développement web et le digital. Cette formation me permettra d\'acquérir des compétences nouvelles qui me permettront de créer des solutions innovantes dans le digital.','Acquérir des connaissances dans le domaine de la codification, de cybercriminalité pour pouvoir bien sécurisé les applications et les sites.','Créer une entreprise qui offre tout solution de digitalisation aux entreprises et créer des   applications et des sites super sécurisé','Un peu complexe','Internet',NULL,NULL),(109,117,'48c48683-946e-3acb-af35-588f87f5676c','Master','2018','uiversity','filiere','Étudiant','Courant','messagemessagemessagemessagemessagemessagemessagemessagemessagemessage','messagemessagemessagemessagemessagemessagemessagemessagemessagemessage','messagemessagemessagemessagemessagemessagemessagemessagemessagemessage','messagemessagemessagemessagemessagemessagemessagemessagemessagemessagemessage','Presse',NULL,NULL),(110,118,'b817534f-a1a8-357f-b7c9-2539823c23f2','License','2022','UNSTIM/ Abomey','Mathématiques informatique appliquée','Étudiant','Intermédiaire','L\'informatique est une science stimulateur et qui m\'intéresse bcp','Savoir programmé','Être un ingénieur en informatique','Sa serait un métier passionnant','Par un ami',NULL,NULL),(111,119,'87173a9a-eece-31b9-a910-983832fdfd6a','Étudiant','2022','INJEPS','Développement communautaire','Étudiant','Intermédiaire','Parce que le digital est ma passion','Mes attentes sont\r\nMaîtriser tour ce qui a rapport avec le digital, savoir créer un site web hyper optimiser, et le développer, les applications, tout parce que le numérique est incontournable','Oui le numérique est incontournable de nos jours, du coup je serai toujours à l\'aise','Oui c\'est un bon métier','Par un ami',NULL,NULL),(112,120,'12566549-27bd-36db-8597-7a35b9e33779','Étudiant','2019','Parakou','Baccalauréat','Étudiant','Intermédiaire','Je veux suivre cette formation en informatique parce que c\'est un secteur d\'avenir et très vital','Une formation de qualité près à répondre aux attentes des participants','Avec la formation reçue je pense que je puisse avoir une capacité nécessaire pour développer un partenariat avec les gens du domaine.','C\'est un secteur d\'avenir et très vital dans un monde déjà informatisé...... permet aussi une protection maximale et efficace de la vie numérique privée d\'un individu. C\'est aussi un secteur générateur de revenus.','Internet',NULL,NULL),(113,121,'9e8c4edf-8bb8-32dd-9c98-940462cc504f','License','2017','Université de Parakou','Licence Professionnelle en Aménagement et Gestion des Aires Protégées','Sans activité professionnelle','Intermédiaire','J\'ai toujours été un grand passionné de l\'informatique et de la programmation. Les orientations académique et le manque de moyens m\'ont amené à prendre une formation par défaut. Vu qu\'il n\'est jamais tard pour les études, je crois que cette opportunité me permettra de faire quelques choses que j\'aspire réellement et qui me passionne. \r\nCelà sera vraiment une joie pour moi d\'être dans la cohorte de 30 étudiants pour cette formation.','Je veux tout d\'abord apprendre le concept de codage, me familiariser à cet univers et enfin de compte la maîtriser. Ça sera une toute nouvelle expérience pour moi, et j\'espère vraiment m\'y épanouir.','Dans 5ans je me vois finir la formation de deux ans au sein de Highfive University, puis aller faire une certification au sein d\'une université canadienne ou ailleurs en fonction de mes opportunités. Je me vois déjà réussir et épanouie dans le métier de codeur.','Pour être tout à fait honnête, très stylé... Rester derrière mon ordinateur et passer mes soirées à codé afin de finaliser un projet m\'excite déjà à commencer l\'aventure avec vous','Par un ami',NULL,NULL),(114,122,'376e239a-b9cc-3f1a-a43e-7d1fc293a4be','Étudiant','2022','GASA formation','Système informatique et logiciels','Étudiant','Débutant','Je veux suivre cette formation parce que j\'adore l\'informatique','J\'aimerais qu\'elle soit efficace','Excellent codeur','C\'est un bon métier et amusant pour ceux qui l\'aime particulièrement','Par un ami',NULL,NULL),(115,123,'b96995f2-4c13-3836-9356-2469ec0d29fd','Étudiant','2020','UAC','Linguistique','Étudiant','Intermédiaire','J\'aimerais suivre cette formation car depuis toujours ma passion a été l\'informatique notamment le codage','Acquérir des savoirs de codage et d\'être doué dans le codage. \r\nDe réaliser ma passion qui est l\'informatique précisément le codage.','J\'espère que dans 3 à 5 ans j\'aurais un bon niveau dans le codage et j\'avoue que je serai pour de vrai un grand développeur codeur.','c\'est un métier passionnant et difficile mais pas trop pour celui qui est vraiment passionné par ce métier et c\'est un métier qui est depuis des siècles au centre du développement d\'un pays ou d\'un continent.','Par un ami',NULL,NULL),(116,124,'aadeada6-c50e-3c8d-9741-ba51af4f7351','License','2021','Université Abomey calavi','Jaou joseph Fernand M. Ahissou','Sans activité professionnelle','Débutant','Pour être professionnel dans un domaine','Je veux être au bon niveau','Être un professionnel du développeur Codeur','Pas\r\n tellement','Par un ami',NULL,NULL),(117,125,'455cec90-10af-3491-bf54-401b203e305e','Étudiant','2019','Sas com','Plombier','Sans activité professionnelle','Débutant','Pour mieux me renseigner','Formation Claire','Expert programmation','Métier d\'avenir','Internet',NULL,NULL),(118,127,'486caa9e-7fc1-3e39-926b-edb44babc145','License','2021','Université Catholique de l’Afrique de l’Ouest','Droit','Sans activité professionnelle','Intermédiaire','Je voudrais suivre cette formation car j’ai une réelle passion pour l’informatique et en particulier pour le codage. Je suis quelqu’un d’autodidacte et donc en plus de ma formation en droit, je me suis penché sur l’informatique en raison de ma passion et aussi à cause de ma curiosité.','Mes attentes par rapport à cette formation sont multiples. Je voudrais déjà avoir un diplôme en codage en acquérant assez de connaissance et après voler de mes propres ailes en trouvant du travail dans une boîte qui me permette de m’épanouir','Dans 3 ans je me vois dans la section informatique qui gère l’Anip. Dans 5 ans je le vois bien dans une boite en Europe','Je l’imagine comme un métier avec beaucoup d’exigences mais également avec beaucoup d’opportunités','Internet',NULL,NULL),(119,128,'b6aa8f00-457b-3c6a-9f6a-4fa9e385cee1','Étudiant','2022','Université d\'Abomey Calavi','Gestion comptable','Étudiant','Intermédiaire','Cette formation m\'intéresse car elle me permettra de pouvoir suivre des cours en informatique comme je l\'ai toujours voulu','Après cette formation, j\'espère avoir un très bon niveau en informatique.','Je m\'imagine dans 3 ans avec un très bon niveau en informatique. Un niveau assez élevé pour arriver à développer mes propres logiciels et en 5 ans en faire davantage.','Le développeur codeur est responsable de la programmation, c\'est-à-dire de la production de lignes de code avec les langages informatiques (c++, python, java etc...), il rédige et suit un ordre pour obtenir le résultat dont il a besoin, il code, il développe.\r\nLe métier de développeur codeur est de développer des logiciels que lui confie son supérieur hiérarchique ou des clients.','Par un ami',NULL,NULL),(120,130,'5f9c06b1-35db-3e4d-a05d-f7402faa53da','License','2015','Université d\'Abomey-Calavi / UAC','Géographie','Entrepreneur','Débutant','Actuellement je suis rédacteur web SEO et je suis convaincu que cette formation sera l\'approfondissement de toutes les connaissances que j\'ai acquises dans le métier du web. J\'envisageais déjà une formation en codage. Cette formation est donc une opportunité que je veux saisir pour apprendre, découvrir et approfondir mes connaissances.','J\'attends de cette formation qu\'elle soit productive, pratique et créative. J\'espère vivement qu\'à mis chemin de cette formation, j\'aurai déjà à mon actif quelques aptitudes pour participer à un projet du web. A l\'issue de cette formation, j\'espère et je suis convaincu que je serai opérationnel et un développeur web confirmé.','Dans 3 ans, j\'aurai déjà fini de suivre la formation et je mettrai sans doute mon expertise au service d\'un projet. Progressivement dans 5 ans, je suivrai d\'autres formations complémentaires, vu que les web évolue constamment. Je serai à ce moment un développeur codeur confirmé, capable de gérer et coordonner un projet web de façon autonome.','Le métier de développeur codeur selon moi, consiste en la création d\'outils tels que des logiciels, des applications et aussi des sites web. Il s\'agira pour le développeur codeur de programmer ces outils et de les rendre fonctionnels à travers des process informatiques précis.','Internet',NULL,NULL),(121,132,'e4a86b0b-01c8-3348-bb03-1b1022e41c61','Étudiant','2022','Up','Fm','Étudiant','Intermédiaire','Pour explorer d\'autres horizons de la vie .','Une formation pour un avenir meilleur et certains.','Avec un statut stable représentatif .','Bien dans les règles de l\'art avec une attention bien accrue.','Par un ami',NULL,NULL),(122,133,'8214bfd2-511a-3ea7-a980-c1af07bd5935','Étudiant','2022','Université d\'Abomey-Calavi','Science Juridique','Salarié','Intermédiaire','Je suis passionné de la technologie et j\'entrevois les applications que je pourrai en faire avec mes idées de projets, de plus je crois que toutes les secteurs d\'activité de nos jours sont impactés par le numérique et ce n\'est qu\'une question de temps pour que tous le monde se reconvertisse dans les métiers du numérique.','Je souhaite avoir des notions en matière de développement des solutions numérique application à grande échelle à des activités qui ne sont pas forcément du domaine du numérique, je m\'intéresse au développement, au Codage et a l\'intelligence artificielle. Désolé pour le manque de précision mais je suis en pleine découverte des métiers du numérique.','Je voudrais dans 3ans être une personne qui développe des solutions numérique non seulement pour le boostage de mes activités ou idées de projets mais aussi qui propose des solutions numérique sur demande à des particuliers ou entreprise, je veux aussi être un formateur dans le domaine du numérique pour le partage de connaissances afin d\'aider plus de jeunes à vite se positionner pour profiter de la révolution du numérique. Je veux enfin avec d\'autres jeunes développer des solutions numérique pour l\'émergence de mon pays et celui de l\'Afrique.','Le pense que le développeur codeur est quelqu\'un capable de mettre en place des systèmes numériques ou physique ayant la capacité de résoudre des problèmes ou répondre à des attentes à la manière d\'un cerveau humain donc en imitation de la personne humaine, ces implication sont nombreuses','Par un ami',NULL,NULL),(123,134,'dc3d22c0-66ae-3c1e-aeb8-2df0f57510d7','Étudiant','2019','Ucao','Droit','Sans activité professionnelle','Débutant','Je souhaite rejoindre cette formation afin d\'acquérir les compétences et aptitudes indispensables au métier de développeur codeur.','À l\'issue de cette formation, j\'attends à être capable de mette en pratique sur de réels projets et en toute autonomie les connaissances acquises durant cette formation.','Dans les prochaines années je me projette entant que développeur accomplir maîtrisant largement le domaine du code et des aptitudes nécessaires à réalisation de ce métier. À travers un approfondissement des connaissances acquises.','Je vois le métier de développeur codeur comme un métier passionnant offrant diverses opportunités. Mais surtout exigeant un grand sens de la responsabilité.','Par un ami',NULL,NULL),(124,135,'b3fb8d8c-59e8-3a1b-928d-03b26bdb3e0e','Étudiant','2020','UAC','Espagnol','Sans activité professionnelle','Débutant','Acquérir de connaissances pratiques et professionnelles dans le domaine','Cette formation puisse me permettre de me prendre en charge et me garantir l\'insertion professionnelle','Jouir pleinement de mon statut d\'auto-entrepreneur, développeur.','C\'est un métier de l\'avenir et en plein essor de nos jours','Internet',NULL,NULL),(125,136,'3beacadf-186f-3c48-94a2-fda5b90fa0a6','License','2016','UNIVERSITE CATHOLIQUE DE L\'AFRIQUE DE L\'OUEST (UCAO-UUC)','LICENCE PROFESSIONNELLE en Informatique de Gestion','Sans activité professionnelle','Intermédiaire','J\'aimerais faire partie des bénéficiaire de cette formation car avant tout cela cadre avec ma formation de base. Ensuite cela me permettra d\'acquérir de nouvelles connaissances afin de me rendre plus apte à faire face aux exigences des entreprises qui bénéficieront de nos services.','D\'abord donné le meilleur de moi même pour bénéficier pleinement de tous ce qui doit être fait au cours de cette formation. \r\nQue nos formateurs ou professeurs soient vraiment disponibles et disposer à nous encadré comme il le faut afin que nous puissions bien assimilé tous ce qui doit être fait','Ma projection dans 3 ans c\'est d\'être le plus compétitif sur le marché du travail après ma formation.','C\'est un métier vraiment passionnant et plein de rouages car il est indispensable dans presque tous les domaines de travail aujourd\'hui. Car toutes les applications utilisées aujourd\'hui sont des codes.','Par un ami',NULL,NULL),(126,137,'7d7801e0-7c48-35e0-9cb9-e332dd273cc2','Étudiant','2015','Université d\'Abomey-Calavi (UAC)','Faculté de Droit et de Sciences Politiques (FADESP)','Sans activité professionnelle','Débutant','Outre le fait que cette formation soit pour moi une opportunité de faire ce que j\'ai toujours voulu faire c\'est-à-dire le développement Web et le codage, c\'est aussi pour moi l\'occasion d\'acquérir les bases de ce métier et de me performer dans ce domaine en vue de poursuivre ma carrière professionnelle.','Au terme de cette formation, j\'espère être un élite dans le rang des développeurs - codeurs ceci grâce aux connaissances acquises durant notre formation.','Dans 3 ans, être un bon développeur - codeur utile pour l\'entreprise\r\nDans 5 ans avec l\'expérience, être un expert.','Développeur - Codeur un métier passionnant, utile pour la société et incontournable avec l\'avancé actuelle des TIC (Technologies de l\'information et de la communication)','Par un ami',NULL,NULL),(127,139,'8221a3d6-abed-36ce-b644-216013d23433','License','2022','UPI-ONM','Transport logistique','Sans activité professionnelle','Débutant','Je veux suivre cette formation pour acquérir plus de connaissances que ce que j\'avais .','Être capable d\'apporter un plus a la société','Être capables de gérer ma propre entreprise','Un métier de génie','Internet',NULL,NULL),(128,140,'548caa9e-7148-3d31-a105-cbb673609502','License','2020','Abomey-Calavi','Science Politique','Étudiant','Intermédiaire','Aujourd\'hui tout tourne autour du digital donc cette formation est une opportunité pour moi de mieux comprendre les rouages.je suis aussi un peu dans le domaine des cryptos monnaies, le trading et le E-commerce donc c\'est une raison de plus pour mieux apprendre de nouvelles connaissances.','Comme je l\'ai dit tantôt c\'est de mieux comprendre le fonctionnement du digital car c\'est un domaine très vaste et tout aujourd\'hui tourne autour de ça.Donc c\'est une opportunité pour moi d\'apprendre un peu plus sur ce domaine.','Être un très bon développeur et codeur pour mieux jouir de ses fruits.','C\'est un métier qui est un peu rare au Bénin.Il n\'y a pas beaucoup de personnes qui s\'y rattachent contrairement au autre métier alors que le besoin ce sens vraiment sur le marché.Donc c\'est un très bon métier qu\'il faut vraiment apprendre pour gagner les avantages autours','Par un ami',NULL,NULL),(129,141,'7851ad3d-7080-30ef-8d5d-130b28adb265','License','2022','Université de Parakou','Licence professionnelle en informatique de gestion','Étudiant','Débutant','J\'aimerais suivre cette formation pour élargir mes connaissances dans le domaine de l\'informatique et pouvoir améliorer ma compétitivité','À la fin de cette formation, pouvoir coder plus rapidement et de manière beaucoup plus performante. Apprendre à utiliser de nouveaux outils','Je pense travailler en freelance tout en ayant ma propre entreprise de digital.','Le métier de développeur codeur nécessite un esprit logique, de la détermination, beaucoup d\'apprentissage pour se maintenir au parfum des nouvelles technologies mais il est surtout très intéressant.','Par un ami',NULL,NULL),(130,143,'b48450f2-973f-3887-a8bf-846a6250bda6','License','2021','Ucao-uuc','Informatique et Télécoms','Sans activité professionnelle','Intermédiaire','La programmation et/ou le développement est un domaine qui me passionne ; je voudrais suivre cette formation pour avoir des compétences réelle dans le domaine et également à cause de  la garentie employabilité','Vue le cadre de formation vendue j\'attends d\'apprendre j\'attends d\'être formé correctement','Dans trois ans je pense que je serai déjà suffisamment compétent pour servir,pour employer, et pour former d\'autres personnes\r\nDans cinq ans je pense être l\'un des plus bon développeur et ayant travaillé sur de nombreux programmes qui battent les records en matière de performance','J\'imagine le métier de développeur comme un métier où on peut travailler de partout où l\'on se trouve et dans tous les pays','Par un ami',NULL,NULL),(131,144,'48cc1c0f-d81a-3813-bef8-87e1d4876142','Master','2020','EPAC','Sourou Ulrich KINHOEGBE','Salarié','Intermédiaire','J\'ai fait les réseaux télécoms à l\'Ecole Polytechnique d\'Abomey Calavi après j\'ai commencé à travailler avec une entreprise commerciale en tant que Chef d\'Agence parceque les offres qui me parvenaient et encore aujourd\'hui sont dans le domaine du développement informatique, c\'est la j\'ai compris l\'importance et le besoin réel d\'être développeur. Ce projet va me permettre de rattraper le temps, pour moi c\'est un nouveau départ.','Devenir et embrasser la carrière de développeur.','Travailler en tant que développeur professionnel dans une structure informatique.','Être développeur c\'est construire des plateformes à travers les technologies informatiques existantes.','Par un ami',NULL,NULL),(132,145,'866a1101-a9b5-337d-a9ae-49b50e8d2bae','License','2022','Université d\'Abomey Calavi','Entrepreneuriat et Gestion des PME','Entrepreneur','Débutant','Ça été toujours mon rêve de me lancer dans le monde du digital . Mon projet est d\'avoir une grande entreprise dans le monde du numérique comme Alibaba, Amazone,AT&T et autres géant du domaine','Être meilleur dans le domaine du web développement , rencontrer aussi des experts en numériques et intégrer entièrement leur monde .','Créer une équipe pour la gestion de ma première entreprise dans le monde du digital .Une entreprise sur le marché du digital qui sera le plus axés sur la clientèle au Bénin  d\'ici 5 ans .','Fascinant,et inspirant','Internet',NULL,NULL),(133,147,'82500f3d-74b1-3d71-a315-b935e7785b0e','License','2022','Pigier BENIN','Audit et contrôle de gestion','Sans activité professionnelle','Intermédiaire','Avoir des connaissances en développement et codage a toujours figuré sur ma liste de projets prioritaires; car étant consciente de l\'importance et l\'impact de ce domaine sur n\'importe quel autre.\r\nEt aujourd\'hui je tiens à saisir cette chance que vous m\'offrez afin de réaliser ce projet qui me tient à cœur.','Au cours de cette formation j\'aimerais :\r\npouvoir créer les sites même les plus difficiles qu\'ils soient;\r\nSavoir décoder tous les outils et programmes informatiques ;\r\nAvoir un niveau irréprochable en développement et codage.','Je me vois concilier mes connaissances antérieures (en comptabilité,audit et contrôle de gestion) et mes nouvelles connaissances acquéries en développement et codage.\r\nCeci ayant pour but d\'être capable de monter tout type de logiciels, programmes ou sites dans ce domaine ou dans n\'importe lequel , qui résoudent des problèmes.\r\nJe me vois surtout être là meilleure dans ce que je fais.','J\'imagine ce métier comme étant très créatif et recherché par les entreprises ; un métier très passionnant qui ne cesse d\'évoluer et qui est très utile dans tout secteur d\'activités.','Internet',NULL,NULL),(134,149,'489ef3fc-3485-3ecd-bacd-1dd28a471139','License','2020','UNIVERSITÉ POLYTECHNIQUE INTERNATIONALE UPIB','Gestionnaire ou Management des Ressources Humaines','Sans activité professionnelle','Intermédiaire','Parceque je suis passionné du digital','Avoir un niveau Professionnel dans la digitalisation','Me positionner dans le monde des codeurs en Afrique et dans le monde','C\'est un bon métier','Internet',NULL,NULL),(135,150,'6d27460b-887b-32af-b2f6-6de5f8968372','Étudiant','2022','Ecole Normale Supérieure de Porto-Novo','BAPES- Anglais','Étudiant','Intermédiaire','Je voudrais suivre cette formation dans le cadre d\'une \"reconversion professionnelle\". En effet, mon diplôme actuel vaut surtout dans l\'enseignement. Pourtant, j\'ai toujours aimé l\'informatique, et côtoyer un ami qui fait des merveilles avec des lignes de codes m\'a fascinée et convaincue. Le manque de moyens avait bloqué mon envie d\'en apprendre plus pour m\'y consacrer.','Je m\'attends à ce que cette formation m\'arme des outils qu\'il faut pour me retrouver dans ce monde en constante évolution technologique et pour mener à bien mes missions.','Dans 3 ans, je dois avoir terminé ma formation et, pleine d\'expériences aussi diversifiées et challengeantes les unes que les autres, je pourrais toucher le domaine éducatif dans mon pays et proposer des solutions pratiques et pertinentes afin d\'allier convenablement technologie et enseignement, afin de faciliter l\'apprentissage et l\'enseignement dans nos écoles.','Le métier de développeur codeur est une activité à plein temps, qui nécessite de grandes aptitudes de logique. C\'est un métier très prenant qui fait appel a des langages du web afin de répondre aux besoins et demandes des clients.','Internet',NULL,NULL),(136,151,'c58d50fd-c6a6-304f-bb3f-6537936a51da','Étudiant','2022','UAC','BAC D','Étudiant','Intermédiaire','J\'ai toujours voulu être développeur .Donc c\'est une opportunité pour moi de me mettre dans ce monde que j\'ai tant voulu .Merci beaucoup d\'avance !','je suis prêt pour suivre cette formation et travailler pour votre entreprise','être un super développeur et aller de l\'avant .','C\'est un métier d\'intélligence qui permet de créer des logiciels , d\'établir des niveaux de sécurité .','Internet',NULL,NULL),(137,152,'6b2b5c20-b104-38b8-ab31-bcb0057c9c04','License','2015','ESGIS BENIN','IRT','Salarié','Débutant','J\'ai quelques notions et j\'aime innové','Être capable de développer des projets qui profitent au différents utilisateurs','Être un développeur senior','Il demande de l\'investissement de soi et l\'ouverture d\'esprit','Internet',NULL,NULL),(138,153,'f5e00331-17db-3d82-b395-6a697b11b55d','License','2020','Université d\'Abomey-Calavi/FASHS ADJARRA','Anglais','Sans activité professionnelle','Intermédiaire','J\'aimerais suivre cette formation parceque je le désirais depuis mais faute de moyens. Aussi pour pouvoir travailler avec le groupe VIPP.','Apprendre à réaliser une analyse technique, créer et programmer des sites internet , élaborer des tests de vérification, réfléchir et apporter des solutions possibles','Dans 3 ans, je me vois déjà créer plusieurs sites internet instructives, contribuer à des projets en fonction de développeuse. Dans 5 ans, je me vois apprendre à d\'autres ce que je sais faire dans le domaine également.','En collaboration avec les chefs projets  et les commerciaux','Par un ami',NULL,NULL),(139,154,'043e1634-07fd-35e2-a076-aa95b8ff54ca','Étudiant','2016','École Nationale de la Statistique, de la Planification et de la Démographie','Statistiques','Sans activité professionnelle','Intermédiaire','La programmation est tout ce que j\'aime et je voudrais de toutes mes forces devenir développeur Web full stake','J\'attends d\'avoir un niveau assez intéressant de cette formation et j\'ai la ferme conviction que ce sera le cas afin d\'être utile dans le monde du développement Web.','D\'ici 5 ans, je me vois développeur Full Stake sénior avec un excellent niveau et une compétence assez particulière pour faire face aux défis du monde du numérique.','Je m\'imagine développeur Web full stake et assez outillé et performant pour apporter de l\'innovation dans le monde du numérique','Par un ami',NULL,NULL),(140,155,'8cefa424-99df-380d-840d-bcf509230dd7','Étudiant','2022','CENTRE UNIVERSITAIRE D\'ADJARRA','Anglais','Étudiant','Courant','Je veux suivre cette formation pour acquérir de nouvelles connaissances sur le digital','Avoir des competences d\'une développeur influente pour pouvoir accéder aux entreprises liés à cette formation','-Être bien douée pour résoudre les ploblèmes traits à l\'informatique;\r\n-Être le créateur d\'un logiciel ou bien plus d\'une application informatique;\r\n-Assurer la sécurité informatique','Il conçoit, développe et met au point un projet d\'application informatique, de la phase d\'étude à son intégration, pour un client ou une entreprise selon des besoins fonctionnels et un cahier des charges.','Par un ami',NULL,NULL),(141,156,'39aa0842-f7cf-3b50-8856-846b58ec15a5','License','2013','UAC','Histoire et archéologie','Salarié','Débutant','Je suis passionné par tout ce qui est codage et digital.','Avoir de la compétence dans le domaine du numérique et très utile dans le monde d\'aujourd\'hui et de demain.','Travailler dans une très grande structure à l\'intérieur ou l\'extérieur ou être à mon compte avec une structure personnelle qui propose une solution innovante.','Un métier passionnant et très indispensable aujourd\'hui, vu le développement du monde. Tout est ou presque numérique aujourd\'hui.','Internet',NULL,NULL),(142,159,'b7f88991-14a9-3031-92af-207de2ecf76d','Étudiant','2015','UpiONM','Agronomie','Sans activité professionnelle','Débutant','Je veux suivre la formation par ce que ça fait plus de 4ans que je suis à la maison sans aucun diplôme professionnel. C\'est aussi une ambition pour d\'être formé dans le métier de digital.','Maîtriser parfaitement les outils de la nouvelle technologie. Devenir un génie en digitale. Un bon codeur','Devenir incontournable en informatique. Un grand innovateur en développement technologique.','Un métier de développeur de codeur, savoir codeur des applications, des logiciels, participer à l\'innovation technologique. Un développeur codeur est un incontournable dans le domaine de l\'informatique.','Internet',NULL,NULL),(143,160,'920b2cba-5a0e-3173-8dce-8c1d61c41cb2','License','2019','Université de parakou','Finance et comptabilité','Salarié','Débutant','Parce que j\'ai toujours souhaité une telle formation dans ma vie','Être dynamique dans ce secteur','J\'arriverai à créer une agence grâce ma compétence et mes relations','Développer son pays à l\'aide du numérique','Internet',NULL,NULL),(144,161,'a5de0449-270d-3c83-9a88-838974795caa','License','2022','UPI-ONM','Réseau Informatique et Télécommunications','Entrepreneur','Intermédiaire','Je suis à la quête de la connaissance pour améliorer mon niveau surtout dans mon domaine et aussi compte tenu de mes visions future.','Plus de pratique, opportunités secondaires et de nouvelles notions.','Être un ingénieur en réseau et Télécommunications.\r\nÊtre aussi un entrepreneur.','Motivant, un métier prometteur.','Par un ami',NULL,NULL),(145,162,'67aee61c-41a7-3b71-95fe-13a809b8369f','License','2020','Université d\'Abomey Calavi','Linguistique option communication','Sans activité professionnelle','Débutant','Je veux suivre cette formation parce que cette filière est l\'avenir.','J\'espère que celle ci me permettra d\'ouvrir moi-même une entreprise.','Pour être honnête je pense finir mes études en sciences juridiques et pourquoi pas commencer les masters. Je serai aussi un grand entrepreneur.','C\'est un bon métier.','Internet',NULL,NULL),(146,163,'d1dfac99-c7b3-3066-a8a8-4dbec491bd55','Étudiant','2018','Université d’Abomey Calavi','Baccalauréat','Sans activité professionnelle','Débutant','C’est une opportunité pour moi de faire cette formation à fin de mieux me rendre utile pour La clientèle','La liberté financière, travailler à mon propre compte.','Dans 5ans je me vois entrain de devenir  un grand développeur codeur qui développe des grandes plateformes.','Le métier  de développeur codeur doit pas trop compliqué avec une bonne formation','Par un ami',NULL,NULL),(147,165,'d7d49756-e7a3-31ab-b589-d9ea01e7adfa','Étudiant','2021','Université d\'Abomey Calavi','Transport et logistique','Sans activité professionnelle','Intermédiaire','Je suis un jeune passion de l\'informatique et puis précisément de la programmation. J\'ai commencé une formation en génie électrique et informatique juste après mon bac ce que j\'ai pas terminé faute de moyens. \r\nCette peut m\'aider à atteindre mon rêve.','Programmation des systèmes embarqués et l\'intelligence artificielle.','Dans 3 ans je suis un starp up qui montre les opportunités du web pour réduire le taux du chômage.','C\'est un métier de passion et de détermination. C\'est un métier qui nécessite de recherche continu.','Internet',NULL,NULL),(148,166,'b43263a8-5cb1-34b3-a73b-bc0a52e7580b','Étudiant','2022','UAC Abomey-calavi','Flacc (Anglais)','Étudiant','Intermédiaire','Je suis un passionné de l’informatique ,j’aime apprendre des autres et je sais m’adapter au divers milieu.','Au cours de cette formation, je m’attends à beaucoup de challenges et de découvertes dans le domaine du numérique.','Dans trois ans je me trouve un niveau plus intéressant qu’au départ avec beaucoup de bagages intellectuels dans le domaine de l’informatique et du codage.','Selon moi c’est le métier de l’avenir.','Par un ami',NULL,NULL),(149,167,'a723713e-b0b5-367e-91ef-4cbef27c525e','License','2018','ESCAE-BENIN','Comptabilité Audit et Contrôle de Gestion','Sans activité professionnelle','Débutant','Je suis très passionné du développement web','Je veux bien maîtriser le cours, maîtriser bien le savoir faire dans ce domaine.','Je me vois être un grand développeur incontournable','C\'est un très bon métier que j\'adore toujours','Par un ami',NULL,NULL),(150,168,'c1f834f4-69b0-350f-87f0-1a85ade695f3','License','2016','Ecole Nationale d\'Economie Appliquée et de Management','Statistique','Sans activité professionnelle','Débutant','Je suis intéressé par cette formation car j\'ai toujours soif d\'apprendre.Je pense sincèrement que ce sera une grande plus value pour moi si j\'allie les compétences à acquérir à ma formation de base en statistique.De plus je suis convaincu que cette formation sera faite dans des standards internationaux.','J\'espère acquérir des compétences théoriques et surtout pratiques en programmation web/informatique.Je souhaite comprendre profondément les différents modules de formation: il faudrait qu\'au terme de la première année j\'aperçoive les liens entre les matières et ce en quoi cela sera utile dans mon futur métier.','Dans 3 ans, 5 ans je me vois en tant que  grand développeur, pour des sociétés de renoms. J\'espère  surtout être épanoui sur les projets où j\'intervient.','Dans ce métier, il faudrait être capable de s\'adapter au contexte de chaque entreprise. Il faudra être capable d\'innover.','Internet',NULL,NULL),(151,169,'f6e66e2d-b3ab-3c64-be2a-a5b0adfba105','License','2018','ESCAE BENIN','Banque finance assurance','Salarié','Débutant','Je veux suivre cette formation afin de cerner et connaître la programmation web pour combler les manques et les attentes dans ce domaine sur le plan national et international.','Comme attentes, je souhaiterais que cette formation me fournira les enseignements nécessaires pour acquérir des compétences dans le domaine de développeur Codeur.','Je me projette dans 3 , 5ans comme l\'un des développeurs incontournables sur le plan national et international.','Le métier de développeur Codeur serait un métier très impressionnant et très pluridimensionel. C\'est aussi un métier qui rendra libre financièrement.','Par un ami',NULL,NULL),(152,171,'ad96a3e1-9e9e-3943-a364-83d321909d32','Étudiant','2018','Université d\'Abomey-calavi','Licence professionnelle deuxième année en économie appliquée.','Entrepreneur','Courant','Je souhaite suivre cette formation afin d\'acquérir des connaissances en développement codage. Une fois acquise, je les mettrai au service des entreprises publiques et ou privées de mon pays en particulier et dans le monde en général.','Après cette formation, je souhaite avoir une attestation de réussite. Aussi, je souhaite avoir si possible une insertion professionnelle dans une entreprise spécialisée.','Dans 3 à 5 ans je me vois être un vrai développeur codeur de renommée. Je serai recherché par beaucoup d\'entreprises du domaine.','Le métier de développeur codeur est un métier multifonctionnel qui va demander énormément l\'utilisation des outils informatiques et de la connaissance de l\'anglais à l\'écrit qu\'à l\'oral.','Internet',NULL,NULL),(153,172,'81b5010e-859c-3e91-bd7a-5b02271d2ac8','Étudiant','2018','Parakou','Lettres modernes','Sans activité professionnelle','Intermédiaire','Je veux avoir une nouvelle formation et avoir un diplome professionel.Car, de plus en plus c\'est le secteur de la digitalisation qui reserve accez d\'emploi. Je veux apprendre un nouveau metier.','Mes attentes c\'est d\'avoir de très bonne compétence pour faire face aux attentes des entreprises. Et enfin , encourager et même inciter les jeunes à faire comme moi. Et faire developper cette formation dans la sous région','Dans 3 ou 5 ans , je pense que ce serait un nouveau secteur porteur du vecteur d\'emplois','Ça c\'est un secteur qui n\'est pas encore sur le marché africain, alors, ça apporte un avenir meilleur pour les pays africain','Internet',NULL,NULL),(154,173,'90294f7c-03ec-3710-8651-2494d76ce4ef','Étudiant','2017','Université des Sciences et Technologies du Bénin','Télécommunications et Réseaux','Sans activité professionnelle','Débutant','Je voudrais suivre cette formation pour: savoir et apprendre à coder; élaborer des algorithmes pour la résolution des problèmes auxquels les entreprises sont confrontés. Je voudrais m\'investir dans la programmation des jeux vidéos et aussi dans la blokchain qui sont des filières embryonnaires aujourd\'hui.','J\'attends par rapport à cette formation, savoir et maîtriser tous les rudiments du métier de développeur codeur; trouver à la fin de la formation  l\'accompagnement de l\'entreprise afin de créer mon agence de conception de l\'intelligence artificielle.','Je serai dans trois ans un concepteur incontournable de l\'intelligence artificielle. Dans cinq ans, j\'aurai une agence de programmation de l\'intelligence artificielle, des jeux vidéos et de la blokchain au Bénin.','C\'est un métier d\'avenir et toutes les entreprises ont besoin de son service.','Internet',NULL,NULL),(155,174,'97eacafb-456d-3c07-b860-7c42e59e8259','Étudiant','2017','Abomey-calavi','Philosophie','Sans activité professionnelle','Débutant','On m\'appelle FELE Omer, je fus étudiant en troisième année de philosophie en  2018. Orphelin de père , j\'ai du abandonner le campus en cette année pour me débrouiller dans la vie active. Alors je voudrais suivre cette formation pour d\'abord cerner la notion de codage , ensuite approfondir les connaissances dans ce monde digital et enfin renforcer mes compétences sur le métier de codage.','Mes attentes après cette formation sont celles d\'être capable d\'exercer le métier pour lequel je me suis formé.','Je me projette dans 3 ou 5 ans être le PDG de mon entreprise.','J\'imagine que le métier de développeur codeur sera un métier génial qui exigerait beaucoup de concentration et qu\'il est un métier d\'avenir.','Internet',NULL,NULL),(156,175,'9086a3b5-283a-3b1d-a02f-8df8e0407286','License','2022','UATM GASA FORMATION','Marketing communication et commerce','Sans activité professionnelle','Intermédiaire','J’aimerais suivre cette formation parce que ma formation actuelle ne me permet pas d’avoir un réel impact sur le monde d’aujourd’hui.Depuis un certain temps Je suis à la recherche d’un moyen de me professionnaliser dans ce secteur et je crois que le programme de l’université HIGHFIVE est une chance pour moi de réaliser ce rêve qui est  d’être utile à notre monde qui est de plus en plus numérique.','-Maîtriser les bases des langages informatiques, \r\n-Être capable d’intégrer une équipe de codeurs afin de travailler sur des projets.','-Dans 3ans je serai un développeur prêt à l’emploi et à travailler sur n’importe quel projet.\r\n-Dans 5ans j’aurai acquérir assez d’expérience pour être manager d’une équipe de développement.','Un codeur c’est quelqu’un qui conçoit, réalise et teste des applications en se servent des langages informatiques. Il doit être en mesure de comprendre ce qu’on lui demande de concevoir.','Internet',NULL,NULL),(157,177,'f2d487d5-5b85-3237-a6dd-7e1f3f51dfef','Étudiant','2019','Université d\'Abomey-Calavi (UAC)','Mathématique Informatique Appliquée (MIA)','Étudiant','Débutant','Franchement parlant, la raison pour laquelle je me suis inscris en MIA après mon BAC, c\'est de maîtriser l\'outil informatique au maximum possible parce-que cela a toujours été et demeure toujours une passion pour moi.  Mais comme sur cette terre , tout ne se passe pas toujours comme l\'on le souhaite, j\'ai dû rebrousser chemin (laisser les études Universitaires) pour des raisons que je voudrais taire, afin de me lancer dans une formation professionnelle (électricité bâtiment) étroitement liée à la série que j\'ai faite (la série C).\r\n  C\'est au cours de cette formation , que cette opportunité en or se présente à moi; une opportunité dont qui me laisse bouche B, une formation gratuite en développement et codage avec une quasi-garanti d\'embauche.\r\n\r\nC\'est une occasion en or.','Je m\'attends à faire un grand pas vers l\'accomplissement de mes rêves par la  maîtrise parfaite du développement et du codage ; être le meilleur afin d\'être utile et employé pour servir l\'entreprise.','Être un développeur codeur indispensable pour HIGHFIVE University ou être le fondateur d\'une école de développement codage','Pour dire vrai , c\'est un métier de passion, de rêve et qui révolutionne la technologie à notre époque. À cette époque, c\'est un métier qui rend, si je peux m\'exprimer ainsi , Maître.','Par un ami',NULL,NULL),(158,178,'ef3aa0b8-7077-3626-a97f-a628120c8685','Étudiant','2020','Institut National de l\'Eau (INE)-UAC','Hydraulique et Assainissement','Sans activité professionnelle','Intermédiaire','Vu l\'enjeu qu\'offre les nouvelles technologies aujourd\'hui surtout celles du numérique et du digital, j\'aimerais suivre une formation de ce genre pour renforcer mes capacités dans ce domaine afin d\'être compétitif sur le marché de l\'emploi.','Par cette formation, j\'aimerais être capable concevoir des systèmes de codage à partir des algorithmes.','Je projette dans 3-5ans avoir une entreprise qui traite de l\'innovation et l\'économie verte.','Je le vois comme un métier d\'avenir,et l\'un de ceux sur qui la jeunesse africaine doit compter.','Internet',NULL,NULL),(159,179,'5136a967-ea42-3ea6-9f1b-1a4f3886f101','License','2021','UAC','Mathématiques Fondamentales','Salarié','Débutant','Maîtriser le codage des sites et applications pour en faire de source de revenu','Je veux que la formation soit de bonne qualité et que les formations nous montre les savoirs sans faire économie de savoir pour que nous soyons aussi compétent dans le métier du codage.','Je serai parmi les meilleurs développeur.','C\'est bon métier qui nécessite beaucoup de travail','Par un ami',NULL,NULL),(160,180,'680a8aa3-3c0b-31a8-955f-512d76b8c522','Master','2020','Université d\'Abomey-Calavi','Hermann','Entrepreneur','Débutant','Après les sciences juridiques et administratives, les métiers du web représentent ma deuxième passion. C\'est pour cela que je fais de la rédaction web depuis 2 ans.\r\nJe voudrais donc suivre cette formation pour me professionnaliser dans le domaine du web, notamment dans le codage. En effet, après avoir participé sans succès au recrutement du programme LEARN du Gouvernement béninois en 2021, ce sera une aubaine pour moi de me former dans un métier qui me passionne beaucoup.','J\'espère acquérir les bases nécessaires pour apporter des solutions innovantes aux problèmes auxquels je serai confronté dans le domaine informatique.\r\nJ\'attends de ce fait que la formation soit assez pratique pour me permettre de bien cerner les notions théoriques et m\'épanouir le mieux possible dans un univers qui est encore nouveau pour moi.','Dans 3 ans, je me vois avec un bagage intellectuel assez lourd pour vendre mes compétences de développeur codeur. \r\nDans 5 ans, j\'aurai acquis de nouvelles expériences professionnelles me permettant d\'être assez concurrentiel sur le marché du codage au Bénin.','Pour moi, le développeur est \"solutions maker\" qui travaille pour le compte d\'une entreprise, pour d\'un client ou qui est à son propre compte. Il a pour mission de concevoir et de mettre en œuvre des solutions numériques à partir des codes. Il peut s\'agir d\'applications, de logiciels ou de sites Internet.','Par un ami',NULL,NULL),(161,182,'09e54815-a670-3a2e-b30d-56d43cf66f96','Master','2019','ESGIS LOMÉ','Sécurité Système et Réseau','Entrepreneur','Bilingue','Le monde du digital est toujours une passion pour moi. De plus une de mes grandes ambitions est de voir l’Afrique surtout le Bénin être un pays compétitif sur le domaine de la technologie.','J’attends vraiment que cette formation me rende compétitive sur le plan international et beaucoup de pratiques dans la formation.','J’aimerais être un professeur dans le domaine du numérique et aussi travailler sur de grands projets internationaux. J’aimerais être un ambassadeur du Bénin dans le domaine digital.','C’est un métier passionnant qui demande beaucoup de soi.','Par un ami',NULL,NULL),(162,183,'31f68731-2e4b-3b20-9df2-7d266b8a4932','License','2013','ENAM','DTS','Salarié','Intermédiaire','Les metiers des tic c\'est l\'avenir et je suis tout simplement interessé par toute formation dans ce domaine','Acquecir des compétences liées aux tics','Avec des compétences qui me permettent de me mieux me vendre et de m\'accomplir.','Passionant et demandant engagement et rigeur','Internet',NULL,NULL),(163,184,'a5ab1564-700b-34c9-9bfc-1071c132f007','Étudiant','2021','Université d\'Abomey Calavi','Elodie MEGNIKPO','Étudiant','Débutant','Je voudrais suivre cette formation parce que je suis passionnée du digitale aussi que j\'ai choisis l\'option communication digitale pour mon mémoire.... \r\nLe digital pour moi est tout un autre monde de travail où grâce à juste des outils et en un clic tout un monde est servi \r\nJe voudrai faire partir de ce monde et expérimenter','Acquérir plus de connaissance dans le domaine du digit ,aller dans les profondeurs du métier du digital pour être une experte en la matière','D\'ici 3ans , je me vois experte en la matière,intervenant un peu partout et solliciter par plusieurs personnes','Intéressant, mais celà est tout un alliage pas facile aussi','Par un ami',NULL,NULL),(164,185,'c9d0061a-d10d-362b-aeec-88589eb8e610','Étudiant','2021','Université d\'Abomey-Calavi','Sociologie','Entrepreneur','Débutant','Mon insertion dans le digital','À la fin de la formation, je serais capable de créer et de développer des applications','Meilleur développeur informatique au Bénin','Le métier qui facilite le travail et permet de gagner du temps','Internet',NULL,NULL),(165,186,'9fdd146f-31b5-3b29-9c32-52e39d07c4fb','License','2022','Abomey Calavi','Génie Logiciel','Sans activité professionnelle','Intermédiaire','Parceque ça me tiens à cœur d\'être une bonne développeuse, à évoluer avec le digital','A me coacher, à avoir les aptitudes qu\'il faut faut pour être une bonne développeuse','Je ne sais où je serai dans 3 ou 5 ans mais j\'ambitionne à être parmi les meilleurs développeurs, à relever les challenges qui s\'offrent à moi','C\'est un métier de pression, challenge, de rigueur et de méthode','Internet',NULL,NULL),(166,187,'5b6adeb2-05b3-3821-8c95-1453da4531f7','License','2021','ECOLE NATIONALE D\'ECONOMIE APPLIQUEE ET DE MANAGEMENT ( UAC-ENEAM)','Statistique','Sans activité professionnelle','Intermédiaire','Passionné par les métiers du numérique depuis bien longtemps, je souhaite me reconvertir complètement dans l\'un des métiers du digital en tant que développeur full stack.','Acquérir toutes les compétences et prérequis indispensables pour atteindre l\'objectif professionnel énuméré précédemment.','Je me vois en train de travailler sur un très gros projet dans une organisation.','Je pense que le codeur, c\'est quelqu\'un qui maîtrise les codes. Cela passe parfois, ou bien souvent d\'ailleurs, par la connaissance de plusieurs langages de programmation dont les plus fréquents sont html 5/ CSS 3, Php, JavaScript, python, etc. Le rôle de ce professionnel, c\'est de créer des sites web et d\'assurer aussi leurs maintenances en respectant un cahier de charges précis afin, justement, d\'apporter de la valeur ajoutée à un client.','Internet',NULL,NULL),(167,188,'485332cb-ddb1-31a3-92bb-3339406edb38','Étudiant','2021','Abomey Calavi','Étude de la langue anglaise','Étudiant','Débutant','Je voudrais avant toute chose vous remercier pour cette initiative. Cette formation je voudrais bien la suivre par ce que cela me permettrai d\'acquérir de nouvelles connaissances et compétences surtout que c\'est mon domaine de formation réel.','Je m\'attends à ce que la formation me permette d\'aller à la découverte des langages de codification comme Java, php, python, c++...','Avec cette formation je pourrai vraiment être à un niveau donné où j\'aurai déjà à maîtriser tout les langages de codification en 3ans','J\'imagine un métier où le temps n\'y est pas en étant vraiment concentré et aller à la recherche des informations sur les nouvelles technologies et les nouvelles codifications','Par un ami',NULL,NULL),(168,190,'08b21528-9964-30b0-9a3d-5b8c3856c0c8','Étudiant','2021','UAC Abomey-Calavi','Anglais','Étudiant','Intermédiaire','J\'aimes beaucoup coder language et un grand desire de devenir programmeur.','Mieux connaitre les language de code en Htmls,Css,Java,java-script,php,C et C++.\r\nPuis avoir d\'autre connaissance dans le monde des developpeur codeur.','Je me vois comme un expert developpeur, remplir d\'ambition et de charisme.','Je l\'imagine comme un monde ou l\'on doit réfléchir et imaginer une solution à un problème. Ce n\'est pas toujours simple mais en même temps c\'est ça qui est beau dans ce métier','Par un ami',NULL,NULL),(169,192,'ec3da8e4-65af-3e36-b54b-e5279a9ed6e3','Master','2019','Université d\'Abomey-Calavi','Master recherche en statistiques spécialité Biostatistique','Salarié','Bilingue','Parce cela m\'aidera à découvrir une nouvelle aventure et si possible concilier les deux domaines.','Je m\'attends à découvrir le codage et à devenir un spécialiste.','Expert en développeur codeur.','Compliqué et je pense tout est basé sur sa vision du futur et la motivation à relever des défis.','Internet',NULL,NULL),(170,193,'62898c35-e6a0-3cb9-bdb1-5f67feb658fa','License','2019','UAC','Science naturelle','Entrepreneur','Intermédiaire','Je voudrais suivre cette formation Parce que je cherchais depuis une telle opportunité pour avoir une nouvelle compétence en développement web et en programmation pour mieux renforcer mes activités .','Mes attentes de cette formation, c\'est d\'être capable de créer et de programmer désormais un site internet.','Dans  3ans je serai capable de créer et de coder un site internet de façon plus professionnelle et dans 5ans  j\'aurais déjà un centre de prestation et de formation .','Le développeur codeur est un expert en création de site internet et en language internet','Internet',NULL,NULL),(171,194,'21d113e1-5cf2-3a2c-b601-ae2b30d77d39','License','2019','ESGT BENIN','Système Informatique et Logiciel','Salarié','Intermédiaire','Ma passion, c\'est la programmation.  Je désire de ce fait suivre cette formation, afin d\'atteindre mes objectifs et ceux des partenaires avec lesquels je suis appelé à travailler.','Les études en informatique dans nos universités au Bénin, ne répondent pas réellement aux réalités du marché du coup, nous nous retrouvons à fouiller partout afin d\'avoir un certain niveau. Je m\'attends à ce que la formation soit véritablement à la hauteur des besoins sur le marché.','Dans 3 ans ou 5 ans, je m\'imagine en tant qu\'un développeur incontournable, très expérimenté et qui n\'aura aucun mal à exprimer mes compétences sur tout projet quelque soit sa complexité','Le métier de développeur codeur, ne se limite pas au code. C\'est egalement la capacité qu\'à le développeur de comprendre les besoins, de mettre en vigueur les différentes fonctionnalités; ce n\'est qu\'après que vient la phase véritable du coding et du test des fonctionnalités. C\'est un domaine très interessant dans lequel il faut avoir certaines capacités comme la tenacité, la témérité, le courage, etc...','Internet',NULL,NULL),(172,195,'b4e8d0b8-faa1-36a1-a797-1923daca51dd','License','2010','Université d\'Abomey calavi','Licence en droit','Sans activité professionnelle','Débutant','Je veux au travers de cette formation m\'insérer dans la vie active car je suis passionnée du digital et su numérique.','Acquérir de nouvelles compétences et approfondir mes connaissances et trouver un travail','Dans 3 ans, 5 ans j\'aurai le bagage nécessaire pour être un très bon développeur codeur ayant évoluer dans son domaine avec des  réalisations palpables.','Un métier passionnant dans lequel on apprend des choses passionnantes.','Internet',NULL,NULL),(173,196,'adfc11a8-d2e9-3ce5-b926-43ba5472011c','Étudiant','2022','Université de Lomé','Génie Logiciel','Salarié','Intermédiaire','Merci pour l\'opportunité... Passionnée du domaine Itech, j\'ai commencé le parcours licence professionnelle en Génie Logiciel au Centre Informatique et de Calcul de l\'université de  Lomé mais j\'ai dû arreté faute de moyens financiers, j\'aimerais donc par cette occasion reprendre et aller à bout de cette formation...','Apprendre beaucoup et surtout à la fin de la formation, maitriser l\'art informatique, être capable de piloter de gros projets informatiques.','Je me vois non seulement avec mon diplôme de fin d\'études mais également avec de grandes d\'aptitudes dans mon domaine, un boulot et une situation financière stable.','Ce métier nécessite assez d\'énergie intellectuelle, de recherches et de travail pratique personnels.','Internet',NULL,NULL),(174,197,'feda2d97-98c2-3852-bf1a-25bea45bc8ec','Étudiant','2022','ABOMEY-CALAVI','SCIENCE DE L\'EDUCATION ET DE LA FORMATION','Étudiant','Débutant','J\'aimerais suivre cette formation principalement pour ma passion pour le numérique et pour espérer avoir une situation professionnelle certaines à la fin de mes études.','J\'aimerais être capable à la fin de cette formation avoir les compétences nécessaires pour accéder à un poste de développeur Full stack.','Exercer dans une grande compagnie en tant que Lead Développeur','Je l\'imagine comme un  métier passionnant me permettant de mettre en avant mon sens de l\'imagination face à une situation ou a une problématique exprimer que je résoudrait en écrivant des sur un ordinateur des codes logiques.','Internet',NULL,NULL),(175,199,'df0be2f1-bee4-337e-ad96-41ebf5c23159','Master','2010','Institut International de Management','Finances Comptabilité Audit','Salarié','Débutant','Parce que suis passionné par l\'informatique. J\'aurais voulu faire mon cursus en ingénierie logicielle. Je suis autodidacte dans ce domaine, j\'ai appris pas mal de choses dans le monde du codage, le langage PHP et JAVA par exemple, création de site web ...\r\nCette démarche pourrait être le moment d\'atteindre un but. Aujourd\'hui pratiquement toute solution passe par internet et les applications mobiles et web.','Être en mesure de développer des applications web et mobile , pouvoir facilement et simplement gérer une base de données , pourquoi pas coder et développer des jeux mobiles aussi !','Réussir cette formation et être autonome,','Ce sont les maîtres du monde, nous sommes à l\'ère du numérique. Ça n\'a rien de facile mais cela peut être très passionnant.','Par un ami',NULL,NULL),(176,200,'636c69a7-638c-3a1b-88d0-5c85cd0bd1a6','Étudiant','2021','Université d\'Abomey calavi','Linguistique communication','Étudiant','Débutant','Pour acquérir de nouvelles connaissances et pour servir à l\'évolution du projet','Une formation efficace qui me permettra de mieux contribuer à l\'évolution','Être une experte en ce domaine','Comme un métier méritant un vrai sacrifice','Par un ami',NULL,NULL),(177,201,'e9c23065-4297-355d-b7a3-6339c9e6819c','License','2021','PARAKOU','Droit public','Sans activité professionnelle','Intermédiaire','J\'ai eu a suivre une formation en développement web et je compte me perfectionner d\'avantage','Avoir les compétences nécessaires pour développer des sites sécurisé et des applications. Et offrir des solutions pour la digitalisation des entreprises','Avoir une autonomie financière. Créer une entreprise qui offre des solutions innovantes pour la digitalisation des entreprises','Un peu complexe','Internet',NULL,NULL),(178,202,'780ae317-4b12-3e12-9020-16b532b732eb','License','2019','ENEAM','Statistique Économique et Sectorielle','Sans activité professionnelle','Intermédiaire','Je voudrais suivre cette formation pour acquérir des compétences en développement web et codage, être performant pour en vivre. Cela me pousserait encore loin avec le domaine des données qui est aujourd\'hui basé sur l\'intelligence artificielle','Je voudrais simplement que la formation soit complète et pratique.','Dans 5 ans, je me vois être un développeur web et codeur très compétent dont les compétences seront activement sollicitées. Je me vois devenir un expert en science des données.','Pour moi, c\'est un métier chercheur de solution et innovateur. Un métier qui simplifie la vie, le temps et automatise beaucoup d\'activités aujourd\'hui. C\'est un métier qui fait exécuter des tâches à l\'ordinateur dans le but de résoudre un problème : créer un site web, créer des applications, développer des logiciels etc.','Internet',NULL,NULL),(179,203,'96adf749-e2d0-3bd3-8a8a-dba098930ccb','Étudiant','2021','UPI ONM','Transport et logistique','Étudiant','Débutant','Je suis passionné du numérique et tout ce qui tourne autour .','Avoir d\'autres expériences utiles','Créer mon premier site web','C\'est lui grâce à qui il nous est plus facile d\'exploiter les outils numériques à travers le développement d\'applications de logiciels et des systèmes d\'exploitation .','Internet',NULL,NULL),(180,204,'d97b2500-bb93-32f3-973a-943cf88ddda6','Étudiant','2021','Université sainte Félicité','Marketing','Sans activité professionnelle','Débutant','Les métiers du digital sont depuis longtemps au cœur du développement de tous les secteurs d’activités.\r\nPour moi, suivre cette formation est une opportunité de concilier l’utile à l’agréable en m’outillant dans un domaine qui me passionne énormément et qui du point de vue social est un réel facilitateur de la vie des populations. Elle favorise la mise en place de plateformes permettant aux personnes d’avoir accès plus facilement à des services de qualité, des informations, des solutions etc tous ceci en gagnant du temps.\r\n\r\nRamenant cela aux réalités de notre pays le Benin, Le programme d’action du gouvernement pour les deux quinquennats et les stratégies de développement nationales, mettent le digital sur un piédestal comme jamais auparavant. En démontre par exemple la digitalisation des services publics. \r\nC’est donc une opportunité pour moi de prendre une part active dans cette nouvelle dynamique de notre ère en me perfectionnant dans le métier du codage.','D’un point de vue académique, j’aimerais :\r\n-	maitriser les techniques essentielles du codage et de la programmation\r\n-	pouvoir être en mesure de créer ou développer des logiciels, des applications, des sites webs et autres sur la base des nouvelles technologies\r\n-	Etre un vrai technicien du digital\r\n\r\nD’un point de vue environnement de formation, j’espère une formation challengeantes qui me fera sortir de ma zone de confort avec énormement de défis pour révéler en moi de nouveaux potentiels.','Dans cinq ans je me vois travailler pour mon propre compte dans une freelance en tant que codeur indépendant.','De ma perception, c’est un métier de spécialiste de la programmation informatique qui écrit du code pour de nombreux types de logiciels. Le code écrit indiquera à l\'ordinateur de se comporter d\'une certaine manière ou d\'exécuter des actions souhaitées. \r\nDe ce fait, nous avons ainsi plusieurs categories de codeurs : le développeur front-end ; le développeur Back-End ; le développeur d\'applications mobiles.','Internet',NULL,NULL),(181,205,'0c85ca56-b968-3770-b505-ac9a72583b98','License','2022','IUT de lokossa','Génie Électrique et Informatique','Étudiant','Intermédiaire','Être payée et travailler dans le digital.','Intervenir en informatique de gestion(programmation industrielle_logistique). Être capable de concevoir et développer des projets d\'application informatique. Expertise en réseau, sécurité et chiffrage. ?','Experte en réseau Informatique et Télécoms.','Un peu stressant mais assez enrichissant, dynamisme. Travail d\'équipe ?','Internet',NULL,NULL),(182,206,'b2c82ec4-4d16-3289-b27c-4df59ee86e96','License','2022','UAC','FLAAC','Sans activité professionnelle','Bilingue','Cette formation est d\'une grande importance et valeur vu que le monde actuel  se montre par la technologie des outils informatiques','Que cette formation me donne une autre vision de voir le monde','Être une professionnelle du développement du web','Un développeur codeur est un métier nécessaire des digitales','Internet',NULL,NULL),(183,208,'60303b62-8811-3b63-827b-1d7a2c411943','License','2018','Les Cours Sonou','Sciences politiques et relations internationales','Salarié','Débutant','Je souhaite suivre cette formation pour surtout acquérir toutes les connaissances nécessaires et indispensables au métier de développeur web','Mes attentes sont les suivantes: pouvoir maîtriser le codage, la programmation ainsi que les fonctionnalités techniques d’un site ou d’une application web','Dans 3 ans ou 5ans je me vois déjà travailler dans une entreprise de la place en tant que développeuse, ou proposer mes services à des entreprises pour maximiser leur rendu, ce qui contribue au développement de la société.','Pour moi le métier de développeur codeur consiste à concevoir la programmation d\'un site internet, d\'un module ou d\'un développement spécifique, corriger des bugs.','Par un ami',NULL,NULL),(184,209,'072ad1c5-de42-3d78-8205-beb2a57070c9','Étudiant','2022','HECM','Entrepreneuriat et Gestion de Projet','Étudiant','Intermédiaire','Je veux suivre cette formation pour pouvoir mieux appréhender certaines notions sur le logiciel pour pouvoir m’appliquer dans ce que je veux faire et de vouloir les appliquées et de pouvoir me rendre utile sur le terrain.','Mes attentes par rapport a cette formation est que je désire ardemment me faire une place dans la société dans laquelle je vais vivre et pouvoir me rendre utile.','Ma projection est que d’ici 3ans que je me fais une place dans le système de développeur-codeur et de me rendre utile à certaines organisations et entreprises pour un développement économique stable et prometteur.','Le métier de développeur codeur de mon imagination est en ce moment un module très  reconnue en France et qui fait l’objet de mise en application dans certaines pays en particulier la France.','Par un ami',NULL,NULL),(185,211,'145c59dd-8ada-3186-b916-31c6fd5ae9b7','License','2014','Abomey-Calavi','Analyse de Projet','Sans activité professionnelle','Débutant','J\'ai du mal à retenir de mémoire les choses. Très tôt j\'ai donc commencé par développer l\'habitude d\'aller toujours au fond des choses. Comprendre le pourquoi afin de me retrouver facilement dans ce qu\'il faut faire. Lorsque j\'ai une tâche à accomplir, je peux établir rapidement des tableaux pour rendre le travail. Un aîné m\'a dit que me lancer dans les métiers du serait une bonne chose.','Je veux pouvoir me rendre utile. J\'aime aller à la quête d\'une solution, la trouver et voir les effets produits. Seulement, je n\'ai pas encore vraiment trouvé de domaine où je peux vraiment m\'épanouir et je me dis selon les conseils de mon aîné, cette formation vraiment m\'aidera à trouver ma place.','Parcourant des villes et villages, aidant grâce aux progrès du numérique des populations avec des solutions toutes simples.','Quelqu\'un avec un ordinateur qui trouve des solutions à divers problèmes mais aussi qui aide beaucoup au développement','Internet',NULL,NULL),(186,212,'5bcb3a76-9547-3166-ab9c-0f00a03d7aba','Étudiant','2022','Esgis','Informatique Réseau et Télécommunications','Étudiant','Intermédiaire','Afin de me faire remarquer dans le monde de l’informatique','Que cette formation m’aide à surpasser mes compétences à devenir l’un des meilleurs développeurs au monde','Chef d’entreprise de l’une des plus grande structure informatique du monde','En général un peu comme Mr Mark','Par un ami',NULL,NULL),(187,213,'d81e05bd-740c-3af7-b94d-e818e7ab059d','License','2020','Institut Universitaire de technologie de l\'université de parakou','Informatique de gestion','Sans activité professionnelle','Débutant','Pour apprendre la pratique et pouvoir exercer dans le domaine','Sortie performante et compétente. Pouvoir être capable d\'apporter un plus value dans les agences ou entreprises','Être une icône dans l\'événementiel et une modèle dans le développement de sites web et E-commerce.','C\'est un métier très passionnant., Un métier qui nécessite du temps et de pratique permanent, une compréhension de logique.','Par un ami',NULL,NULL),(188,214,'68136cd6-aa3c-36f8-a48d-bb89f0adb5f8','Étudiant','2020','Université de Parakou','Droit','Sans activité professionnelle','Intermédiaire','J\'ai toujours voulu faire la programmation informatique. Après le Bac, j\'ai fait le droit et j\'ai vu que je ne m\'y plaisais pas dedans. Donc je suis allé faire une formation en maintenance et réseau informatique en ayant en tête de me faire un peu d\'argent pour pouvoir m\'inscrire en cours du soir dans une université pour faire la programmation, puis j\'ai entendu parler de cette formation et vu que c\'était la meilleure formation que je puisse avoir donc j\'ai voulu postuler.','Qu\'au cours de la formation on puisse avoir des connaissances approfondies en programmation afin qu\'on puisse être capable de mettre en place des programmes web, mobile ou autre programme informatique suivant l\'attente d\'une personne ou notre propre attente.','Dans 3 a 5ans je me vois comme une personne ayant déjà acquis le maximum en programmation informatique dans plusieurs langages, travaillant avec d\'autres personnes sur un grand projet informatique et ayant déjà réalisé d\'autre projet informatique par le passé.','J\'imagine que c\'est un métier qui regroupe plusieurs développeurs, chacun excellent dans son domaine précis, pour qu\'il puisse travailler ensemble afin de résoudre, grâce au traitement automatique de données, certains problèmes ou qu\'ils apportent une meilleure approche à un problème.','Par un ami',NULL,NULL),(189,215,'13bbef36-74db-384b-ae83-4de4f4891102','License','2017','HECM','Génie Électrique et Informatique','Sans activité professionnelle','Intermédiaire','Accroître mes connaissances et mes compétences','Devenir un leader dans le domaine du développeur codeur','Être un développeur d\'applications et de sites Web incontestable dans le domaine','Création des sites Web, contrôle et sécurisation des sites Web. Création d\'applications','Par un ami',NULL,NULL),(190,216,'9077f346-b389-364f-a87f-1edb07886d00','Master','2022','UATM-Gasa formation','Master professionnelle en Banque-finance','Sans activité professionnelle','Intermédiaire','Parce qu\'elle s\'inscrit dans mon projet d\'avenir.','Acquérir les compétences en codage et en gestion cybersecurity; pouvoir mettre en place des interfaces client-serveur dynamiques, fluides et basés sur l\'IA tout en assurant des protocoles élevés de sécurité aux données.\r\nDisposer des connaissances pour apporter ma contribution aux recherches sur les applications de l\'IA et de la cryptographie.','Sur 3 ans, je devrais être capable de développer une application serveur en entier et mettre en place des protocoles de sécurité base de données. Et de même participer aux projets du groupe.\r\nPlus loin, dans 5 ans, je me vois lancer un logiciel qui aura pour fonction principale de permettre une intégration simple dans le processus métier de tout type d\'entreprise et de permettre aux populations d\'accéder à tout type de prestation, en clair porter un coup de pousse à la digitalisation des entreprises surtout sur le territoire béninois.','C\'est un métier indispensable à la vie de toute entreprise de nos jours et dans le futur. Le développeur/codeur est toujours en pleine réflexion pour parfaire ses scripts, il est très créatif, et souvent se retrouve seul pour mieux travailler. Pour cela, il a besoin d\'un cadre de travail calme. Il est dynamique et très actif et aime travailler en équipe surtout quand l\'ambiance est conviviale et non stressante.','Internet',NULL,NULL),(191,217,'09480a1e-8b19-3dcf-85f8-102f4782f143','Master','2022','Université de Parakou','Master Droit pénal et science criminelle','Sans activité professionnelle','Débutant','Plusieurs raisons me poussent à suivre cette formation.\r\n\r\nLa première est relative à ma passion pour le digital, la fascination que j\'ai pour les nouveaux métiers qu\'offre le numérique.\r\n\r\nDepuis que j\'ai découvert le digital et les opportunités quel regorge, Je me suis toute suite attaché. Cela s\'est fait en 2020 où je venais de créer une page Facebook pour parler de ce que j\'apprenais au cours de mes études de droit. Quelques temps après, j\'y ai pris goût puis j\'ai approndi mes connaissances en communication digitale. Depuis, je m\'en suis pas lassé.\r\n\r\nLa seconde, c\'est par rapport à mon ambition, mes projets professionnels et personnels.\r\n\r\nLa troisième concerne ma récente découverte. Après, m\'avoir mis au community management et avoir travailler sur quelques projets, j\'ai finalement compris qu\'il me fallait beaucoup plus. J\'avais beaucoup plus de facilité à bricoler, qu\'à réfléchir sur une stratégie de communication ou encore une stratégie de contenu. Je pouvais passer des heures à réaliser une affiche, à m\'amuser à créer un site avec WordPress ou botamp qu\'à créer des contenus pour les réseaux sociaux.\r\n\r\nCette formation sera donc pour moi l\'occasion de me découvrir davantage et d\'organiser ma reconversion vers ce métier qui me passionne tant.','- Apprendre un métier, une compétence pour la vie, à coder.\r\n- Apprendre de manière ludique.\r\n- Développer mes compétences interpersonnelles et intra personnelles.\r\n- Des formateurs professionnels, sociables, aimables, compréhensifs et pédagogiques.\r\n- Un accès à des ressources pour faciliter notre apprentissage.\r\n- Un accompagnement individuel et sur mesure pour chaque apprenant.\r\n- Une rigueur de la part des formateurs à l\'égard des étudiants.','En tant que développeur codeur évoluant dans une entreprise ou dans une agence, je me vois entrain de travailler sur des projets challengeants les uns après les autres, entrain de résoudre des dysfonctionnements liées à des sites web, des applications, logiciels, etc ... En bref, évoluer dans un environnement qui m\'épanouie et m\'aide à atteindre et réaliser mes objectifs de vie. Aussi, grâce au code j\'aimerais pouvoir apporter des solutions à des problèmes auxquelles sont confrontés ma communauté, mon entourage chaque fois que l\'occasion se présente.\r\n\r\nDans 5 ans, être un développeur full stack, sinon un juriste développeur évoluant dans une legaltech et proposant des solutions numériques pour aider les cabinets d\'avocats et de comptable à amorcer leurs transformations digital.','Pour moi, un développeur codeur, est une personne qui crée des solutions numériques pour résoudre un ou des problèmes précis au sein d\'une agence, entreprises, Stuart Up, etc ...\r\n\r\nC\'est un métier hyper exigeant qui demande beaucoup de sérieux de concentration. Au delà de la profession, il faut réellement avoir de la passion pour le codage afin d\'évoluer et de réussir dans ce domaine.','Internet',NULL,NULL),(192,218,'83fd60cc-0e34-3cc7-9017-6d87bdb20367','License','2020','UUC (UCAO) Université Catholique de L’Afrique de L Ouest','Sciences Économiques et de Gestion','Entrepreneur','Débutant','Pour d\'acquérir des compétences nouvelles le monde du travail évolue et moi je veux faire partie de ce nouveau monde.','Obtenir un contrat de travail.','Mon plan est de me perfectionner davantage, d’être un leader dans chacun domaines  d’activité que je choisirais pour m’apporter un revenu passif ou actif.','Pour moi C’est quelqu’un qui crée des applications, des logiciels à partie d’une programmation.','Internet',NULL,NULL),(193,220,'7f1ee707-b12b-3529-99a6-ffc03065a34a','Étudiant','2022','ABOMEY-CALAVI','Sociologie','Étudiant','Débutant','Parceque j\'aime le domaine du digital et j\'aimerais booster dans ce domaine','C\'est d\'être un expert dans le domaine','Je me vois en tant que lerder dans le domaine','C\'est un métier qui demande la maîtrise de l\'outil informatique.','Internet',NULL,NULL),(194,221,'9cfd5c3c-9dfa-389f-91dc-3d92e2e36200','License','2019','Abomey-Calavi','Faculté des sciences agronomiques','Entrepreneur','Débutant','L\'apprentissage des langages de programmation et de développement permet aujourd\'hui d\'ouvrir de nombreuses portes à l\'instar de l\'apprentissage d\'une langue vivante. Comprendre le monde de demain et être capable de créer et d\'innover','A la fin de cette formation je dois être capable de faire des programmations, créér des logiciels et applications pouvant être utile dans la vie active.','Je me vois être détenteur de deux applications  pouvant servir dans le domaine agronomique','C\'est un métier d\'avenir ..','Par un ami',NULL,NULL),(195,222,'6a51b4ba-e26a-3fa8-b55e-a84e4c04e9c1','License','2016','GASA FORMATION','Biotechnologie','Salarié','Débutant','Passionné par la réalisation et le développement de projets web, je souhaite mettre au grand jour cette passion me hante.','Mes attentes est de devenir un meilleur développeur','Très performant en développement.. Avec une grosse expérience à la clé qui me permettront de travailler sur de grands projets à la longue','Le métier de développeur est déjà un domaine très dynamique qui te pousse chaque fois à aller chercher des informations pour être à jour','Par un ami',NULL,NULL),(196,223,'3f58ecda-3755-31ea-a40d-6c1d67f225ea','License','2017','ESTBR Abomey','Technicien supérieur en génie civil option bâtiment et travaux publics','Salarié','Intermédiaire','C\'est toujours bien d\'avoir plusieurs cordes à son arc. En plus je suis curieux de découvrir cette nouvelle discipline qu\'est le codage. Ça ne cours pas les rues à Cotonou et je veux être aussi parmi les pionniers.','Je veux être un expert en codage. Je le veux pour mon propre bien et pour mon pays le Bénin.','Être dans mon propre cabinet. Avoir mis sur pied plusieurs innovations dans ce nouveau domaine.','Je l\'imagine étant encore inexploré et donc pas saturé. Je l\'imagine très épanouissant et ludique.','Internet',NULL,NULL),(197,224,'1630a669-ad11-3752-a867-710bd8d7907f','Étudiant','2021','ENSBBA','Génétique et Biotechnologies Appliquées','Étudiant','Débutant','Je veux suivre cette formation pour maîtriser le codage afin de l\'associer à la génération dans le but de devenir bio informaticien','Je m\'attend à maîtriser le codage à un niveau assez élevé pour pouvoir répondre efficacement aux problématiques liées au domaine.','Dans 3ans je m\'imagine comme étant un homme qui ne cesse d\'apprendre et de se perfectionner et dans 5ans je m\'imagine comme étant une référence ;peu importe le domaine.','J\'imagine que c\'est un métier qui demande beaucoup de sérieux et pour lequel il faut être à l\'affût pour ne pas se faire distancer ou pour rester dans l\'élite.','Par un ami',NULL,NULL),(198,225,'8c02322f-ed21-374f-941b-7cca1ac9811e','Étudiant','2018','École Supérieure de Gestion et de Technologie','Brevet de Technicien Supérieur en Management des Ressources Humaines','Sans activité professionnelle','Débutant','Je suis Angelo MONVO, j\'ai 28 ans. Diplômé d\'un BTS en Management des Ressources Humaines depuis 2018, j\'ai du mal à trouver un emploi stable. Pour cela le besoin de faire une reconversion s\'impose. Alors j\'ai choisi le numérique parce que à travers l\'expérience de COVID-19 que le monde a connu, c\'est devenu claire au yeux de tous que l\'avenir du monde demain c\'est le numérique. Et tous les pays sont entrain de vivre cette révolution numérique actuellement. Je ne voulais pas rester en marge de cette révolution. C\'est pourquoi je tiens vivement à bénéficié de cette formation pour orienter au mieux ma profession afin de quitter le chômage.','Devenir un développeur confirmer de haut niveau avec une compétences inégalable.','Je me voir d\'ici 3 ans un développeur dont le nom et les réalisations feront parler de lui hors des frontières.','Un métier très délicat qui demande beaucoup de concentration. C\'est un métier qui exige d\'avoir un niveau pointure en logique.','Par un ami',NULL,NULL),(199,226,'26bca903-1c69-3d89-97c6-061f085a05ff','Étudiant','2022','LCS (Les Cours Sonou)','SIL (Systeme Informatique et Logicielle)','Étudiant','Bilingue','Pour augmenter mes notions préexistantes et avoir plus d’opportunités d\'employabilité.','Me permettre d\'avoir un emploi et de m\'aider dans la poursuite de ma carrière dans la cybersécurité.','Technicien d\'un Network ou d\'un Système SCADA.','C\'est un metier fascinant, très utile et demande de nos jours mais qui nécessite de la patience, de la perseverance et un investissement de temps important.','Par un ami',NULL,NULL),(200,227,'014cbd1a-81e9-3794-b36d-ed5950694519','Étudiant','2019','Université des Sciences et Technologies du Bénin','Diplôme Universitaire de Technologie','Salarié','Débutant','Mon objectif est de pouvoir intégrer les services de télécommunications et réseaux informatiques d’une entreprise.Participer au développement d’une entreprise en lui apportant mon savoir-faire dans les domaines des télécommunications et réseaux informatiques.Mettre au service d’une entreprise m’offrant de réelles possibilités d’évoluer dans ma carrière, mon dynamisme et les compétences que j\'aurai en matière de développeur, codeur','Que cette formation m\'amène à être un As du codage,ce qui me permettra de disposer de réelles compétences pouvant être toute entreprise ayant besoin d\'un développeur codeur','J\'espère être l\'un des meilleurs développeur codeur capable de répondre à tous besoin dans ce domaine d\'une entreprise quelconque et m\'offrant de réelles possibilité d\'avenir','Un développeur codeur est d\'abord un informaticien mais sa particularité est qu\'il peut écrire des codes(programme informatique) pouvant servir à des tâches bien précises pour une entreprise donné\r\nIl peut également concevoir des sites internet','Internet',NULL,NULL),(201,228,'00904fe4-df2a-3a3d-be0c-b25cf9ca6371','License','2012','Université d\'Abomey-Calavi','Didactique des langues','Salarié','Débutant','Coder est une ambition que je nourris beaucoup. Je suis journaliste en ligne et je souhaiterais coder et développer mon site web et mettre mon expertise au profit des autres.','Savoir coder, créer des sites web et des applications, développer des aptitudes dans les métiers du numérique et pouvoir initier des gens au coding','Je suis un as du coding','C\'est un métier d\'avenir. Le numérique transforme la vie','Par un ami',NULL,NULL),(202,229,'da6678cd-fcb2-3fba-a73b-a66f2e6566e7','Étudiant','2020','UAC','BAC','Entrepreneur','Débutant','Acquérir des compétences','Mes attentes est qu\'il faut allé au delà du métier de développeur','Être un bon développeur professionnel','Un métier d\'avenir','Internet',NULL,NULL),(203,230,'2787868f-9f32-31a2-927f-c93d104b986e','License','2020','Université d’Abomey-Calavi','Diplomatie et Relations internationales','Sans activité professionnelle','Courant','J’essaierai d’être très concis, j’ai décidé de postuler pour cette formation tout simplement parce que je suis à un tournant de ma vie où je sais qu’il me faut bouger, quitter ma zone de confort et m’accomplir. Et j’ai vu cette opportunité alors la suite l’avenir nous le dira.','Tout simplement de la pratique, il faut vraiment que ce soit plus pratique que théorique, et surtout assimilable pour nous qui n’avions pas fait des filières scientifiques. Sans me vanter même si je n’ai pas fait de filière scientifique côté informatique ou ordinateur j’apprends très vite.','Être un master en programmation, dans 3 à 5 ans si je me donne vraiment les moyens et me focus sur le métier il n’y a aucun doute je dois être exceptionnellement bon et avoir créé une agence de développeur codeur et couvrir les services de programmation, de résolutions des problèmes informatiques des entreprises.','Avec ma petite connaissance sur les métiers d’internet, le développeur codeur est un écrivain de code informatique, il gère la création des sites internet, et à une maîtrise exceptionnelle des languages de programmation','Par un ami',NULL,NULL),(204,231,'60a36063-a681-3423-87fa-f1bb8edee01f','License','2017','UAC (Université d\'Abomey_Calavi)','Sciences de la Vie et de la Terre','Salarié','Intermédiaire','Pour avoir des connaissances dans le domaine du numérique','Avoir le maximum de connaissance afin de trouver un bon emploi ou d\'entreprendre dans le domaine du numérique.','Dans 3, 5ans j\'aurais déjà la capacité d\'un développeur et codeur de standing international','Ça me fascine. C\'est un domaine que je ne maîtrise pas encore mais que je voudrais intégrer et faire partir des meilleurs','Par un ami',NULL,NULL),(205,232,'3777418a-9cb6-30e2-80d2-be1916893e34','Étudiant','2021','Institut National de l\'Eau','Hydraulique et Assainissement','Étudiant','Débutant','Je veux suivre cette formation afin de m\'actualiser dans la vie réelle et avoir des aptitudes requises en informatique.','Acquérir des compétences professionnelles en informatique principalement en codage, création de site web et en programmation.','Être autonome, boosté mes capacités en informatique et capable de satisfaire les besoins suggéré par la société dans laquelle je travaillerai','En tant que métier professionnel, il s\'exécute en mettant en place un projet d\'application informatique de la phase d\'étude à son intégration pour un client ou une entreprise selon les besoins fonctionnels. Il peut être amené à coordonner une équipe.','Par un ami',NULL,NULL),(206,233,'94559faf-a9f0-3aeb-b30f-a00a0e5e271c','Master','2022','École Nationale d\'Économie Appliquée et de Management(ENEAM)','Diplôme d\'Ingénieur Statisticien Économiste','Sans activité professionnelle','Débutant','Pour acquérir plus de connaissance, d\'expérience afin d\'être compétitive sur le marché de l\'emploi.','Avoir de nouvelle connaissance\r\nFaire plus de pratique','Être propriétaire d\'entreprise','Pas trop d\'information sur le métier','Par un ami',NULL,NULL),(207,234,'2a0216ef-e2d1-30d8-8441-bc09d88d8975','Master','2016','Université d\'Abomey-Calavi','Sociologie','Entrepreneur','Intermédiaire','Parce que je voudrais approfondir mes connaissances dans le développement web.','Je voudrais maîtriser le développement front-end et évoluer vers le développement back-end de manière très approfondi. Je voudrais maîtriser des subtilités et prendre le temps de renforcer ma base en développement.','Un développeur full-stack accomplie.','D\'abord, c\'est un métier passionnant où tu es tout le temps en réflexion pour la conception de solution permettant de résoudre des problèmes bien précis. C\'est travailler pendant 10h de temps non-stop sans voir le temps passer. C\'est exploser de joie quand ton code a enfin fonctionné.','Par un ami',NULL,NULL),(208,235,'34868a43-524a-3918-aca6-1dab3fd60a4b','Étudiant','2022','Institut Universitaire de Technologie (IUT) de Parakou','Informatique de Gestion','Étudiant','Intermédiaire','J\'ai fais le choix de cette formation parce que je suis un passionné des nouvelles technologies et elle cadre avec mon projet professionnel, celui de développeur web et cela va aussi dans le même sens que mon projet d\'étude actuel.','- Maitriser au mieux l\'outil informatique\r\n- Approfondir mes connaissances dans les métiers de digital\r\n- Développer des compétences techniques relatives au métier du digital et le sens relationnel','Mon ambition professionnel dans 3 ou 5 ans est de détenir les qualités requises pour exercer le métier d\'un développeur web. Ce qui me permettra de pouvoir évoluer techniquement et ou d\'un  point de vue managérial.  En ce sens je peux développer mon expertise et prendre des responsabilités techniques et donc celui de développeur web Senior','Le développeur décodeur intervient dans la phase de conception, participe à l\'élaboration d\'algorithme et conduire des tests. Son rôle peut être aussi de traduire les spécifications fonctionnelles en spécifications technique, en code. \r\nIl peut être spécialisé dans un domaine et être plus ou moins polyvalent.','Par un ami',NULL,NULL),(209,236,'1fbb8ded-ac70-3ecd-aa82-3b23ecf528da','License','2017','UAC - Abomey calavi','Journalisme','Sans activité professionnelle','Débutant','Je ne parlerai pas seulement de passion comme tout le monde mais de vie de carrière avec ce domaine du développement web. C\'est d\'ailleurs la raison pour laquelle je m\'inscris malgré la date qui vient de passer.','Une bonne pédagogie surtout car il y a plein de formations en ligne mal faites et qui n\'apporte reellement pas une plus value.\r\n\r\nJ\'espère aussi trouver un emploi après la formation.','Je m\'imagine dans une start-up ou entreprise entrain de développer des solutions innovantes.','Un métier de vie. L\'on se rend compte qu\'aujoudhui ce métier est nécessaire dans tous les domaines d\'activités.','Par un ami',NULL,NULL),(210,237,'910b9674-37fb-3ce3-ae86-3c503fdcfd2c','Étudiant','2022','Université de parakou','Sociologie anthropologie','Étudiant','Débutant','J\'aimerais suivre cette formation pour augmenter mes savoir sur le marketing numérique car j\'aime beaucoup l\'électronique','Que je devienne un expert en digital marketing et être un développeur','Dans 5ans , créé un algorithme, capable de faire des robots pour satisfaire le besoin humain en son temps','Développeur étant une Personne chargée des développements, de la programmation, dans un projet informatique alors je trouve un métier d\'avenir et d\'actualité vue l\'évolution de la technologie','Par un ami',NULL,NULL),(211,238,'c2ebd927-4401-3091-8e97-f9ed8e76d07a','Étudiant','2014','ENEAM (École Nationale d’Economie Appliquée et de Management)','Comptabilité et Gestion','Salarié','Débutant','Je voudrais suivre cette formation car l’informatique a toujours été une passion pour depuis tout petit. J’étais en quelque sorte \"le petit informaticien du quartier\" que tout le monde appelle quand ils ont soucis électronique ou informatique et j’arrive à régler le problème même si au départ c’est la première fois que je le rencontre. Je n’ai pas pu étudier dans ce domaine (université) à cause de la non disponibilité des moyens financiers des parents. Aujourd’hui j’ai une chance de me rattraper et vivre pleinement de ma passion (le coding, le développement…), et je ne la laisserai pas passer. Merci','Par rapport à cette formation, mes attentes sont tout simplement un apprentissage assez poussé et rigoureux qui met à notre disposition toutes les armes pour devenir un bon développeur et codeur, ce dont je ne doute absolument pas.','D’ici 3 ou 5 ans, je me vois très bon développeur codeur, participant à de projets passionnant, en mettant en œuvre mes compétences que j’acquéririrai durant cette formation, de découvrir tout à long de ma carrière de développeur codeur de nouvelles compétences dans ce grand monde qui est l’informatique. Et enfin, de vivre pleinement de ma passion. Merci','Le métier de développeur codeur est un métier d’organisation et de rigueur, du dépassement de soi afin d’atteindre les objectifs fixés par rapport à un projet. Ce métier permet un épanouissement total pour celui qui est vraiment passionné. Enfin c’est métier qui permet d’apprendre tous les jours de nouvelles choses au cours de carrière.','Internet',NULL,NULL),(212,239,'64cdee8c-1870-3b46-9df9-854ddd59f5d7','Étudiant','2014','ENEAM','BTS. Comptabilité et gestion','Salarié','Débutant','Je suis amoureux de l\'informatique et depuis un fort moment mon rêve est d\'être un developpeur.','D\'être en mésure de programmer des logiciels ou applications.','Devenir un développeur professionnel.','Developper des logiciel.','Internet',NULL,NULL),(213,241,'05451d28-ddab-38ad-b017-2d76fc5d63e6','License','2017','Parakou','Analyse et Politique Économique','Entrepreneur','Courant','Pour atteindre mes objectifs en matière de planification et analyse des données statistiques dans les entreprises tant publique et privée.','Apprendre beaucoup de nouveauté par rapport au nouvelles technologies à l\'ère de la modélisation.','Être un consultant dans les banques et aux institutions à caractère financière','Intéressant, car le développeur codeur est la lumière d\'une entreprises','Par un ami',NULL,NULL),(214,243,'55264039-2402-38dc-98a9-827bba4c24c7','Étudiant','2021','INSTITUT NATIONAL DE L’EAU','HYDRAULIQUE ET ASSAINISSEMENT','Étudiant','Débutant','Le codage et la programmation ont toujours été ma passion. À l’université, nous avions eu à faire des cours allant dans ce domaine mais vu le manque d’équipement nous n’avions pas pu aller au bout. Je veux bien apprendre cela.','Maîtriser le codage et la programmation \r\nÊtre un meilleur  développeur web','Satisfaire les besoins du client ou de l’entreprise en ce qui concerne le développeur web','Passionnant et actif','Par un ami',NULL,NULL),(215,244,'b93f07b3-f9ee-3498-8b3d-f7f39b19dda3','Étudiant','2020','prestige','plomberie','Sans activité professionnelle','Débutant','métier de développeur codeur','métier de développeur codeur','métier de développeur codeur','métier de développeur codeur','Par un ami',NULL,NULL),(216,245,'386107dd-7eab-3fd3-a0e6-adda6703094d','Étudiant','2022','HECM Bohicon','Informatique industrielle et Maintenance','Étudiant','Débutant','Étudiant de formation en informatique, je suis passionné par ce qui concerne  les logiciels , les codes , les applications en gros par tous ce qui est développement web. J\'aime le football et quand je m\'engage je suis déterminé à atteindre mes objectifs .','Devenir le meilleur développement codeur.','Fait de nouveau apport  dans le domaine informatique dans mon pays et au niveau international','Passionnant et plein de défi .','Par un ami',NULL,NULL),(649,247,'83bcdd78-fd97-3d21-88dc-9b45478044cc','Étudiant','2018','IUEP','DUT/MA','Entrepreneur','Débutant','Pour élargir mes opportunités.','Avoir un maximum en informatique','Devenir meilleur et avoir mon propre entreprise','C\'est un métier de créativité.','Internet',NULL,NULL),(650,249,'3d5b5d12-6eca-3142-8dde-76b54faab4ff','License','2018','UAC','Espagnol','Entrepreneur','Débutant','Élargir mes connaissances et compétences','Avoir une formation théorique mais plus pratique avec le nécessaire pour faciliter l’apprentissage . Je souhaite avoir des formateurs avec du leadership.','Une grande codeuse et développeuse web dont le nom serait connu en Afrique et à l’international.','C’est pour les intellectuels les personnes réfléchis et c’est un métier de l’avenir et très intéressant','Internet',NULL,NULL),(651,250,'d111cee1-b66e-32ac-b8b7-d5300c07e499','License','2020','Université d\'Abomey Calavi','Licence en Mathématiques fondamentales ( Filière : Mathématiques Informatique et Applications)','Sans activité professionnelle','Courant','Je suis un admirateur de la programmation. Quand j\'étais étudiant en Mathématiques Informatique et Applications à l\'Uac, j\'avais toujours eu de très bonnes notes dans les matières de programmation que nous faisions. Tout cela m\'encourage à continuer mes études en informatique. Donc, je suis attentif aux offres de formations en informatique et je prie toujours pour qu\'un jour, mon rêve d\'être un programmeur ( développeur) se réalise. Je souhaite vivement être retenu pour votre formation.','J\'attends de cette formation, qu\'elle m\'aide à réaliser mon rêve. J\'attends qu\'elle me donne tout ce qu\'il faut pour être un excellent développeur.','Dans 3 ans ou 5 ans, après cette formation, je me vois expert en programmation, rempli d\'expérience dans le domaine, voire chef d\'une entreprise de développement informatique.','Pour moi, le métier de développeur est passionnant. Quand je m\'imagine en tant qu\'un développeur, je me vois à l\'aise devant un ordinateur entrain de mettre en langage informatique toute une idée pour la réalisation d\'un projet, la création d\'un objet informatique ( logiciel, application ou autres). J\'imagine aussi, ce qui est d\'ailleurs vrai, que c\'est un métier d\'avenir, car le monde est en pleine digitalisation.','Internet',NULL,NULL),(652,251,'ed58a10c-2353-3596-bbb2-d8df3ca4578d','Étudiant','2021','UAC','Mathématiques informatiques application','Étudiant','Intermédiaire','Pour pouvoir concevoir des programmes informatiques','Un formation de qualité','Devenir un entrepreneur agroalimentaire','Un métier permettant de sépanouir','Par un ami',NULL,NULL),(653,253,'2628c2b4-e5a5-3011-adc5-92fdd2ac8e0c','License','2019','FAST-Nati','PHYSIQUE','Salarié','Courant','Très passionné par le monde numérique \r\nActuellement','Développer mes sofs skille','Ingénieur en génie logiciel','Métier d\'avenir','Internet',NULL,NULL),(654,254,'1f131a2f-434b-322c-aabd-1784a645c6b8','License','2018','UAC','Économie et gestion des exploitation agricole','Sans activité professionnelle','Intermédiaire','Cette formation me permettra de devenir un développeur et un créateur des sites et logiciels','Mes attentes pour cette formation est Cette formation de devenir un développeur et un créateur des sites et logiciels','Être un bon créateur des logiciels','Un métier d\'avenir','Par un ami',NULL,NULL),(655,255,'a6d44d9a-bad6-301a-97f1-dc45c563d0e8','Étudiant','2021','Ucao','Droit','Étudiant','Intermédiaire','J\'aimerais suivre cette formation dans le but d\'acquérir des compétences dans le milieu de la programmation web, car vu l\'évolution de la technologie ce domaine est indispensable et offre beaucoup d\'opportunités.','-Être un développeur full stack qui  connaît les principaux langages de programmation me  permettant de travailler tout à la fois sur le back end, le front end, aussi bien de sites Web que d\'applications\r\n\r\n-Être capable de diriger un projet web\r\n\r\n-Être concurrentiel sur le marché','Dans 3 ans je me vois finir ma formation et être entrain de faire mes preuves, en donnant mon savoir faire tout en me perfectionnant. Et dans 5ans je me vois créer ma propre boite dans le but d\'apporter des solutions à des personnes et entreprises nationales comme internationales.','Le métier de développeur codeur est métier pas facile car il nécessite beaucoup de concentration et avoir un esprit de créativité. Et pour y réussir il faut avoir de passion dans ce qu\'on fait.','Internet',NULL,NULL),(656,256,'3dc1f9bf-4926-3b7a-91cc-dbbcf9effca8','Étudiant','2021','Ucao','Droit','Sans activité professionnelle','Débutant','J’aimerais suivre cette formation pour en apprendre plus sur le métier de développeur web car j’ai toujours été passionné par l’informatique et tout ce qu’il y’a autour','J’aimerais pourvoir apprendre,connaître les bases de la création d’un site web pouvoir maîtriser le codage et tout les contours du développeur web','Dans 5ans je me vois être un grands hommes, un grands développeur web au services de plusieurs entreprises car l’une des tâches du web developer c’est d’être polivalent de pouvoir gérer plusieurs tâche à la fois.','C’est un métier passionnant qui implique de la curiosité de l’engagement, je trouve que c’est un métier où on es toujours entrain d’apprendre il pousse à être autodidacte','Par un ami',NULL,NULL),(657,260,'2184706a-ec51-3cfb-bb14-d5e6ddb7f53f','Étudiant','2019','Fast-nati','Mathématiques-informatique','Entrepreneur','Courant','Je suis motivé par le libre entreprenariat','Pour appuyer mon entreprenariat','3ans au minimum','Une bonne chose','Par un ami',NULL,NULL),(658,261,'1c51d8b3-208b-3ab9-892b-0c0833b79eaf','License','2021','Faculté des lettres langues arts et communication','Linguistique anglaise','Sans activité professionnelle','Courant','Je veux suivre cette formation car j\'aimerais approfondir mes connaissances en programmation/codage et avoir une certification reconnu. \r\nAu delà de cela, j\'ai toujours voulu aller en informatique pour apprendre le la programmation et c\'est ce qui m\'a poussé à obtenir un bac C mais faute de moyen financier j\'ai pas pu le faire. Actuellement c\'est une opportunité en or qui s\'offre à moi et je me dois de la saisir.','A la fin de cette formation, j\'aimerais être capable de coder des programmes dans différentes langages en particulier les plus utilisés. D\'autre part être un bon développeur qui aura de l\'aisance à évoluer et s\'adapter avec le temps. Enfin être en mesure de faire valoir mes compétences à des fins utiles.','Dans 3 ans je me vois entrain de faire un stage d\'approfondissement des connaissances que j\'ai reçu lors de la formation. \r\nEt dans 5 ans je me vois entrain de mettre en application, les compétences acquises lors de la formation pour la croissance d\'une entreprise ou sur un projet personnel.','Je perçois le métier de développeur codeur comme un métier de super héro. Avec des lignes de code on crée des programmes qui résout des problèmes et facilitent le quotidien de milliers de personnes.','Internet',NULL,NULL),(659,262,'15df4c18-056f-36ad-9d52-d9ba242fb4db','License','2012','Université de Parakou','Licence en Droit des Affaires et Carrières Judiciaires','Salarié','Intermédiaire','Pour une meilleure expérience professionnelle.','Découvrir et maîtriser les outils digitaux succeptibles à la gestion de la relation client.','Consultant en marketing digital.','Le métier de développeur codeur doit être un métier essentiellement technologique et très passionnant.','Internet',NULL,NULL),(660,263,'e54e6283-ebeb-3252-9842-e4bc713ddf5d','Étudiant','2022','Ecole Supérieure  de Gestion d\'Informatique et des Sciences (Esgis -Bénin)','Informatique Réseaux et Télécommunications spécialité Architecture de Logiciel','Étudiant','Intermédiaire','Pour avoir un niveau plus performant dans le domaine de l\'informatique','Pouvoir atteindre mon objectif et être meilleur dans mon domaine','Être autonome et pouvoir déjà gagner ma vie','Créer des choses vraiment étonnantes. \r\nPourvoir maîtrisé la conception des logiciels, des sites web et des applications','Par un ami',NULL,NULL),(661,264,'a7cfef28-f534-3cb7-ad14-540e5b55eb86','Étudiant','2022','ESGIS-Benin','Architecture logiciel','Étudiant','Intermédiaire','Dans un premier temps la bourse d’étude que vous octroyer aux étudiants m’a beaucoup intéressé puisque c’est très rare de trouver maintenant des structures pour parrainer les études universitaires \r\n\r\nDans un second temps le fait  qu’il ya une garantie d’emploi pour l’étudiant qui termine son cursus m’a également attiré....on ne trouve pas ça partout \r\n\r\nEt le plus important pour finir c’est que non seulement vos formations sont pratiques mais aussi vous permettez des travaux de groupe cela permet à l’étudiant lambdas de vite acquérir des connaissances et de s’habituer a l’esprit en équipe','Acquérir assez de connaissance sur le digitale','Dans 5ans j’aurai déjà un boulot stable qui va me permettre de répondre aux besoins de la famille et de là profiter pour créer ma propre boîte afin de ne plus dépendre d’une entité.','Je vois ça comme un métier où on est souvent devant son ordinateur par pour se distraire mais pour écrire des milliers de lignes de codes afin de rendre exécutable un  programme (logiciel)ou de concevoir  un site web pour rendre des services particulier.','Par un ami',NULL,NULL),(662,265,'4b881fe5-3cec-313b-bf77-8556caf840db','License','2021','École Supérieure de Management (ESM)','SIL(Système Informatique et Logiciel)','Étudiant','Débutant','Raison d’approfondir mes connaissances et de développer plus mes compétences de développeur  et investir ces acquis pour le besoin de la communauté et enfin innover .','Maîtrise des langages de programmation et framework.\r\nSortir plus meilleur qu’avant.\r\nTrouver des opportunités de travail','Je me vois en tant qu’un développeur certifié de niveau capable avec mes capacités de vivre pleinement ma vie et de subvenir à mes propres besoin aidant la nouvelle génération à révéler le niveau. Grâce à mes innovation je pense conquérir le monde à être meilleur .','C’est un métier de passion insaisissable dans tous les domaines ou disciplines de la vie puisque tous est informatisé à notre ère.','Par un ami',NULL,NULL),(663,267,'8f73ae39-77c6-3d19-ad42-2f249e8d59f6','Étudiant','2022','Université dAbomey Calavi','Baccalauréat','Sans activité professionnelle','Débutant','Je veux suivre cette formation pour être un développeur et contribuer à l\'émergence du Bénin le secteur numérique','Devenir un excellent développeur et apporter ma pierre à l\'édifice','Beaucoup de jeunes candidats ont l’esprit d’entreprendre, et j’en fait partie. Rejoindre votre école de codage serait pour moi l’opportunité de développer des projets et de réaliser mon rêve de développeur  en m’appuyant sur les compétences que votre école veut nous inculquer. Mon ambition à 5 ans serait de développer un projet qui puisse créer de nouvelles opportunités dans votre entreprise. Ce serait une réelle source de satisfaction et d’épanouissement professionnel pour moi. »','Le métier de développeur me paraît comme un métier qui demande beaucoup de curiosité, d\'ampathie, d\'autonomie, d\'un esprit d\'analyse et de logique ainsi qu\'un esprit d\'equipe !  Un métier qui s\'inscrit  sur le long terme dans le futur numérique du monde','Par un ami',NULL,NULL),(664,266,'deb84e48-16ee-3f36-9243-4da5a88a86f4','License','2021','École Supérieure de Technologie et de Gestion','Système Informatique et Logiciel','Sans activité professionnelle','Intermédiaire','Je souhaiterais suivre cette formation afin d\'améliorer mes compétences dans le domaine Informatique et progresser dans ce secteur dans le but de s\'ouvrir à de nouvelles perspectives d\'évolution professionnelle.','Mes attentes par rapport à cette formation c\'est de pouvoir acquérir des outils, de meilleures compétences et connaissances pour évoluer au sein d\'entreprise.','Mon objectif actuel est de trouver un poste dans une entreprise où je peux évoluer et relever de nouveaux défis au fil du temps. \r\nEnfin de compte, je voudrais assurer davantage de responsabilité et participer à la stratégie globale d\'une entreprise. Mais le  plus important est que je souhaite travailler pour une organisation dans laquelle je peux bâtir une carrière.','Le métier de développeur codeur est une profession qui demande d\'être curieux, autodidacte, autonome, sociable et créatif.\r\nUn développeur codeur est un spécialiste des langages informatiques. Responsable de la programmation, il rédige et suit un cahier des charges précisant les spécificités techniques à suivre pour créer le programme.','Internet',NULL,NULL),(665,268,'2df29440-c8c8-3f4d-bc2a-956173b3d9ba','Étudiant','2020','HECM','Informatique industrielle et maintenance','Étudiant','Débutant','Je voudrais suivre cette formation parce que je suis passionné de l\'informatique  et des lignes de codes en particulier. ET ce genre de compétences sont extrêmement recherchées par les entreprises et c’est également un des métiers les plus valorisés au monde.','je veux pouvoir acquérir de meilleures connaissances afin de réaliser mon rêve de grand programmeurs codeur et être un atout majeur au seins de grandes entreprises.','Être le plus grand programmeur de ma promotion, être un atout majeur pour l\'entreprise, et pouvoir apporter des solutions informatiques aux problèmes quotidiens.','Le métier de développeur codeur consiste en la création des applications qui doivent répondre à certains besoins. Elle a pour but de trouver différentes solutions  informatiques en partant d\'un problème théorique de la société qui sera digitalisé et facilite le quotidien.','Par un ami',NULL,NULL),(666,270,'4c0cda4d-36da-3917-804c-9a705e1ecf53','Étudiant','2021','Abomey calavi','Bac+2en lettre moderne','Salarié','Débutant','Je souhaite suivre cette formation car elle offre un des débouchés sur le monde du travail.\r\nDe plus je constate qu\'elle est unique en ce sens que son approche est différente de celle des universités excitantes car elle forme selon les besoins propres des entreprises existantes.','Mes attentes pour cette formation sont,  d\'enrichir  et de diversifier mes connaissances dans une université qui à une autre approche pédagogique et  une politique différentes de celles existantes.','Mes projections dans 3, 5 ans seront d\'apprendre beaucoup dans ce domaine et de poser les bases de ma propre entreprise vers la fin des 5 ans.','Je trouve que le métier de développeur codeur est très passionnant et c\'est aussi l\'un des maillons important dans ce vaste domaine du numérique.','Internet',NULL,NULL),(667,271,'e8e55380-7bd3-3cc7-8249-fcc5c6ca6aac','License','2021','Université d\'Abomey calavi','Sciences Naturelles','Étudiant','Intermédiaire','J\'aimerais suivre cette formation pour acquérir plus de connaissances ,de compétences et de savoir fait dans le domaine de l\'informatique et du numérique','Mon attente après la formation est de devenir un technicien aux métiers du digital. Être un développeur Codeur','Je comptais mettre mes connaissances acquissent au profit des entreprises de mon pays, servir dans le domaine du numérique.\r\nMettre en œuvre mes compétences partout où le besoin se fera sentir','Le métier de développeur Codeur est un métier en pleine extension, c\'est un métier très indispensable dans dans presque tous les domaines d\'activités. C\'est un pilier dans l\'essor économique d\'une entreprise et même d\'un pays','Internet',NULL,NULL),(668,272,'201fcc97-99bf-36fc-99a1-c93b6d09b679','License','2021','UCAO-UUC','Licence professionnelle en génie télécommunications et informatique','Sans activité professionnelle','Bilingue','J’ai toujours aimé l’informatique et prévois de continuer ma formation dans ce sens. Cette opportunité pourrait me permettre d’approfondir mes connaissances afin de m’améliorer.','A la fin de cette formation, je voudrais pouvoir être une ressource pour toute entreprise ayant besoin d’un développeur informatique.','Dans 5 ans, je voudrais être capable de créer ma propre petite entreprise de développeur web (domaine dans lequel j’aimerais me spécialiser) afin d’offrir nos services de qualité sur tout le territoire béninois.','Le métier de développeur codeur est celui où le développeur arrive à matérialiser sous forme d’un site web (ou application mobiles) les attentes et demandes de son clients.','Par un ami',NULL,NULL),(669,273,'72eaa3b1-a85d-3ef3-b3ca-35040273128a','License','2021','Institut national supérieur de technologie industriel de lokossa','Énergies renouvelables et maintenant des systèmes énergétiques','Salarié','Intermédiaire','Passionné par la technologie et l\'intelligence artificielle ( la programmation ) j\'ai commencé avec la programmation C,C++ après sur le langage python mais mes cours de spécialités mon obligé à vite poursuivre cette passion.','Sachant que l\'évolution du monde actuellement n\'est pas possible sans l\'évolution de la technologie et l\'évolution de la technologie passe pas l\'évolution du langage marchine je voudrais apprendre plus et comprendre au delà des vidéos YouTube.','Avoir une entreprise qui pourra rendre service dans le domaine du TIK, l\'électronique et les énergies vertes.','Un bon métier parceque un ce dernier pourra me permettre d\'avoir tu temps pour ma propre famille et pour mes autres projets professionnels.','Par un ami',NULL,NULL),(670,274,'72eab5c8-3add-3cc2-84bc-c0079b5541fd','License','2020','Université d\'Abomey-Calavi','Technologie alimentaire','Salarié','Intermédiaire','Titulaire d\'une licence en technologie alimentaire et passionnée des TIC, j\'ai suivi une formation (Coding Academy) à Epitech Bénin. Étant à présent un développeur web et mobile Fullstack (dans une entreprise de la place), je pense que cette formation va me permettre d\'avoir plus de connaissances dans les nombreuses technologies du domaine.','Perfectionner mes compétences, devenir plus compétitif sur le marché de l\'emploi grâce aux connaissances à acquérir.','Dans 3 ans, probablement toujours développeur dans une entreprise. Dans 5 ans, être en train d\'asseoir les bases de mon entreprise, née d\'une de mes nombreuses idées de projets.','Je l\'imagine comme un métier qui présente assez de défis ! Assez passionnant, car il est plein d\'opportunités d\'innovation.','Par un ami',NULL,NULL),(671,275,'90261649-f1de-3b84-8546-3f57c0c9bfca','License','2021','EPAC','Licence professionnelle en Maintenance Biomédicale et Hospitalière','Étudiant','Intermédiaire','-Apprendre le code\r\n-Ajouter des compétences à mon CV \r\n-Developper des relations \r\n-Acquérir des connaissances importantes pour mon projet professionnel','J’attends que cette formation m’aide à avoir les bases et le mindset important dans la conception et le développement de solution digitales.','Dans 3 ans ( déjà avoir de solides bases en code d’une façon ou d’une autre, être à 70% de la mise en place de ma startup, et être dans un réseau de jeunes entrepreneurs passionnée) \r\n\r\nDans 5 ans , avoir posé des bases solides a ma startup pour permettre son auto développement, travailler sur de nouveau projet novateur qui allie numérique et santé.','Pour moi le métier de développeur codeur est un métier qui fait appel au sens créatif, logique d’une personne. Son but premier est de developer des solutions numériques pratiques permettant de faciliter la vie d’un groupe de personnes cibles.','Par un ami',NULL,NULL),(672,276,'acfc68d5-5c15-330d-99bf-6965b4689ed3','Docotorat','2020','FSS/COTONOU','Doctorat en Médecine, diplôme d\'État Béninois','Sans activité professionnelle','Courant','Cette formation tant attendue et désirée vient à point nommé m\'outiller pour aider d\'une part  à apporter des améliorations significatives et concrètes dans la prise en charge du patient et la gestion efficace des données hospitalières en allant de la rencontre du patient à l\'hôpital jusqu\'à sa sortie en passant par sa prise en charge. Elle me permettra d\'apprendre les basiques indispensables pour évoluer plus tard vers la robotique et la robotique médicale afin d\'améliorer nos techniques chirurgicales au Bénin pour augmenter les chances de succès des interventions d\'autre part.','La maîtrise des langages au programme en particulier le package indispensable pour le coding','En tant que Médecin graphiste et en plus de cette formation, je serai dans 3ans  DG,chef de projet digital au Ministère de la Santé ou une organisation Mondiale (UNICEF, OMS...) Et dans 5ans Concepteur programmeur de Robots pour chirurgie.','C\'est  métier extraordinaire prisé de nos jours et qui ouvre une infinité de possibilité d\'emploi tout en aidant à résoudre nombre de problème sociétal.','Par un ami',NULL,NULL),(673,277,'d0737cbe-b61c-3c4e-93df-6500e47f4423','Étudiant','2022','Université d\'Abomey Calavi','Kelly HANTAN','Étudiant','Intermédiaire','Je me forme depuis toujours au développement de jeu vidéo. Et je voudrais approfondir mes connaissances.','Comprendre vraiment comment mettre sur pied une architecture de code Performante.','Un studio de jeu vidéo sur pied et mon doctorat en préparation.','J\'ai de l\'expérience dans le domaine et j\'avoue que j\'aime bien.','Par un ami',NULL,NULL),(674,278,'1f885ab7-42af-37fe-a5d8-d4862bd2a12a','License','2020','Université d\'Abomey-calavi','Comptabilité Audit et contrôle de gestion','Sans activité professionnelle','Débutant','Je m\'appelle Anselme TOGBE, ayant fait ma licence professionnelle en comptabilité Audit et contrôle de gestion à l\'université d\'Abomey-calavi, ayant fait une formation professionnelle en gestion fiscale et comptable et un stage professionnel de six mois à la direction générale du trésor et de la comptabilité publique du Bénin.','Mes attentes c\'est comment faire pour devenir à court, moyen et à long terme un développeur codeur professionnel afin de mieux servir efficacement le monde en général.','Je me projecte d\'ici dans 3 à 5 ans être un grand professionnel dans le métier.','J\'ai depuis longtemps imaginé que le métier de développeur codeur est un métier purement et simplement de la digitalisation qui est un métier d\'avenir très rentable.','Par un ami',NULL,NULL),(675,279,'07232b3a-e8f6-32c2-a91e-31b9f58abf49','License','2020','UNSTIM Abomey (Université Nationale des Sciences, Technologies, Ingénierie et Mathématiques Abomey)','Mathématiques-Informatiques','Sans activité professionnelle','Intermédiaire','Cette formation est pour moi une opportunité de pouvoir conceptualiser mes brains de connaissances.\r\n\r\nDe part sa gratuité, elle lève les barrières qui m\'ont longtemps empêcher d\'envisager une carrière directement en lien avec ma passion pour le code et la technologie.','Me permettre de comprendre les soubassement de développement web.\r\nM\'offrir les moyens d\'apprendre à développer des applications web de tout genre.\r\nM\'enseigner la gestion d\'un projet de développement.\r\nM\'assister psychologiquement durant le processus.\r\nMe préparer à l\'univers d\'entreprise.','Au delà du développement web, l\'apprentissage aux machines par l\'intelligence artificielle est ce qui me fascine.\r\nLe développement web est un chemin bien bâti pour m\'y amener.\r\nDes tendances Entreprenariales dans le digital sont blottis en moi et attendent une connaissance plus réaliste de la sphère pour une expansion.\r\nJe commencerai donc à tisser les codes.','Le métier de développeur consister à connecter les idées et solutions à l\'intrat Infini de l\'internet à travers des lignes de codes.\r\nIl s\'agira en général de créer des fonctions résolvant des problèmes particuliers et de les implémenter pour les fins utiles.','Par un ami',NULL,NULL),(676,280,'9ea506ec-e443-372d-ba18-a2d37d4963b4','License','2020','Université d\'Abomey-Calavi','Licence Physique Fondamentale','Sans activité professionnelle','Débutant','Je voudrais suivre ces formations pour acquérir plus d\'expériences professionnelles.On dit souvent on ne finit jamais d\'apprendre.','Je veux être un bon développeur et codeur','Devenir un grand codeur','Un travail très intéressant','Par un ami',NULL,NULL),(677,281,'1f5e0333-d0e5-3ee6-927a-de78ab4db792','Étudiant','2021','Université d\'Abomey-Calavi','Lettres modernes','Sans activité professionnelle','Courant','J\'ai besoin de toutes urgences d\'avoir des connaissances solides dans le domaine de la programmation et des codes pour pouvoir mettre en place seul ou en équipe un certain nombre de solutions numériques face à certains problèmes que je constate et que je vis déjà à l\'université et même dans la société.','J\'aimerais avoir une connaissance surtout pratique des langues me qui me permettraient de développer des sites et des applications web ainsi que de me lancer dans la modélisation 3D.','Je me projette comme un chef d\'une petite entreprise constituée de développeurs web en association avec mes redact','C\'est un travail qui peut se montrer très intense mais qui reste toujours très passionnant et fascinant à la fois.','Par un ami',NULL,NULL),(678,282,'b3f1e226-806b-315f-84ec-09e30fd6eb0f','License','2021','ENEAM/Benin (Ecole Nationale d\'Economie Appliquée et de Management)','Gestion Financière et Comptable','Étudiant','Intermédiaire','Passionné de l\'informatique et désireux d\'intégrer des solutions Fintech dans l\'environnement africaine, j\'ai commencé mon initiation Front end l\'année dernière (2021). Cette année j\'ai pu achever ma formation full stack. Ma souhaite est de maintenir ma détermination et de nourriture davantage mon désir ardent à apprendre auprès des meilleurs et pourquoi pas, apporter aussi ma participation à l\'édifice du mon numérique.','Nourrir continuellement ma passion pour l\'informatique. Et m\'aider a avoir les compétences nécessaires pour réaliser mes différents objectifs.','Dans 3ans, je compte être assez moulé dans des expériences professionnelles pour enrichir mes connaissances. Puis initier des projets personnels. Puis dans 5ans, commencer par mettre sur pieds, un cabinet pour des prestations de services d\'envergure avec des personnes expertes du milieu de la Coding.','Un métier libérable, permettant à toute personne d\'apprendre à être autonome et autodidacte, de savoir gérer son temps et surtout d\'avoir accès à une multitude de challenge. Ce métier aide à évoluer dans un milieu en perpétuel évolution.','Par un ami',NULL,NULL),(679,284,'c0981a6f-cad3-3c4d-8db5-cb05f9452ac5','Étudiant','2020','Pigiet Benin','Génie logiciel','Étudiant','Débutant','Je veux faire cette formation parce que  j’aime l’informatique. J’aime la programmation','Mes attentes par rapport à cette formation sont énorme. \r\nJe veux sortir en tant qu’un grand informaticien','Dans trois ou cinq ans lorsque je me voir je suis un programmeur recherche','Je pense que le métier du développeur codeur est un métier indispensable pour le développement des entreprises surtout de nos jours .','Par un ami',NULL,NULL),(680,285,'36956cf4-c40b-39e8-9eff-439702238f75','Étudiant','2020','Institut cerco','Développeur Web','Sans activité professionnelle','Débutant','Je suis passionné par tout ce qui touche ce domaine','Obtenu les savoir et compétence nécessaires pour être compétitive sur le marché','Être parmi les meilleurs de ce domaine','C\'est vraiment un métier au top et excitant','Par un ami',NULL,NULL),(681,286,'6f48de08-92d9-3cdc-9337-2990307e3eb5','License','2014','UAC','Géographie Option Humaine et Economique','Entrepreneur','Intermédiaire','Je suis dans une reconversion professionnelle.','Développer plus de compétences à travers des projets pratiques.','Un acteur incontournable des solutions digitales au Bénin et dans le monde avec ma solution e-money startup','Conception, déploiement et administration des solutions web','Internet',NULL,NULL),(682,289,'5ce6ffa5-240c-3a5d-9f3c-52a06332b1dd','Master','2022','IMSP','Licence informatique','Étudiant','Intermédiaire','Pour améliorer mon niveau de maitrise en pratique','Être capable de concevoir des applications pour répondre aux besoins du Bénin','Être un grand développeur à mon propre compte','C\'est un métier très passionnant qui amène le développeur à sortir de sa zone de confort pour chercher les solutions à un besoin donné','Par un ami',NULL,NULL),(683,290,'5d542c06-a4bd-3a3d-9f1e-0187e47b8cc8','Étudiant','2018','Université d\'abomey calavi (UAC)','Chimie Biologie et Géologie (CBG)','Entrepreneur','Intermédiaire','Je veux suivre cette formation pour nourrir ma passion pour le numérique et pour avoir une situation professionnelle stable dans le domaine du digital qui de nos jours devient incontournable.','Après cette formation, je veux pouvoir développer des sites Web professionnels et concevoir des applications mobiles répondant aux normes internationales avec des fonctionnalités innovatrices.','Je me vois entrain de travailler dans une entreprise en tant que développeur ou entrain de gérer ma propre entreprise qui offre des services numériques.','C\'est un métier passionnant car ça permet de développer son mental et de réaliser des choses automatiquement remarquables et importantes.','Internet',NULL,NULL),(684,291,'57fc7202-d2fc-3a4e-979b-96287e650825','Étudiant','2021','HECM','Informatique Industrielle et Maintenance','Étudiant','Intermédiaire','Pour élargir mes compétences dans le monde du numérique/de la technologie et les apporter au profit des grandes entreprises','Que cette formation me permette de pouvoir me hisser au niveau des grands ingénieurs du monde puisque aujourd\'hui nous dépendons de ça','Je m\'imagine grand développeur ingénieur et être celui qui apporte des solutions au monde dans lequel nous nous trouvons à travers les codes','Le métier de développeur codeur c\'est un métier qui a prévu et qui continue de prévoir de la passion. Je n\'ai pas les mots pour donner mon imagination à ce propos.','Par un ami',NULL,NULL),(685,292,'54d236b8-7fc9-3c38-b692-9b40e917df58','License','2022','Université de PARAKOU','Gilchrist Derrick AÏHOU','Étudiant','Intermédiaire','Pour acquérir des connaissances dans le domaine et avoir un plus dans cette ère de révolution informatique','J\'espère avoir des bases solides dans le domaine et être apte pour un postulat','Je me projette comme developeur codeur, travaillant dans une boite importante et bien rémunéré','Un métier passionnant qui demande de l\'application et une discipline importante','Par un ami',NULL,NULL),(686,293,'fc514d82-ebcb-33b3-9c08-c073632a14d3','Étudiant','2022','ism adonaï','Baccalauréat','Étudiant','Débutant','j\'ai toujours été passionné par le l\'apprentissage du métier de codeur. C\'est un secteur qui m\'a toujours intéressé mais je n\'étais pas dans la capacité de suivre ce chemin en raison des frais de scolarité trop élevé. Là j\'ai une réelle opportunité de faire la formation que j\'ai toujours voulu.','J\'attend de cette formation une monter en compétence en matière de codage avec beaucoup de pratique.','Je me vois être parmi les meilleures codeurs. Ainsi je pourrais créer ma propre structure et employé d\'autres codeurs.','Pour moi il s\'agit d\'un métier de langages informatique, création de lignes de code et qui demande beaucoup de rigueur et de concentration.','Par un ami',NULL,NULL),(687,294,'13ceb9e8-4800-3166-afdb-af1b6d34d612','License','2018','ESGT-BENIN','Génie informatique et telecommunication','Sans activité professionnelle','Débutant','J\'ai me apprendre et concevoir','Apprendre de nouvelles connaissances','Avoir réalisé plusieurs projets de développement','C\'est un métier passionnant','Par un ami',NULL,NULL),(688,295,'9d6473fe-0588-3c6b-ad93-735fbbf490cf','License','2019','Abomey Calavi (UAC)','Sciences de la Vie et de la Terre','Sans activité professionnelle','Débutant','Je suis WIWI Rodrigue, titulaires d\'une licence en sciences de la vie et de la terre , sans emploi. J\'ai fait la formation en informatique (Word, ...), actuellement à la recherche d\'une formation professionnelle de qualité pouvant me permettre de subvenir à mes besoins . Ma candidature à cette formation de développeur codeur me pemettrat d\'acquérir  des compétences techniques pour complèter mes connaissances de base en informatique .','Mes attentes par rapport à cette formation  de métier des développeurs codeures : avoir la maîtrise en technique de developeurs codages, pour créer mon propre entreprise pour pouvoir servir aux autres entreprises qui sont dans le besoin.','Dans 3ans à 5ans, je serai un génie dans le métier de développeur codeur, créer mon entreprise propre à moi, avoir des partenaires dans plusieurs entreprises qui sont dans le besoin au niveau national comme international.','Le développeur codeur est un expert des langages informatiques, le développeur traduit la demande d\'un client en lignes de code. C\'est un métier de plus en plus transversal: télévision, transports, art, médias, sciences, le codeur est partout.','Internet',NULL,NULL),(689,296,'27c61494-41b5-32cc-af2c-5c359b9a1337','License','2014','UAC','Gédéon DOSSOU','Entrepreneur','Intermédiaire','Je suis quelqu\'un d\'ouvert d\'esprit avec une grande soif de connaissance. Très entreprenant, j\'aime les challenges.','Apprendre et améliorer mes compétences codage applique afin d\'être plus compétitif sur le marché de l\'emploi et trouver un bon job.','Bosser pour une boîte de la technologie et être épanoui professionnellement.','Logique, beaucoup de challenge et intéressant','Internet',NULL,NULL),(690,297,'b7ab4783-fdd8-3c5d-9d9a-0c7c5a506d71','License','2021','Université de Parakou','Licence professionnelle en Statistique Appliquée','Sans activité professionnelle','Débutant','Mes aspirations professionnelles étant de devenir un data Scientist, je juge exceptionnellement très utile cette opportunité qui est de suivre cette formation. Aussi, je constate que c\'est une formation très pratique qui nous met à l\'œuvre comme dans la vie professionnelle. Je suis certain que cette formation fera de moi un vrai programmeur.','C\'est que nous puissions arriver à une exécution complète du programme.','Dans 3 ans,  5ans, je me vois entend qu\'un grand programmeur au service d\'une grande entreprise et qui est recherché un peu partout dans le monde.','Le monde devenant de plus en plus numérique,  digitalisé, je pense que le métier de développeur codeur est un métier du siècle. C\'est le meilleur métier qu\'on puisse avoir aujourd\'hui.','Par un ami',NULL,NULL),(691,299,'303da669-0c8c-3a95-aae9-191934608492','Étudiant','2020','Abomey-Calavi','Droit','Sans activité professionnelle','Intermédiaire','Apprendre plus de choses dans le digital\r\nApprendre à créer mon entreprise en ligne et faire beaucoup d\'argent','Par rapport à cette formation,je veux apprendre et maîtriser les langages possibles dans le motiver de développeur','Dans 5ans je crois que j\'aurais un très grand startup en ligne qui sûrement va résoudre beaucoup de problème dans de nombreux secteurs d\'activités','C\'est pas facile','Internet',NULL,NULL),(692,300,'52245c78-bac3-31df-a2aa-6d6a050f8c60','Étudiant','2022','Université d\'Abomey calavi','Droit','Étudiant','Intermédiaire','Je veux suivre cette formation pour apprendre à maîtriser l\'utilisation des langages et du code informatique. Et aussi m\'outiller des compétences de management et de de gestion de projet.','J\'attends de cette formation pouvoir développer les aptitudes nécessaires pour un