La pratique, du transfert de connaissance sans réserve de la part des encadreurs, J\'espère sortir de cette formation totalement aguerri afin de répondre tel un développeur web confirmé partout où besoin se fera sentir et réussir mon projet.','Être un développeur web confirmé, et travailler en tant que consultant et Entrepreneur dans le domaine de la technologie digitale.','Le développeur codeur conçoit, développe et met au point des projets d\'application informatique, de la phase d\'étude à son intégration, pour des clients ou des entreprises selon des besoins fonctionnels et le cahier des charges.','Par un ami',NULL,NULL),(695,303,'d527cf70-677d-3bfe-9c8c-d160963abcfe','License','2018','UAC','Maîtrise ès-Sciences Naturelles','Sans activité professionnelle','Intermédiaire','Pour avoir une stabilité professionnelle','Être bien formé pour avoir la stabilité professionnelle tant désirée','J\'aurai un travail','Je pense qu\'on tend vers une période où personne ne pourra pas se passer de l\'informatique.','Par un ami',NULL,NULL),(696,304,'87882039-f41b-36e8-8624-2d8d158bc72c','Étudiant','2019','VED UAC','Transport et logistique','Étudiant','Intermédiaire','J’aimerais approfondir mes connaissances en programmation informatique que j’ai débuté depuis l’année dernière!','J’aimerais bien connaître les nouvelles façons de créer un site web bien référencé, de conception d’application mobile, découvrir les techniques nouvelles d’interagir avec les API','Dans 3 ans, je serai un grand développeur fullstack, expert du couple Laravel/VueJs','Le métier de développeur codeur est un métier très passionnant, qui en appelle à la réflexion, au tact et surtout qui demande une perpétuelle mise à niveau de ses connaissances.','Internet',NULL,NULL),(697,306,'201538cd-06a8-3b09-bfce-eb10ad659e40','Étudiant','2019','University d\'Abomey calavi','Diplôme en Agronomie','Sans activité professionnelle','Intermédiaire','Je suis un grand passionné de l\'outil informatique j\'ai beaucoup de projets