daction web. Principalement, il s\'agit des logiciels qui consiste à rédiger des articles SEO, de marketing, etc. Ces logiciels seront mise en ligne et servirons a beaucoup de personnes de mieux rédiger en prenant des abonnement. Bien évidemment, je maitrise bien ce domaine voilà pourquoi je veux me pencher la dessus. Ce domaine manque énormément d\'outils pour améliorer le travail. De même, cette formation me permettra d\'aider à résoudre assez de problèmes quotidiens de la population que je n\'ose les citer. Grâce a cette formation, je pourrais enfin faire un truc que j\'aime et savoir que cela va servir à beaucoup de personnes. Je serait libre et. J\'ai la certitude que c\'est le chemin de ma réussite.','J\'aimerais que cette formation me donne les moyens ou les connaissances nécessaires pour arriver à mettre en place mes projets. Aussi, j\'aimerais que cette formation m\'aide pour que je puisse réveiller le génie qui est en moi afin de réaliser de belle projets. J\'ai juste besoin d\'aide de qualité pour réussir avec ce métier et je suis persuader que cette formation est la meilleure alternative pour y arriver. Qu\'il m\'apporte du sérieux pour que je puisse brillamment réussir à établir mes projets.','Je me vois dans l\'une des mes grandes entreprises à renommée internationale grâces à des logiciels de qualités que j\'ai puis créer. Aussi, je me vois employer beaucoup d\'autres jeunes et les partager mes connaissances que vous m\'avez permis de bénéficier à travers cette formation. Enfin, c\'est si j\'ai la chance d\'être parmi les personnes que vous avez sélectionner. J\'ose croit que j\'en fait partie. Merci bien !','Pour moi, le métier de développeur codeur et le meilleur pour mieux réussir dans la vie. C\'est tout simplement le futur. L\'avenir du monde repose entièrement sur ce métier. J\'aime la liberté que donne se métier. En plus, avec ce dernier on peut devenir son propre patron. Également, il est l\'idéale pour entreprendre et réussir. Être développeur, c\'est faire partie des personnes qui détient une partie du monde l\'Internet. Aussi, c\'est offrir ces services au monde entier et partager ces connaissances pour la réussite d\'un pays et donc d\'un monde. Moi, j\'adore l\'Internet et tous ces branches, mais surtout le développement et codage. Je pense que tous les codeur doit être respecter et c\'est un privilège d\'être parmi toutes ces personnes. Pour ma part, j\'aime beaucoup tous ce qui a rapport avec l\'intelligence artificielle : python, coding sensoriels...\r\nJ\'ai de mon côté plein de projet. Je pense donc que le métier de développeur est la clé pour réussir. Tout de même, j\'ai conscience qu\'il faut bien bosser, efficacement, très durement et percevez afin de produire des logiciels, des entreprises de qualités et réussir dans ce métier.','Internet',NULL,NULL),(705,314,'fd4a718f-7b4e-3753-886d-c04278b24431','License','2022','UNSTIM','Licence Professionnelle en Mathématiques-Informatique','Sans activité professionnelle','Courant','Je suis passionné de l\'informatique.','Une très grande amélioration de mes connaissances en informatique.','Être cité parmi les meilleurs développeur codeur.','Un métier d\'avenir.','Internet',NULL,NULL),(706,317,'f427b380-00c9-35f7-afc4-da4406fddc3c','License','2019','Eneam','Gestion commerciale','Entrepreneur','Intermédiaire','Je suis passionné par tout ce qui informatique. J\'ai toujours voulu faire une formation dans ce domaine.','J\'espère apprendre beaucoup dans ce domaine. Que ces cours théoriques et pratiques pourront m\'aider dans l\'avenir à être un bon développeur','Dans 5 ans je serai un bon développeur. Travaillant avec une grosse boîte ou à mon propre compte. Avoir une stabilité financière','C\'est un métier intéressant en ce sens que ça permet de développer et d\'assurer la maintenance des sites internet, des applications Web et des différentes plateforme en ligne','Par un ami',NULL,NULL),(707,319,'801ef3ee-a025-39aa-920b-7efbee0a0a85','License','2021','Université d’abomey calavi','Comptabilité audit et contrôle de gestion','Sans activité professionnelle','Débutant','Je voudrai suivre cette formation non seulement pour enrichir mon CV mais plutôt pour apporter une valeur ajoutée à ma passion qui est l’informatique élevée','J’attend de vous une formation meilleure','Être un grand développeur','Un métier d’avenir','Par un ami',NULL,NULL),(708,321,'0edbb833-5509-3307-a7fc-feba4734f224','License','2021','Université d’Abomey-calavi','Linguistique française','Sans activité professionnelle','Débutant','Parce que ce domaine est pour moi une passion alors je voudrais bien saisir cette opportunité pour me faire bien former.','Répondre à des exigences professionnelles, renforcer mes propres capacités, apprendre de l’expérience collective et devenir une organisation apprenante','Un bon développeur','Un développeur doit être curieux, créatif, autodidacte, autonome et sociable','Par un ami',NULL,NULL),(709,322,'6e203f42-bd74-3c9a-815f-5e404f37219c','License','2023','HILL CITY','Analyse Biomédicale','Étudiant','Intermédiaire','Pour ma propre perfection','Élargir ma connaissance entrepreneuriale','Par les expériences.','C’est un métier pluridimensionnel','Internet',NULL,NULL),(710,324,'4ace2164-ad6e-3794-9169-eabda9dae1ee','Étudiant','2020','Abomey-calavi','Bac','Étudiant','Débutant','Je veut suivre cette formation afin de servir d\'autres générations.','Partager ma connaissance ma promotion et autres.','Pour acquérir une connaissance adéquate dans le domaine du développeur.','C\'est un pilier de base de la technologie.','Internet',NULL,NULL),(711,325,'fe28c90e-7ab9-34dc-a1a3-a9282f6b9d98','License','2021','Université d\'Abomey-Calavi','Économie et Gestion des Collectivités Locales','Sans activité professionnelle','Intermédiaire','Je suis Hervé EVI, titulaire d\'une licence en Économie et Gestion des Collectivités Locales à la Faculté des Sciences Économique et de Gestion de l\'Université d\'Abomey-Calavi. Mon intérêt pour le développement de ma localité m\'a poussé à orienter ma formation universitaire vers cette spécialité et j\'ai pu effectuer un stage professionnel à la mairie de Dogbo.\r\nJe veux m\'orienter vers un autre domaine de préférence l\'informatique pour apprendre de nouvelles compétences afin de maximiser mes chances sur le marché de l\'emploi.  Je suis donc à l\'écoute de nouvelles opportunités pouvant me permettre d\'atteindre mon objectif. \r\nCette formation me permettra sûrement d\'apprendre l\'informatique, les compétences requises pour faire carrière en tant que développeur codeur et de donner un nouveau sens à ma vie professionnelle.\r\nJe mets toujours passion et détermination dans tous ce que je fais et il en sera de même pour cette formation si je suis retenu.','Développé de nouvelles compétences techniques comme professionnelles.\r\nUne formation bien dispenser, basée sur la pratique dans un cadre convivial.','Passer 2 ans pour l\'acquisition de nouvelles compétences afin d\'être prêt pour un nouveau parcours professionnel.\r\nLes trois ans suivant mes compétences acquises, je travaillerai au coté des entreprises et particuliers pour l\'accroissement de leurs activités.','Les développeurs codeurs créent des programmes informatiques comme les sites web application et bien d\'autres.','Par un ami',NULL,NULL),(712,327,'47078464-94dc-3f60-b289-d594b19497d8','License','2018','Université d’Abomey Calavi','Licence en économie appliquée','Salarié','Débutant','Je veux suivre cette formation parce qu\'elle est plus axée sur la pratique, offre une immersion dans un cadre réal de réalisation de projet au sien d\'une entreprise,et enfin le coût de la formation est très abordable.','Je dois être en mesure de concevoir par moi même une application, un site ,être très polyvalent dans ma vie de développement web , codeur.','Je me vois être développeur web , codeur  confirmé avec plusieurs projets réalisés et surtout apporter mon expertise au projet phare de la sous région et dans le monde','C\'est un métier qui requiert la discipline de soi, être Structurer pour arriver à l\'objectif','Par un ami',NULL,NULL),(713,357,'665d7320-b8ef-4f20-9e0c-515f716980ec','Bac+2','2022','UATM Gasa formation','Génie Électrique : Système informatique et logiciel','Étudiant','Débutant','Je veux suivre cette formation car je trouve que c\'est une opportunité qui s\'offre à moi et que je dois saisir. En plus de prendre toute ma formation en charge, ça répond à plusieurs de mes objectifs. C\'est purement pratique et ça me permettra d\'avoir la maîtrise dans ce domaine d\'informatique que j\'ai choisi. Ce que j\'ai toujours souhaité. Et par dessus tout à la fin de cette formation un boulot est garanti, je ne pouvais pas laisser passer cette occasion et je compte donner le meilleur de moi même pour répondre aux attentes des formateurs et pour mon propre niveau de connaissance aussi','Mes attentes, avoir le niveau requis pour m\'inserer dans le monde professionnel, respecter tout ce qui a été dis dans la formation à suivre, c\'est à dire nous apprendre réellement tout les langages mentionné dans la formation, j\'espère avoir de bon guides à qui on fera honneur de part notre réussite','Si éventuellement je suis pris , je m\'imagine dans 3ans 5ans à travailler déjà dans l\'une des entreprises où on m\'aurait placé à la fin de la formation. Je l\'espère vraiment','Déjà si ce n\'est pas une passion ça paraît difficile. Mais lorsque c\'est une passion on devient assoiffé de connaissances. C\'est un métier qui bien vrai te demande le sacrifice de tout ton temps mais qui en même temps t\'ouvre plusieurs voies car le domaine de l\'informatique est très vague, chaque formation est utile. C\'est un métier qui demande beaucoup de volonté et beaucoup de passion','Internet',NULL,NULL),(714,358,'e011ffff-2f5a-484d-a1d3-092f0075cfff','Licence','2018','Université Polytechnique Internationale Obiang N\'guema Mbassongo (UPI-ONM)','Marketing et communication commerciale','Sans activité professionnelle','Intermédiaire','Je voudrais suivre cette formation parce que c\'est ma passion, j\'ai pas eu l\'opportunité faute de moyen de faire les grandes écoles parce que ça coûte cher les universités qui proposent ce genre de formation. J\'ai dû faire une formation en marketing et communication commerciale pour toujours avoir le goût à la technologie et aux TIC.','À travers cette formation je voudrais en un temps record me surpasser et être au top des meilleurs codeurs de l\'Afrique. Je veux faire partir des meilleurs.','En 3 ans, être parmi les rangs des meilleurs codeurs, une référence.\r\nEn 5 ans, être un expert, un consultant, un Web entrepreneur.','Le métier de développer codeur est celui qui rédige des lignes de codes pour un but précis. En bref, c\'est celui qui part d\'une imagination à la réalisation d\'un projet informatique en software.','Par un ami',NULL,NULL),(715,359,'3297300b-b513-4f99-9893-0707b3567ee9','Bac+1','2020','Université d\'Abomey-Calavi','Fresnel Jean Claude Cossou','Entrepreneur','Débutant','Titulaire d\'un Baccalauréat littéraire A2 et d\'un diplôme professionnel en montage vidéo et cadrage à l\'Institut Numérique Luda, je souhaite intégrer Highfive University. Après plusieurs mois de recherche approfondie sur différents programmes d\'études ou de formation sur Highfive University en raison de la qualité des cours dispensés évoqué sur le site de l\'université. De plus cette formation que propose Highfive University correspond parfaitement à mes objectifs de carrière. Depuis le collège je me suis toujours intéressée au ordinateurs et comprendre tout ce qu\'on peut faire avec. Adhérer votre honorable université est pour moi une réelle chance d’avancer dans la vie en étoffant ma formation académique. \r\nMa motivation, ainsi que ma détermination me permettront de mener à bien mon projet d’étude, et de réaliser mon projet professionnel. Je vous remercie de consacrer votre temps à l’étude de mon dossier, je me tiens naturellement à votre disposition pour tout complément d’informations. \r\nDans l’attente d’une réponse, que j’espère favorable, je vous prie d’agrée l’expression de mes salutations distinguées.','Je voudrais répondre à une exigence professionnelle en matière de développement web, renforcer mes propres capacités, apprendre et acquérir un maximum de connaissances auprès des formateurs de Highfive University','Dans 5 ans, je me vois monter une agence de communication digitale avec mes mes compétences en audiovisuel et celles que je vais acquérir lors de ma formation à Highfive University.','Pour moi le métier de développeur web est complexe et en même temps simple pour ceux qui sont passionné. Je pense que c\'est un métier d\'avenir car le monde devient de de plus en plus numérique avec le temps.','Internet',NULL,NULL),(716,360,'82031aa4-e999-4380-b62f-b56e457f9b6d','Bac+2','2020','Les cours sonou','Système informatique et logiciel','Sans activité professionnelle','Courant','Pour acquérir des compétences, les aptitudes et les attitudes nécessaire dans le métier de développeur codeur','Avoir une maîtrise complète du métier de codeur, de l\'expérience en se domaine et un emploi pour en vivre','Je me vois déjà diplômé de highfive, avec un emploi stable de codeur, en direction d\'une équipe et pourquoi pas directeur des projets et père d\'une petite famille dans 5ans','Je l\'imagine comme un art, un métier plein de possibilités, qui nous permet de laisser cours a notre imagination tout en respectant certain critères ou choix en fonction du projet','Par un ami',NULL,NULL),(718,362,'713e5488-04ef-4ffb-84ee-8fe4ac7a836d','Licence','2019','HECM Porto-Novo','Banque Finance et Assurances','Entrepreneur','Courant','Malgré ma filière de formation professionnelle, je désire profondément me faire formé dans le domaine de développeur web car nous sommes à l\'ère du numérique et ça fait partie des secteurs de l\'avenir. Une reconversion professionnelle serait un avantage pour moi et pourrait aussi servir dans mon domaine de formation initiale.','Une formation pouvant me permettre à la fin d\'être apte dans le développement web ou ou le codage, d\'être compétitif sur le marché de l\'emploi avec mes compétences acquises','Dans 3ans je me vois disponible sur le marché de l\'emploi à mettre en pratique mes compétences, et dans 5ans je me vois piloté un projet web.','C\'est un métier nécessaire dans presque tout secteur d\'activité et qui nécessite beaucoup de persévérance et surtout un apprentissage au quotidien car chaque jour de nouvelles stratégies et perspectives sont apportées au domaine','Par un ami',NULL,NULL),(719,363,'26b4731a-aff7-4dbf-82f4-1eecada6e5aa','Licence','2018','Université d\'Abomey Calavi','Licence en sciences économiques et de la gestion','Salarié','Débutant','Le langage informatique est un langage du 21ème siècle. Suivre cette formation me permettra de comprendre ce langage, travailler ma créativité, savoir comment interagir entre mes compétences informatiques et les besoins d\'une entreprise ou d\'un particulier. Aussi, nous sommes à l\'air du numérique et les projets les plus importants de ma vie nécessitent de suivre cette formation pour les réaliser.','La formation doit me permettre d\'avoir des compétences en la matière. je veux vraiment être indispensable quand on parle de développement web.','Vivre du métier à fond, c\'est mon rêve. Avoir aussi un réseau de développeur confirmé au Bénin.','C\'est un métier qui t\'amène à avoir l\'ouverture d\'esprit, la planification, la structuration, le dépassement de soi. On est challengé tout le temps. On ne cesse pas d\'apprendre.','Par un ami',NULL,NULL),(720,364,'02fdd927-da63-4cda-82e8-5043a7933696','Bac+2','2022','ISM Adonaï','AUDIT ET CONTROLE DE GESTION','Sans activité professionnelle','Débutant','Pour acquérir plus de compétence dans le domaine du codage','je m\'attends à ce que cette formation face de moi l\'un des meilleurs élèves de HIGHFIVE University et l\'un des meilleurs codeurs de Cotonou.','D\'ici 5 ans je me vois faire partie des meilleurs codeurs du Bénin','Pour moi, un développeur codeur est le pro des langages informatiques. Son but est de développer des interfaces web adaptées pour son client.','Par un ami',NULL,NULL),(722,366,'23e2a750-ceac-4ad3-a0be-8577cd9c5299','Licence','2022','ESGIS','Informatique SRS','Étudiant','Intermédiaire','Pour avoir plus d\'expérience et pour apprendre d\'avantage','De nouvelles connaissances en informatique','Travaillant dans votre structure étant salarié','C\'est un métier d\'avenir qui offrent beaucoup d\'opportunités','Par un ami',NULL,NULL),(723,367,'1ca09287-97cb-42e4-a24a-5d1dbd49e10b','Bac+2','2022','Université d\'Abomey-Calavi','MIA','Étudiant','Intermédiaire','Je veux suivre cette formation dans le but d\'améliorer mes compétences de développeur.','Je voudrais être tre bien formé et apprendre de nouvelles choses.','Dans 3 ans, j\'aimerais devenir un webmaster de qualité et qui sera soliciter par tout le monde.','Je l\'imagine comme il métier d\'avenir. Un développeur ne peut pas chômer. Aujourd\'hui, internet est indispensable dans tout ce que nous faisons.','Par un ami',NULL,NULL),(724,368,'4bdd9290-810a-425d-92f2-6934b27e7100','Licence','2022','ESGIS','Informatique','Étudiant','Débutant','Afin d\'acquérir plus de connaissance et  d\'expérience professionnelle dans le domaine informatique','Avoir une bonne maîtrise du domaine informatique','Devenir architecte d\'administration réseau','Le métier de développeur codeur est très intéressant passionnant mais aussi très épuisant','Par un ami',NULL,NULL),(725,369,'f6277fa9-0b68-4fe6-a579-e8e473d7a9eb','Bac','2009','UAC','Anglais','Entrepreneur','Débutant','Découvrir d\'avantage le monde du digital et ce qu\'est un développeur\r\nJe veux me faire une autre source de revenus .','Comprendre ce qu\'est un développeur.\r\nLes différents rouages et débouchés de ce métier','Être là meilleures développeuse  et commencez déjà a fonctionné','Je n\'en sais pas grande de choses.\r\nMais puisqu\'on parle de digital , ça doit être sûrement vaste','Par un ami',NULL,NULL),(726,370,'0adba250-bacd-4bc7-bfa3-43ab492a198b','Bac+2','2022','Uac/faseg','Économie','Sans activité professionnelle','Débutant','Je voudrais bien suivre cette formation car elle est prometteuse et c’est un métier qui m’a toujours plu','J’espère obtenir un bon emploi et jouir de ma formation','Je me vois employer','Le métier de codeur selon moi c’est quelqu’un responsable de la programmation, c\'est-à-dire de la production de lignes de code, il rédige et suit un cahier des charges précisant les spécificités techniques à suivre pour créer le programme.','Par un ami',NULL,NULL),(727,371,'70826fb3-e9f0-490f-8d63-4402e0f8719e','Bac+2','2022','Université d\'Abomey Calavi','Anglais','Étudiant','Courant','Aujourd\'hui le monde fonce à grand pas vers le numérique, tout est digitalisé aujourd\'hui, sinon presque.\r\nAlors je trouve primordial pour ne pas être analphabète du futur, de m\'intégrer dans cette vague là.','Grâce à cette formation qu\'accorde HIGHFIVE University, j\'aimerais acquérir les connaissances nécessaires pour pouvoir m\'adapter à cette mondialisation du digital et en fait une profession.','Dans 3 ans, je me vois capable de créer n\'importe quel site web, de bien pour gérer une communauté web et pourquoi aider à travers des formations, les passionnés du codage.','Le métier de développeur codeur pour moi c\'est une métier de réflexion, de créativité et d\'organisation.','Internet',NULL,NULL),(728,372,'e0c1a610-5fea-42f9-a51c-ee47b8aaab7b','Licence','2019','Université Catholique de l\'Afrique de l\'Ouest (UCAO-UUC)','Gestion des Ressources Humaines','Entrepreneur','Débutant','J\'aimerais me former aux métiers du futur afin d\'être de ces personnes qui pourront un jour changer le monde .','Après ma formation et même pendant j\'aimerais déjà pouvoir réaliser des projets incroyables, avoir tout les jours de l\'inspiration, je veux savoir manipuler internet comme si c\'était une partie de moi,  signer des contrats de travail avec des entreprises et particuliers dans le monde.','\"Je dirige une équipe de développeur codeur, nous travaillons avec les plus grandes entreprise du monde et des particuliers, nous nous occupons de tout le côté internet des entreprise ce qui me permet de bien gagner ma vie mais surtout d\'exercer un métier qui ne m\'ennuie jamais. Je suis même sûr le point de créer mon entreprise physique et d\'offrir de l\'emploi à plein de développeur codeur. Je veux révolutionner l\'industrie des Métiers du web.\" Voilà un peu comment je me vois dans 3ans et 5ans. Merci.','Le métier de développeur codeur est un métier de liberté, c\'est un métier passionnant, certes je suis sûr que ce n\'est pas facile, puisque les belles choses ne sont pas facile, mais je trouve que c\'est un métier qui permet de développer à chaque instant son imagination. Et surtout c\'est un métier qui peut rendre indépendant financièrement tout ceux qui savent la pratiquer.','Internet',NULL,NULL),(729,373,'c0a95991-a072-464d-b93f-93215493d2a1','Licence','2014','Université Africaine de Management et de la Technologie Gasa formation ( UATM GASA formation)','Reseau informatique et télécommunication','Salarié','Débutant','Ayant une licence en réseau informatique et télécommunication et exerçant dans le domaine de la maintenance informatique depuis 7 ans. Cette formation est une opportunité pour moi d\'acquérir des notions dans le domaine informatique pour faire face à de nouveaux challenges. Pour moi le métier de développeur web est moderne et évolutif.','Mes attentes par rapport à cette formation sont : \r\nÊtre capable d\'assimiler correctement les prérequis indispensables \r\nAvoir les aptitudes pour diriger un projet de développement web \r\nAvoir les notions pour être un bon développeur','Dans 3 ans je me vois finir ma formation et être entrain de faire mes preuves, en donnant mon savoir faire tout en me perfectionnant. Et dans 5ans je me vois créer ma propre boite dans le but d\'apporter des solutions à des personnes et entreprises nationales comme internationales.','Le développeur codeur est une personne capable de créer des logiciels,  des sites web souvent sur mesure , afin de répondre à des besoins précis de la part des utilisateurs.','Par un ami',NULL,NULL),(730,374,'432b4928-e325-4217-a6ff-08f52e7925fb','Bac','2021','Complexe Scolaire Dyanath Ahouefa','Baccalauréat','Étudiant','Intermédiaire','Je veux suivre cette formation dans l\'unique but d\'exprimer librement mon imagination et ma passion pour la programmation. Non seulement exprimer ces dernières, mais aussi acquérir les connaissances nécessaires pour rendre concret tous mes projets d\'avenir.','Tout ce que j\'attends à la fin de cette formation, c\'est de voir mes connaissances accroître et de devenir compétents dans le domaine afin de travailler sur plusieurs projets favorisant le développement du monde. Aussi, j\'aimerais que HIGHFIVE UNIVERSITY tienne parole quant à l\'employabilité.','Je me vois en tant développeur professionnel pour une entreprise dans 3ans. Et dans 5ans, je me vois entrain de créer une startup de recherche avancée en développement d\'application mobile.','Le métier de développeur codeur est pour moi un métier t\'offrant une liberté totale dans tes actions et dans tes réflexions. Il est aussi un métier primordial dans tout secteur d\'activité.','Internet',NULL,NULL),(731,375,'7f4bd350-b084-4c17-aa7f-413058a7480c','Licence','2022','UNSTIM','Mathématiques-Informatique','Sans activité professionnelle','Débutant','je suis curieux, débrouillard, j\'aime  trouver des solutions par moi-même et jai une forte envie d\'apprendre et de découvrir de nouvelles choses. Par ailleurs mon rêve le plus profond est d\'être un expert en sécurité informatique dans l\'optique d\'aider les utilisateurs d\'Internet à sécuriser leurs vie privée. Ainsi suivre une formation sur le développement web sera un atout pour moi et qui me servira dans la réalisation de mes objectifs (expert en sécurité informatique).','Comme attentes, je souhaite découvrir assez de choses dans le domaine du développement web au cours de cette formation. Je désire surtout être capable de résoudre certains problème aux quels les gens sont confrontés dans ce domaine après avoir suivi cette formation ou en suivant cette formation.','Dans 5ans, je me vois avec un doctorat en sécurité informatique et à mon actif des solutions pour régler certains problèmes lié à l\'insécurité dans le monde du web et dans l\'informatique de façon générale.','Un métier difficile et qui demande d\'avoir un esprit logique, de la curiosité. c\'est aussi Un métier qui demande et nécessite une grande motivation et une envie de connaître. Après c\'est un métier très passionnant.','Par un ami',NULL,NULL),(732,376,'8053306e-6681-41c0-a244-c6909e7620d6','Licence','2022','Fast-Natitingou','Mathématique et Informatique','Sans activité professionnelle','Débutant','Je veux suivre cette formation parce qu\'une formation c\'est ce qui a de plus concret et j\'aime l\'informatique','J\'aimerais qu\'a la fin de cette formation que je sois capable d\'en faire quelque chose de concret avec les leçons apprises','Dans 3 ou 5 ans je vois acquérir beaucoup de connaissance en statistique appliquée,c\'est ce qui a de plus concret vue le chemin que j\'ai choisi et elle est très liée à l\'informatique','C\'est un métier que j\'aime beaucoup vue que j\'aime l\'informatique, le codage','Par un ami',NULL,NULL),(733,378,'cadece11-fde0-4bc1-9739-de56f96f0ee0','Licence','2018','FASHS','Licence en Anglais','Sans activité professionnelle','Courant','Parce qu’on  me la proposé  et je pense que ça peut m’être utile pour m’en sortir dans la vie','J’espère devenir plus meilleur','Je pense devenir un meilleur développeur ou codeur','C’est un métier qui à plus besoin de la concentration et qui peut rendre autonome','Par un ami',NULL,NULL),(734,379,'fbe69dcb-c426-4949-8ced-e0e875fe35bc','Bac+2','2020','Les Cours SONOU','Sciences Politiques et Relations Internationales','Sans activité professionnelle','Courant','La raison la plus évidente pour moi de vouloir suivre cette formation est de booster ma carrière, en étant mieux préparé à servir votre entreprise. Le code est la compétence d’aujourd’hui ! Il est même aussi indispensable que l’anglais. Il est vraiment donc important de s\'adapter au nouveau monde; fortement axé sur le digital en ne passant pas à côté de cette nouvelle compétence.\r\nJe serai vraiment ravi de faire partie de l\'équipe pour approfondir mes savoirs-faire en la matière et commencer une nouvelle aventure.','Durant cette formation, j\'aimerais devenir un spécialiste des langages de programmation, de chaque langage de programmation. Ces langages sont à la base de tout projet Web ou Web mobile. J\'aimerais maitrisé les langages (Html et css, Mysql, PHP, développement Java, …) mais aussi les solutions techniques qui constituent les prérequis incontournables.\r\nJe reconnais que cette maîtrise des langages n’est pas suffisante, car les programmeurs ou développeurs doivent aussi être en mesure d’analyser les besoins. Cette analyse des besoins (besoins du client ou de l’utilisateur) conduit à aligner les lignes de code, afin de garantir à l’application informatique concernée d’être pleinement opérationnelle.\r\n J\'aimerais connaitre les nouveaux langages, être familier des CMS, appréhender les exigences du Responsive Design, qui ne doivent pas masquer l’absolue nécessité de connaitre tout l’écosystème digital. \r\nEn tant que développeur d’application, j’aimerais connaitre les attendus de la gestion de contenu, les objectifs et contraintes du graphiste ou du Webdesigner, les exigences du Webmaster, …\r\nEtant donné que le travail d’équipe caractérise le quotidien des concepteurs d’applications ou de sites Internet, je veux donc être à l’aise avec une organisation agile et aussi travailler en toute autonomie. \r\nSi la veille technologique doit être une habitude pour le développeur intégrateur, je veux aussi faire preuve d’une grande adaptabilité et d’une créativité sans limite.','Dans 3ans, je me vois diriger une grande nouvelle équipe pour l\'entreprise et dans le même temps faire partie des meilleurs codeurs les plus recherchés en Afrique. \r\nDans 5ans, je me vois devenir une source d\'inspiration à tout ceux qui doutent de se lancer dans un domaine donné. \r\nLe Codage est ma passion... Je m\'amuse déjà à créer des sites web avec Wordpress.','Coder et programmer consiste bien à traduire, dans les langages informatiques choisis, les objectifs du cahier des charges, impliquant nécessairement une grande adaptabilité.\r\nLe Codage représente une liberté pour moi!','Par un ami',NULL,NULL),(735,380,'50830969-b8ea-4bd6-929c-0d37db56156c','Bac+2','2021','Ucao','Droit','Étudiant','Intermédiaire','J\'aimerais suivre cette formation dans le but d\'acquérir des compétences dans le milieu de la programmation web, car vu l\'évolution de la technologie ce domaine est indispensable et offre beaucoup d\'opportunités','Mes attentes lors de cette formation est d\'être capable tout les contours du développement web et être capable de diriger un projet web , être concurrentiel sur le marché','Dans 3 ans je me vois finir ma formation et être entrain de faire mes preuves, en donnant mon savoir faire tout en me perfectionnant. Et dans 5ans je me vois créer ma propre boite dans le but d\'apporter des solutions à des personnes et entreprises nationales comme internationales.','Le métier de développeur codeur est métier pas facile car il nécessite beaucoup de concentration et avoir un esprit de créativité. Et pour y réussir il faut avoir de passion dans ce qu\'on fait','Par un ami',NULL,NULL),(736,381,'a90ad7fc-b5f1-4d5b-a6fb-554b558df4bf','Licence','2022','École Supérieure Sainte Félicité','Système Informatique et Logiciel','Sans activité professionnelle','Intermédiaire','En tant que diplômé récent, je recherche un poste qui me permette de continuer à apprendre et à perfectionner mes compétences tout en fournissant un travail de qualité, et m\'encourage à m\'épanouir en tant que Développeur Web, Maintenancier et Graphiste.','Devenir un meilleur Développeur Web plus que je le suis maintenant et pouvoir finir réaliser d\'autres projets qui me tiennent à cœur.','J\'espère et j\'aimerais bien devenir un très bon développeur avoir toujours cette motivation en moi et enfin avoir suffisamment de connaissance à transmettre aux futurs novices.','Je trouve ce travail très intéressant et fascinant.','Par un ami',NULL,NULL),(737,382,'bab53724-9846-4595-b4cd-f735083d5615','Bac','2022','UAC','Anglais','Étudiant','Intermédiaire','Afin d\'être compétent dans le domaine du développement web','Que cette formation me sert à faire du développement web un métier, être compétent .','Avoir mon entreprise de développement web, en faire un métier et donner des formations. Réussir ma vie professionnelle avec le métier de développeur web','Le métier de développeur web consiste à mettre au point un site, le développer. Il a rapport avec tout ce qui est numérique et favorise les business en ligne.','Internet',NULL,NULL),(738,383,'db107e68-056d-4b79-ac9f-033f528494bd','Bac+2','2022','UATM GASA Formation','Génie électrique option système industriel','Étudiant','Intermédiaire','Pour me perfectionner en programmation','J\'attends de cette formation beaucoup de connaissances en programmation et une maîtrise parfaite des langues de programmation les plus utilisés','Dans 3ans je me vois programmeuse qualifié','Je pense que le métier de codeur est un métier passionnant et probablement très générateur','Par un ami',NULL,NULL),(739,384,'e715786f-5c99-410d-8ff0-d393eb0ca250','Licence','2010','Institut cerco','Télécoms et réseaux informatiques','Salarié','Intermédiaire','Avoir la maitrise du code, pouvoir communiquer, donner des instructions à la machine car tu comprend son langage est une passion que j\'ai pas pu vivre encore pleinement pour diverses raisons,du coup cette opportunité je ne voudrais la rater sous aucun prétexte. C\'est l\'occasion pour moi de développer mes aptitudes, d\'en apprendre plus de faire des prouesses et ainsi vivre ma passion: le code','Maitriser les langages informatiques, le développement web, la conception d\'application, la gestion de projet informatique','Maîtriser la plupart des langages pour être un développeur complet et ainsi, avoir les capacités pour être un acteur majeur de projet de grandes envergures','Un métier très passionnant qui permet comme un architecte de donner forme à des outils solutions informatiques à plusieurs situations courantes. Un perpétuel challenge qui vous émule à charboner et vous surpasser pour un résultat impeccable.\r\nle pure bonheur..','Par un ami',NULL,NULL),(740,388,'e0051566-0045-442b-a441-1665992794c2','Bac+2','2020','Institut Conficius','Langue Chinoise','Sans activité professionnelle','Intermédiaire','Je voudrais suivre cette formation pour acquérir des compétences dans le numérique. Étant une passionnée, je voudrais m’outiller afin d’être capable de créer et de gérer une entreprise pour un essor brillant.J’aimerais étudier et  être l’une des meilleures développeur sur le plan national et international.','J’aimerais recevoir toutes les notions nécessaires à appliquer  pour donner de bons résultats et les aptitudes à avoir pour être un  développeur codeur de renom.','Dans 3 ans je me vois à la tête de mon entreprise où je mettrai mes compétences à disposition pour son succès et également former d’autres jeunes passionnés du numérique. Être en partenariat avec des entreprises leur apportant des solutions pour la croissance de leur structure. J’aimerais créer des applications qui contribueront au développement de mon pays sur le plan économique, éducatif, social, environnemental.','Je l’imagine comme un métier où l’on doit être créatif, inventif, curieux, chercheur , innovant.','Par un ami',NULL,NULL),(741,390,'847