),(748,397,'c4364749-0f9f-48e2-afca-8d616ecd253c','Bac+2','2022','Université d\'Abomey-calavi','Internet et multimedia','Étudiant','Intermédiaire','Je veux suivre cette formation pour approfondir mes connaissances dans le developpement Web. Cette formation me permettra aussi de rencontrer de nouvelles personnes aussi jeune que moi et qui ont une grande passion pour le digitale. \r\nAussi, je veux etre un acteur important dans la digitalisation qui se fait au Bénin et en Afrique dans les prochaines années.','Je m\'attends à plus de pratique et être enseigner par les meilleurs enseignant developpeurs qui gèrent des projets d\'envergure majeure pour les grandes entreprises.','Dans 3 ans, je me vois depasser le niveau de developpeur web intermédiaire que j\'ai actuellement et être un developpeur senior dans 5 ans avec a son actif plein de projets bien implementés et deployés.','C\'est un metier passionnant où je serai amener a travailler avec une équipe dans lequel il y aura surement des designers, des chefs de projets, des developpeurs codeurs fullstack, front-end et back-end.','Internet',NULL,NULL),(749,398,'f3f1de63-4353-42ff-bddf-58574954d38d','Bac+2','2021','VED UAC','Électronique Automobile','Entrepreneur','Débutant','j\'aimerais suivre cette formation car j\'adore le numérique et j\'entreprends là dedans et je pense que cette formation peut etre un plus pour moi pour être plus recherchés sur le marché','J\'aimerais que grâce a cette formation je puisse devenir un développeur professionnels et accompagner toute les entreprises qui seront en recherche de mon profil','Dans 5 ans je me vois faire partir des meilleurs developpeur professionnels au monde parce que je veux travailler très dure.','C\'est un metier passionnant surtout que jai deja ma petite expérience dans le domaine.','Par un ami',NULL,NULL),(750,399,'2816d0ee-5117-4b8b-bc17-863d75966c73','Licence','2017','Abomey-calavi','Espagnole','Sans activité professionnelle','Intermédiaire','Je veux cette formation