r je veux apprendre le codage et devenir un développer.','Nom attentes pas rapport à cette formation est de sortir avec de  compétences nécessaires et devenir un développeur codeur professionnel.','Avoir déjà terminer la formation et être entrain de piloté de grand projets.','un développeur codeur doit être quelqu\'un qui est en formation continuelle et apprends  tout les jours car c\'est une actualisation de ces connaissances à chaque instant.','Par un ami',NULL,NULL),(757,407,'f324ddb9-dfc1-402f-9e4a-d65359102b5b','Licence','2022','VED-Uac','Ecotourisme','Sans activité professionnelle','Débutant','Afin d\'acquerir les connaissances dans ce domaine et de le mettre a profit dans ma vie professionel','Les competences et un emploie','J\'espere avoir un emploie stable et pouvoir servir','Dans un monde en pleine evolution technologique il s\'avere neccessaire  de maitriser les regles du codage','Par un ami',NULL,NULL),(758,408,'0ac8b3ff-4846-4845-a02c-a7fcd19eb743','Licence','2022','École Supérieure de Génie Civil Verechaguine AK','Licence Professionnelle en Génie Civil','Sans activité professionnelle','Intermédiaire','Étant donné déjà que j’ai une licence professionnelle je veux d’abord faire cette formation pour diversifier mon savoir, obtenir un nouveau diplôme et élargir mon domaine d’action dans le monde professionnel','Répondre à une exigence professionnelle, renforcer med propres capacités, apprendre de l\'expérience collective','Je serai déjà ingénieur et je serai entrain de travailler sur projet tout en préparant un autre master ou le doctorat','Développer des codes pour le fonctionnement des logiciels application et autres. Faciliter l’utilisation de l’outil informatique','Internet',NULL,NULL),(759,409,'37c64193-83ad-4a92-95c6-124849b03555','Licence','2019','UATM Gasa Formation','Licence Génie Électrique Option Réseaux Informatique et Télécoms','Salarié','Intermédiaire','Je voudrais enrichir mes connaissances et acquérir des compétences aiguës en matière de dé