e vois programmeur dans une grande entreprise','Toujours à l\'affut de nouvelle technologie','Par un ami',NULL,NULL),(763,413,'342a9f00-2e0f-497e-ae0c-6dca8ece4d87','Licence','2022','Université d\'Abomey-Calavi','Hydrologie quantitative','Sans activité professionnelle','Intermédiaire','Je suis un passionné de la technologie plus précisément de l\'intelligence artificielle. J\'ai l\'intime conviction que cette décennie s\'achèvera avec de grandes avancées dans le secteur. Mon but à moi est d\'apporter une contribution à ce développement tout en vivant de cette passion. Suivre cette formation est l\'opportunité pour moi de développer les compétences nécessaires à mon objectif.','J\'attends de cette formation qu\'elle me permette d\'affiner mes compétences de développeur et surtout de m\'en apprendre plus sur les secteurs du Big Data, du Cloud et de l\'intelligence artificielle.','Dans 5 ans, j\'espère devenir un développeur autonome avec une contribution notable au secteur de l\'eau en République du Bénin et ailleurs en ce qui concerne l\'automatisation des systèmes d\'alerte précoce aux inondations et bien d\'autres...','Pas de tout repos comme métier cependant permet de vivre de sa passion.','Par un ami',NULL,NULL),(764,414,'a6a57917-6bce-4152-8d7c-9aa0a926139c','Bac+2','2020','ESGIS','Informatique, Réseau et Télécommunications','Étudiant','Intermédiaire','Je suis un jeune étudiant en informatique et passionné par la programmation. N\'étant pas satisfait de l\'apprentissage que j\'ai eu, j\'ai décidé de me tourner vers vous en vu d\'acquérir de meilleurs connaissance et par la même occasion m\'introduire dans le monde du travail et connaître ses réalités.','J\'attends de cette formation qu\'elle m\'apporte beaucoup de connaissances en programmation qu\'elle m\'aide à pouvoir résoudre différentes types de problème liés à mon domaine. Aussi qu\'elle m\'aide à me préparer à affronter le monde professionnel. J\'attends en tirer beaucoup de cette formation sur tous les plans que ce soit sur le plan professionnel que sur le plan du développement personnel. Qu\'elle m\'aide à maîtriser le savoir vivre et le savoir faire en entreprise.','Dans 3 ans , 5 ans , je me vois à un niveau avancé en programmation, je me vois étant un bon développeur codeur capable de réaliser beaucoup de projets et de répondre à des problématiques grâce à ma petite expérience acquise auprès de vous. Je me vois également déjà intégré dans le monde professionnel avec un travail stable et épanouissant qui m\'aide à libérer mon potentiel et qui m\'aide dans l\'accomplissement de mes projets d\'avenir.','C\'est un métier passionnant qui fait appel à notre capacité à résoudre des problèmes en informatique sur la base différentes langages de programmation appris. C\'est un métier où il faut une grande concentration afin d\'écrire un bon programme. C\'est un métier où chacun a une approche différente pour résoudre un problème posé. C\'est un métier où il faut avoir une patience et souvent se remettre en question.','Par un ami',NULL,NULL),(765,415,'61746386-f769-43d7-851f-f30185ed1319','Bac+2','2020','ESGIS','Informatique Réseau Télécommunications','Étudiant','Intermédiaire','Je suis un jeune étudiant  en informatique assoiffé de connaissance qui veut acquérir par votre formation  des connaissances professionnelles en développement  me permettant d’entrer dans la vie active .','Je voudrais qu’au terme de votre formation je puisse avoir des acquis intellectuels en développement et codage me permettant de pouvoir exercer pleinement le métier qui me passionne  .','Je me vois comme un jeune développeur qui grâce à votre formation a acquis des connaissances lui permettant d’exercer son métier pleinement et avec épanouissement dans le but de réaliser ses ambitions .','Le métier de développeur codeur est un métier passionnant en ce sens que l’on apprend qu’en s’exerçant au jour le jour et on ne finit jamais d’apprendre . C’est un métier qui affine notre sens de la réflexion nous permettant ainsi d’avoir une vision différente des problèmes de la société .','Par un ami',NULL,NULL),(766,416,'89a1be43-0c66-42a6-ae84-383b3c493a17','Bac','2018','ism adonai','baccalauréat','Sans activité professionnelle','Débutant','J\'ai eu le bac depuis l\'année 2018, j\'ai commencé la première année à ism adonai de porto novo,  mais j\'ai pas puis terminé à cause des raisons personnelles.','C\'est d\'être une bonne personne à votre égard et être dynamique au travail.','C\'est d\'avoir  une bonne expérience et être sserviable dans le domaine','C\'est uen mise au point d\'application d\'informatique pour une entreprise selon les besoins fonctionnela.','Internet',NULL,NULL),(767,417,'9c251b3a-da19-4088-8b5d-301a7a5a852d','Licence','2019','UATM Gasa Formation','Banque, Finance et Assurance','Entrepreneur','Intermédiaire','Pour avoir des compétences en codage et développement en plus de ceux que je possède déjà dans l\'utilisation du CMS wordpress','Pouvoir devenir un développeur d\'élite afin d\'augmenter ma valeur marchande.','Dans 3 ans, je pense que mon entreprise, la Easy iD Agency, sera le leader béninois en termes de création de solution digital B2B et B2C','Je me dis que cela doit être à peu près similaire au métier de développeur wordpress freelance que je mène actuellement. Apprendre (Se tenir à jour) et s\'améliorer chaque jour, trouver des projets intéressants, dépasser les objectifs et attentes des clients, remplir son portfolio et augmenter sa valeur marchande.','Par un ami',NULL,NULL),(768,418,'aa904f63-f9a7-4131-976e-7b306f5909ed','Bac+1','2020','Université d\'Abomey Calavi','BELLO','Sans activité professionnelle','Intermédiaire','J\'aimerais suivre cette formation afin de m\'y connaître en matière de codage','En ressortir ressourcé et bien plus apte à travailler dans le domaine','D\'ici 3 ans j\'espère bien être l\'un des meilleurs développeurs codeurs du Bénin','Pour moi, le métier de développeur codeur prône sur le savoir-faire informatique dans le domaine du codage logistique','Par un ami',NULL,NULL),(769,419,'711d7ab6-f3de-4120-9d9d-e61e8298b67e','Bac+2','2023','Abomey calavi','Droit','Étudiant','Débutant','Pour m\'offrir de nouvelle chance en matière d\'apprentissage et d\'orientation professionnelle.','Maîtriser les langages de programmation pour accompagner les entreprises dans leur processus de digitalisation. Tout en mettant à contribution mon expertise en matière de droit appliqué au numérique.','Être incontournable en matière de programmation informatique et de droit.','Le métier de développeur est une passion et un moyen de simplifier la vie et le travail au quotidien.','Internet',NULL,NULL),(770,420,'44438d8f-4ad4-4ba4-a579-7c9e0f09db61','Bac+2','2018','ESGIS','DT/IMI','Salarié','Bilingue','Bonsoir Mr/Mme,\r\nJ\'aimerais suivre cette formation afin de pouvoir me perfectionner dans mon domaine pour pouvoir assurer davantage mon avenir et aussi.','Donnez le meilleur de moi-même pour acquérir les notions pour être une référence dans mon domaine.','Etre une référence dans le domaine du développeur codeur','C\'est le métier de l\'avenir','Par un ami',NULL,NULL),(771,421,'cde756a4-821b-4cba-97ab-07d87089c5ae','Bac+2','2023','ESGIS','Sécurité Informatique','Étudiant','Débutant','Pour avoir l’opportunité d’apprendre de nouvelles choses','Beaucoup de pratiques','Grand développeur \r\nAvec plusieurs projets de réalisation en développement','Passionnant ,et très intéressant pour moi','Par un ami',NULL,NULL),(772,422,'6ed2e49a-b297-4373-9344-65f624127a9c','Bac+2','2022','Nexus international','BBAM in Project management','Étudiant','Bilingue','Cette formation m’intéresse tout d’abord parceque le domaine du digital et de l’informatique m’a toujours intéressé et ce depuis l’enfance et je pense que c’est Aujourd’hui pour moi une opportunité de pouvoir m’éduquer dans ce domaine qui ne cesse de se développer','J’aimerai acquérir des compétences dignes d’un bon développeur afin de pouvoir travailler à l’international et éventuellement bien plus tard après avoir acquise assez d’expérience dans le domaine , monter ma propose boîte.','Dans 3 ans je m’imagine travailler pour une grande boîte internationale après avoir terminé ma formation à high-five university cotonou','De façon fantaisiste…pour moi un développeur codeur est une sorte de “magicien” qui avec ses formules magiques  ( le codage) arrive à créer quelque chose d’extraordinaire \r\nDe façon un peu plus terre à terre un codeur est un professionnel qui assure la conception des programmes informatiques ainsi que le suivi régulier après lancement, de la maintenance à l\'évolution et l\'amélioration du logiciel , c’est un métier qui nécessite de bonne capacité d’analyse et de la rigueur','Internet',NULL,NULL),(773,423,'aa5451dd-d73c-49b8-9cd9-42729531bb63','Bac','2012','uac','graphisme','Entrepreneur','Intermédiaire','Cette formation est ce que je recherche depuis bientôt deux ans , je suis au faites graphiste et photographe professionnel, je suis aussi community manager , Je pense que cette formation me rendra complète car j\'aime trop tout ce qui a rapport avec l\'informatique ou le digital et autre','Je voudrais avoir des expérience avancé et aussi comprendre mieux certaines choses car j\'ai suivi beaucoup de tutto sur le metier de développeur , je me suis même amuser a créer un site web sur wix mais j\'ai jugé cela amateur car je dois me contenter des option des sites mais je voudrais être dans la capacité de réaliser mes propre techniques et boutons d\'action.','Je suis un grand passionné de cette formation que vous proposer , je suis prêt a me donner corps et âme et je sais que beaucoup de sacrifice m\'attendent pour y arriver mais je suis habitué a cela car je n\'ais jamais fait une formation professionnelle , tout ce que je sais fait je l\'ai appris par des tuttos donc je suis préparé','Un développeur codeur est celui la qui a la capacité de répondre exactement aux exigences d\'un client ou d\'une entreprise pour un site web ou une application. J\'adore rester devant mon ordinateur a plein temps , c\'est comme cela que j\'imagine un développeur','Par un ami',NULL,NULL),(774,424,'3a5c51e0-3592-44bc-9911-afe52fd9c2a4','Licence','2005','Institut Universitaire de Technologie (IUT) - Université de Parakou','Analyste Programmeur','Salarié','Intermédiaire','Cette formation m\'intéresse parce que je suis passionnée par les métiers de l\'informatique en particulier la programmation web et également parce que je suis en quête de nouveaux challenges professionnels.','Mes attentes par rapport à cette formation se déclinent comme suit : \r\n1- Disposer en fin de formation des outils et compétences nécessaires pour être opérationnelle et compétitive ;\r\n2- Faire partie d\'un réseau de partage de compétences ;\r\n3- Pouvoir bénéficier d\'opportunités d\'insertion professionnelle ou d\'affaires.','Je me projette d\'ici 3 ans comme Responsable de plusieurs projets de développement web, tout en continuant à développer mes connaissances, et également à moyen terme comme Personne ressource pouvant mettre mes compétences au service d\'autres personnes désirant suivre le même parcours.','Le métier de développeur codeur me parait passionnant, comportant assez de défis et également très occupant.','Internet',NULL,NULL),(775,425,'001d32e1-b0b3-4b2f-be70-fbdeb06651d5','Bac+2','2021','Université d\'Abomey Calavi','Physique chimie','Étudiant','Débutant','C\'est ma passion','Avoir une compétence professionnelle','Un grand homme en outils informatiques et numérique','Bon métier prometteur dans l\'avenir','Internet',NULL,NULL),(776,426,'8892ad3b-20c9-4e77-b930-5e244af7559a','Licence','2022','ESGIS BENIN','Architecture des Logiciels','Sans activité professionnelle','Courant','J\'aimerais vraiment être un qualifié, un recommandé et un internation dans le métier de l\'architecture des logiciels','Que je sois purement technique à la fin de ma formation. Que je sois capable de créer et de faire fonctionner des sites internet et des applications mobiles','Comme étant administrateur de bases de données relationnelles et développeur des sites internet et des applications mobiles','J\'en connais déjà beaucoup. Ça demande beaucoup de concentration, d\'exercice et de recherche','Par un ami',NULL,NULL),(777,427,'06a1af42-b6a1-4222-ab30-93b234e6dd47','Bac+1','2022','Abomey Calavi','Baccalauréat série D','Entrepreneur','Débutant','Je souhaite suivre cette formation d’une part parce que je suis intéressé par tous ce qui est en rapport avec d’un codage et d’autre part pour être plus compétitif sur le marché de l’emploi.','Mes attentes par rapport à cette formation est de développer de solide connaissance en codage en vue d’y faire carrière.','Dans 3 à 5 ans, si je suis retenu pour cette formation je me vois déjà faire carrière comme développeur codeur. En outre je serai contraint de continuer mon parcours entrepreneurial.','Le développeur codeur conçoit, développe et met au point des projets d\'application informatique, de la phase d\'étude à son intégration, pour un client ou une entreprise selon des besoins fonctionnels. Il peut conduire des projets de développement, et à coordonner une équipe.','Presse',NULL,NULL),(778,428,'6fec85b8-86f9-4ffa-8679-bd9981883dd7','Bac+1','2017','CFC Université de Lomé','Comptabilité et Gestion des Entreprises','Entrepreneur','Intermédiaire','Ayant travaille comme gérant de cyber et technicien réseau à Genitek informatique, j\'aimerais approfondir mes connaissances dans le domaine informatique.','Je veux obtenir les compétences nécessaires au près de vous pour être à la pointe de la technologie informatique.Des compétences qui vont me permettre de contribuer au développement d\'une entreprise qui veut de moi ou de créer ma propre entreprise','Dans 3 ans j\'aimerais contribuer aux développements technologiques d\'une entreprise et dans 5 ans j\'aimerais créer et développer des nouveaux codes .','Le métier de développeur codeur est semblable au métier d\'un ouvrier qui travaille en arrière plan afin que les programmes  marchent de façon automatique','Internet',NULL,NULL),(779,429,'822b4a1c-e832-488d-88c1-0a68c7a6773e','Bac+2','2020','UAC','PHYSIQUE CHIMIE','Sans activité professionnelle','Intermédiaire','Je m\'appelle Marcel Fagbohoun, j\'ai 23 ans,  après l\'obtention de mon Bac en 2018, mon rêve de devenir un grand ingénieur en logiciel est brisé parce-que j\'avais pas les moyens pour payer ma formation en dans une école informatique. Puis je me suis inscris en physique chimie à la fac ou je passe en deuxième année, mais c\'était pas mon rêve.\r\nEn deuxième j\'ai connue une école (institut Cerco ) que j\'ai intégré grâce à mon au test puis j\'ai obtenu une bourse. Mais malheureusement en 2019 l\'avènement du Covid 19 ne nous a pas permis de terminé l\'année, mais j\'étais très heureux du fait que j\'avais tout les cours d\'initiation et je continue d\'apprendre en autodidacte jusqu\'a présent dans le but qu\'un jour je vais trouver une université comme le Hugh five university\r\nJ\'obtiens des admission pour des formation en développement web dans institut et école mais je n\'avais des moyens pour payer le peu d\'argent nécessaire.\r\nTout ce que je veux, c\'est devenir un grand développeur.','Mes attentes de cette formation est d\'acquérir les compétences solide, faire des projets d\'entreprise, car ça me reste beaucoup dans la réalisation des projets professionnels.\r\nEn gros, je veux être un expert en full-stack','Avoir mon start-up en conception des solution numérique, partager et former des jeunes en développement web.\r\nTravailler dans des grande entreprises','Le métier du développeur est d\'abord un métier  qui nous permet de faire challenge, c\'est un métier de patience et de persévérance, c\'est un métier qui permet de dépasser ces limites , un grand métier de partage  et qui permet de faire de la veille technologique !\r\nC\'est cool','Internet',NULL,NULL),(780,430,'9b12154b-5ad3-4730-b685-03f3bad1b817','Bac+2','2022','Université d’ABOMEY-CALAVI','Philosophie','Étudiant','Intermédiaire','Les métiers du digital sont depuis longtemps au cœur du développement de tous les secteurs d’activités.\r\nMoi, suivre cette formation est une opportunité de concilier l’utile à l’agréable en m’outillant dans un domaine qui me passionne énormément et qui du point de vue social est un réel facilitateur de la vie des populations. Elle favorise la mise en place de plateformes permettant aux personnes d’avoir accès plus facilement à des services de qualité, des informations, des solutions etc tous ceci en gagnant du temps.\r\n\r\nRamenant cela aux réalités de notre pays le Benin, Le programme d’action du gouvernement pour les deux quinquennats et les stratégies de développement nationales, mettent le digital sur un piédestal comme jamais auparavant. En démontre par exemple la digitalisation des services publics. \r\nC’est donc une opportunité pour moi de prendre une part active dans cette nouvelle dynamique de notre ère en me perfectionnant dans le métier du codage et de la programmation.','D’un point de vue académique, j’aimerais :\r\n\r\n- maitriser davantage et me perfectionner dans les techniques essentielles du codage et de la programmation tels les htlm5 , CSS , java , python ou tout autre langage de balisage .\r\n\r\n- être en mesure de créer ou développer des logiciels, des applications, des sites webs et autres sur la base des nouvelles technologies\r\n\r\n- Etre un vrai technicien du digital.\r\n\r\nD’un point de vue environnement de formation, j’espère une formation challengeantes qui me fera sortir de ma zone de confort avec énormement de défis pour révéler en moi de nouveaux potentiels.','Dans 3 à 5ans j’espère être déjà certifié et obtenir l’expérience nécessaire, même si un dicton le dit qu’on finit guère d’apprendre pour être en mesure de travailler avec les plus reconnus dans le domaine .','De ma perception et d’autan plus je dispose déjà de quelques connaissances dans la matière, je pense  c’est un métier de spécialiste de la programmation informatique qui fait développer à chacun sa faculté d’imagination au sens large . \r\nLe code écrit indiquera à l\'ordinateur de se comporter d\'une certaine manière ou d\'exécuter des actions souhaitées. Nous avons ainsi plusieurs categories de codeurs : Développeur front-end ; Développeur Back-End ; Développeur d\'applications mobiles.','Internet',NULL,NULL),(781,431,'9a3bc8e2-8c9e-4d6f-8b05-bd30dc3ed5cc','Licence','2020','Ecole Nationale d\'Administration','Diplomatie et Relations Internationales','Étudiant','Intermédiaire','Tout simplement parce qu’à ce stade de ma vie, c\'est l\'une des meilleures opportunités qu\'on puisse m\'offrir.\r\n Disons que depuis 3 mois j\'ai fait mes premiers pas dans ce vaste univers de la programmation. \r\nEt avoir le mérite de suivre cette formation, c\'est pouvoir me donner les outils, la connaissance, le networking pour me surpasser en cette année 2023.\r\nAvec l\'avènement des IA, je m\'étais donné pour objectif d\'apprendre Python pour créer des applications en me servant des API de ces différentes IA.\r\nUne fois de plus, je suis là pour apprendre, me surpasser et pour ne pas paraître bizarre, poursuivre mon rêve dans le domaine de la tech.','Mes attentes : au risque de paraître très exigeant, je pense que par rapport à la formation j\'ai envie de plus de pratiques, plus de défis, un truc à l\'instar de la série StartUp (Si vous êtes fans des séries c\'est un peu intéressant, ça parle de l\'entrepreneuriat et du code), où on est en plein casse-tête pour résoudre un problème, innover, améliorer avec le code. \r\nMais tout ceci, sans négliger le bien-être, la santé mentale, la paix du cœur, et l\'esprit de groupe, l\'harmonie. \r\nEn résumé, se bousculer pour accomplir des merveilles avec du fun.','Dans 3 ans, en toute franchise je me vois déjà capable de créer des sites web de ouf, e-commerce, plateforme de streaming,de transfert et échange de cryptos. Également, maîtriser assez de langages pour me dire presque expert dans mon domaine pour créer des applications ( par exemple une app capable de me rappeler que je dois envoyer un CC à mes proches après un long moment de silence ou l\'homme est très occupé). Après tout qui sommes-nous seuls sans nos proches !\r\n\r\nSi non dans 5 ans, je me vois monter ma propre agence de programmation. Être tellement bon pour travailler chez Apple, Google, Microsoft, etc. Mais gardez en moi l\'amour de la patrie pour revenir au bercail avec pour seule ambition de remodeler le système scolaire par la grâce de Dieu.','Dans mon imagination, je perçois ce métier comme l\'un des métiers les plus passionnants.\r\nOui, du fait que juste avec de la maîtrise de quelques langages informatiques et de la logique, l\'on peut révolutionner le monde.\r\nEn plus, je pense qu\'il est difficile de s\'ennuyer en tant que développeur codeur.\r\nC\'est un métier ou tu es en perpétuel apprentissage.\r\nC\'est-à-dire tu auras toujours une nouvelle connaissance à aller chercher. Ça ne s\'arrête presque jamais. \r\nEt même si avec l\'entrée fracassante des Intelligences artificielles dans le game, certaines personnes redoutent la disparition de ce métier, moi j\'aime juste répondre \"Alors Pourquoi ne pas se mettre à créer des IA ?\".\r\nPuisqu’après tout il faut du code pour mettre en place ces Intelligences Artificielles, sauf erreur de ma part.','Par un ami',NULL,NULL),(782,432,'a0409566-c979-45d9-b7f8-adb46b1e772d','Licence','2022','Institut universitaire Les cours Sonou','Système informatique et Logiciel','Entrepreneur','Intermédiaire','Malgré les cours reçu pendant le cursus universitaire, je n\'ai pas puis atteindre le niveaux de skills que j\'aurais voulu au niveau des langages de programmation. Cette formation va me permettre de m\'améliorer d\'atteindre le niveau nécessaire pour évoluer dans le monde digitales.','M\'améliorer et apprendre les langages de programmation.','Étant déjà désigner graphique avec l\'amélioration que cette formation m\'apportera dans la programmation je me vois travailler en tant que web désigner et développeur front-end web et mobile pour une grande entreprises de mon pays ou en indépendant.','Le métier de développeur est un métier d\'altruisme dans le sens où ont cherche à simplifier les tâches des entreprises et de la population pour une meilleure productivité.','Par un ami',NULL,NULL),(783,433,'e1f7a39e-678b-4425-ad93-2c27644dbe39','Bac+1','2022','UAC-FLLAC','Anglais','Étudiant','Intermédiaire','J’aimerais suivre cette formation car le domaine de développeur me passionne beaucoup; et aussi découvrir le monde de la digitalisation','Mes attentes par rapport à cette formation sont \r\nde bien maîtriser le codage afin de faire partir des meilleurs \r\nacquérir beaucoup de connaissances dans numérisation','Dans 3 ans je me vois comme un grand développeur en Afrique et enseigner mes compétences acquises à d’autres passionnés du codage.','Le métier de développeur codeur d’après mon imagination est un métier qui consiste à créer des sites web ou des applications pour les entreprises.  \r\nLe développeur codeur peut aussi concevoir des IA (intelligence artificielle).','Internet',NULL,NULL),(784,434,'a08c4c97-8f86-4be5-997d-77c9b9fd95dd','Bac+1','2016','UAC','CBG','Entrepreneur','Débutant','Aujourd’hui nous sommes à l’ère de l’information où le numérique a prit le dessus et cette formation  va me permettre de me mets  au point étant donné que j’avais déjà fais une formation dans ce sens.','Acquérir plus de notion que dans ma formation passée et d’être capable à tenir un projet du début jusqu’à la fin.','Dans 5ans, j’aurais des applications à l’échelle internationale. \r\nUne application sur le plan national sur la pharmacie permettant de connaître les pharmacie de garde, les produits à trouver à l’instant <<T>> et la distance entre la personne et la pharmacie correspondant à son besoin.','Pour c’est le métier du 21ème siècle qui permet d’améliorer ou d’apporter un de plus à ce qui existe déjà permettant la digitalisation des entreprises.','Par un ami',NULL,NULL),(785,435,'43ff81d6-2d0f-43fb-b5b2-a2bbe75a2e8b','Licence','2019','Abomey calavi','Agroecomie','Sans activité professionnelle','Intermédiaire','Je suis très passionné par les métiers du numérique','Apprendre le maximum qui fera de moi un expert','Je souhaite ajouter des expertises comme la data science cette compétence de développeur codeur','Trouver des solutions a des problèmes','Internet',NULL,NULL),(786,436,'3b0f3dd6-961e-46bd-88ef-bf94b93b1702','Licence','2022','UCAO','Électronique','Étudiant','Intermédiaire','La clé du succès à mon humble avis est de développer des compétences dans plusieurs domaines de la vie et une fois que l’on juge bon qu’on a acquis assez de compétence , on les monétise par la suite . L’électronique et l’informatique vont de paire et elles sont de plus en plus présente dans beaucoup de secteurs . L’électronique assemble , l’informatique a travers les différentes instructions fait fonctionner l’ensemble de ce qui a été assemblée .','Acquérir encore plus de compétences et rencontrer des personnes avec des mindset de qualité , autrement dit des personnes avec qui j’apprendrais plus découvrir d’autres choses et vice versa','Cette formation me permettra certainement de déboucher sur pleins d’autres choses , de rencontrer beaucoup de personne et j’en passe . Je le découvrirais d’ici les 3 voir 5 années . Je reste optimiste .','Sans limite \r\nPlus le monde évolue plus l’on découvre des choses . On est constamment entrain d’en apprendre tout les jours','Par un ami',NULL,NULL),(787,437,'be65282c-4e66-4f33-9f35-23b5bab9f0bd','Licence','2021','Université de Parakou','Droit','Sans activité professionnelle','Débutant','Je souhaite suivre cette formation, parce que cela m\'a toujours intéressé pouvoir réaliser une passion pour les logistiques.','Mes attentes sont telles que je dois être en mesure de comprendre chaque fonctionnement d\'une ligne de code ne serait-ce qu\'il y ait rapport avec un outil informatique. Je souhaite avoir la parfaite connaissance du sujet de développement Web et tout autre programme qui lui sont liés.','D\'ici 5ans je me vois capable de faire des travaux, des projets bien faits et qui répondent parfaitement aux besoins demandés. Je me vois en mesure de dire avec fierté que j\'ai la maîtrise d\'un métier qui me passionne et qui est un métier d\'avenir.','J\'imagine que cela doit être à la fois passionnant mais complexe, et j\'aime avoir le goût d\'un objectif à atteindre afin de mieux comprendre et pouvoir évoluer personnellement.','Internet',NULL,NULL),(788,438,'5c3a8485-7ef8-44d1-a81b-93172816ba83','Licence','2017','Université Polytechnique Internationale Obiang nguema Mbasogo','Banque finance Assurance','Entrepreneur','Courant','Je crois que cette formation me permettra d\'avoir ce qu\'il me faut. Parcque que jetais déterminé intérieurement à être un Vrai développeur Web.','Être un développeur Web et pouvoir vraiment manier les nouveaux métiers.','J\'enseigne maintenant aux nouveaux développeurs Web. Bien sûre après avoir eu plein d preuves de succès.','Ce serait un peu compliqué, mais antérieurement j\'avais ma propre détermination de l\'être. Du coup, il ne s\'agira que d\'affronter.','Par un ami',NULL,NULL),(789,439,'10fe586a-da2e-49ca-bff2-e20ecc4e3d7c','Licence','2019','Les Cours  Sonou','Journalisme','Entrepreneur','Intermédiaire','Mon intérêt pour cette formation vient du fait de ma passion pour tout ce qui à rapport au numérique et au digital. Également ce sont l\'un des tous nouveaux atouts dont se servent les métiers de l\'information et de la communication pour s\'ouvrir au monde.','Resortir de cette formation avec une toute autre façon de voir les choses et devenir un as du digital','Être l\'un des meilleurs développeur codeur au Bénin et en Afrique.','Un développeur codeur est un programmeur  web. C\'est lui qui créé le langage informatique.','Par un ami',NULL,NULL),(790,440,'78aa831a-7691-409d-afeb-f66b5769056b','Master','2022','FSA/UAC','Génie Rural et Maitrise de l\'Eau','Sans activité professionnelle','Intermédiaire','Cette formation me permettra de m\'outiller, en matière de compétences techniques en programmation informatique pour contribuer à résoudre les problèmes sociaux.','Acquérir les connaissances en intelligence artificielle,  programmation objets orientés.','Avoir la plus grande entreprise d\'intelligence artificielle appliquée à l\'agriculture. \r\nÊtre compté parmi les pionniers de la Révolution TIC engagée par HIGHFIVE.','Passionant et concret.','Internet',NULL,NULL),(791,441,'549d2bce-5481-4b0f-a328-15d982810a41','Licence','2021','Université d\'Abomey-Calavi','Technicienne en production végétale','Sans activité professionnelle','Intermédiaire','De nos jours le numérique s\'implante dans tous les secteurs d\'activités et améliore les services qu\'ils offrent. Je suis agronome de formation et boursière de la formation TITA de la fondation MTN. C\'est une formation dans le numérique. Au cours de cette formation j\'ai découvert mon talent numérique. J\'ai découvert que j\'ai les aptitudes pour être développeur et codeur. Je voudrais acquérir les compétences nécessaires pour exercer ce métier et le combiné à l\'agronomie.','Mes attentes pour cette formation c\'est d\'avoir les compétences suffisantes qu\'il faut pour être autonome avec ce métier et pouvoir utiliser les outils de ce métier dans le secteur de l\'agronomie.','Dans 5ans je me vois comme celle qui a révolutionné le monde agronomique avec les outils du numérique au Bénin. Dans 5 ans je me vois comme celle qui a créé le plus grand réseau des acteurs intervenants dans le domaine de l\'agronomie.','Le métier du développeur et codeur est ce métier qui cré et héberge des sites web. Le métier de développeur et codeur est un métier qui peut se faire en freelance, en télétravail ou encore en présentiel. C\'est un métier qui est d\'actualité et permet d\'accéder à l\'autonomisation de celui qui l\'exerce.','Par un ami',NULL,NULL),(792,442,'07b8a68f-ce64-41c7-abb6-ffc324ddb64b','Bac+1','2018','UPI ONM','Génie électronique et Informatique Industrielle','Sans activité professionnelle','Débutant','Je désire suivre cette formation parce qu\'étant déja un fin passionné du digital, j\'ai toujours aspiré au métier de développeur, codeur et de réaliser des applications tant web que mobiles, des projets à l\'échelle internationale pour résoudre des problèmes de la vie par le numérique','Devenir un développeur compétent\r\nAvoir une carrière professionnelle dans le développement informatique','Dans 3 ans je me vois comme un grand développeur très compétent et qui déja travaille dans une entreprise, qui a développé beaucoup de projets, de plateformes en ligne (produits, services, outils)','C\'est un métier où l\'on code beaucoup dans son ordinateur, qui demande beaucoup de logique, à apprendre de nouvelles choses de jour en jour; C\'est un métier où l\'on collabore beaucoup avec d\'autres et où il n\'y pas de tabou. Le développeur aime participer à la société en créant des plateformes, produits services pour répondre à un besoin de la société. C\'est très bon','Internet',NULL,NULL),(793,443,'6f208570-466b-4103-b341-525f9785fdc4','Bac','2021','Dyanath ahouefa','Baccalauréat','Étudiant','Intermédiaire','J\'ai choisi cette formation pour mieux apprendre','Dans cette formation je m\'attends à plus de pratique que de théorie c\'est a dire qu\'on aille droit au but','Dans 5ans je projete créé un gadget qui peut évalué le rythme cardiaque et alerté la police en cas quand tu es en danger','Le métier de développeur codeur facilite participe au développement aide beaucoup de gens et facilite la vie','Internet',NULL,NULL),(794,444,'d6b7f7bf-cb31-45b2-957b-27823878f5c2','Licence','2022','LES COURS SONOU','Informatique','Sans activité professionnelle','Débutant','Je veux suivre cette formation afin de rester efficient 