éveloppeur accompli, qui n\'aura rien à envier à ceux qui ont fait des écoles et ont eu une licence en informatique.\r\n\r\nJ\'aimerais avoir suffisamment de bagage intellectuel pour nourrir ma créativité et oser l\'innovation.','Je serai un développeur aguerri, qui aura déjà travaillé sur plusieurs projets innovants et qui en voudra encore.\r\n\r\nTout simplement, un développeur accompli à la recherche de nouveaux challenge et toujours dans l\'innovation.','Un métier passionnant qui fait appel à la créativité et à une persévérance à toute épreuve.\r\nUn métier où il faut faire preuve de discipline et de minutie car une seule erreur dans une ligne de code peut affecter tout le travail.\r\nUn métier assez chronophage, qui peut parfois amener à l\'épuisement mais je pense qu\'avec une passion bien nourrie, on se concentre plus sur la satisfaction au bout de l\'effort, que sur les difficultés.','Internet',NULL,NULL),(796,446,'a4c90a49-18a6-4ec1-872d-0f38415fd754','Bac+1','2021','Esgis','Informatique','Étudiant','Intermédiaire','Je veux suivre cette formation car j\'ai un amour pour l\'informatique et puis je me suis amusé avec pendant mon cursus scolaire maintenant je veux me mettre au sérieux','Maitriser Javascript Css et d\'autres','Je veux créer des sites qui vont me permettre de gagner de l\'argent en ligne','C\'est un métier de l\'avenir','Par un ami',NULL,NULL),(797,447,'378e937d-8c08-41e0-832e-394e8135b22f','Bac+2','2022','Esgis','Baccalauréat','Étudiant','Débutant','Je veux suivre la formation pour avoir plus de connaissances dans le domaine de développement web','Me perfectionner ,avoir de nouvelles connaissances dans le domaine et aussi après la formation être à un niveau plus élevé que mon niveau de  base','Je me vois vivre et travailler au Bénin','Pour moi c’est un métier de l’avenir et qui ce pratique pour la plupart avec un ordinateur','Par un ami',NULL,NULL),(798,448,'ce3e80b2-3096-47fb-91c9-da08eca699e0','Licence','2022','Université d’Abomey-calavi','Am