0775f8-0e8e-4ebb-a677-8ea728a54e35','Étudiant','2021','Institut Supérieur de l\'Afrique de l\'ouest','Système d\'information et Logiciel','Étudiant','Intermédiaire','Je veux suivre cette formation pour améliorer mon niveau en informatique.','J\'attends à la fin de cette formation être plus meilleur qu\'au début de la formation.','Je me projette comme étant la meilleure dans mon domaine au Bénin et pourquoi pas en Afrique.','Je l\'imagine comme ma vocation, et ma passion pour ce métier me pousse à dire que chaque développeur codeur doit disposer d\'un esprit d\'équipe, de logique et d\'amour pour son métier.','Par un ami',NULL,NULL),(802,331,'558a3602-f3aa-4dd7-9bd3-2f1045298cb2','Étudiant','2017','West African union university','Informatique de gestion','Salarié','Débutant','Cette formation me permettra de mettre à jour mes connaissances en informatique de gestion. Car j\'ai des compétences en programmation langage C++ et Visual Basic, en établissement de base de données, et en création de sites Web (HTML, CSS). Je suis également passionné par l\'informatique de gestion.','J\'aimerais approfondir mes connaissances en matière de programmation et autre connaissance connexe lié à l\'informatique.','Dans 5 ans, j\'aurai déjà une bonne connaissance dans le domaine, je pourrai travailler sur plusieurs projets à la fois','Un développeur codeur est sollicité par les entreprises qui veulent avoir leurs propres systèmes d\'exploitation et logiciels en interne, ils sont donc appelés à imaginer, créer, réaliser, écrire, tester et documenter des sites internet, des applications ou des logiciels','Par un ami',NULL,NULL),(803,333,'23d6ea83-1744-44b0-b065-2c169980a915','License','2014','Université d\'Abomey Calavi','Statistique-Econométrie','Salarié','Débutant','Ma formation universitaire a été totalement presque théorique ce qui est à l\'opposé du monde de l\'emploi où il est plus recherché celui qui connait et qui pratique. Donc après mes études cela a été difficile pour moi de trouver de l\'emploi dans mon domaine de formation pour cause manque de pratique de logiciels statistiques . Dès lors je recherche une formation pour compléter mes compétences afin d\'être désormais opérationnel et professionnel pour les tâches qui me seront confiés et dans les projets que j\'embrasserai moi même dans mon entreprise.','Cette formation est une opportunité en or pour moi , en plus de me donner désormais une compétences pratique, opérationnelle et professionnalisante, je peux aussi être créateur et inventeur avec ma curiosité. Alors je me vois à la fin de cette formation créer un site pour une base de données pour la formation et profession au Bénin.','Dans 3ans, soit un an de pratique et professionnel en tant que développeur codeur après ma formation je me vois déjà chef projet d\'une société de gestion site web ou responsable technique d\'une base de données a grande échelle. Et dans 5 ans entrepreneur et responsable d\'un cabinet  stratégie de développement informatique et gestion de bases de données.','Selon moi c\'est celui ou celle qui met en place tout dans le back end pour un produit numérique ou automate grâce à un langage de programmation.','Par un ami',NULL,NULL),(804,334,'4752da3d-233d-4400-9a15-40bda59af847','Master','2012','UAC','Rock Koty','Étudiant','Courant','Pour changer de branche, pour la passion de créer de nouvelles choses.','Devenir un développeur codeur','Comme un développeur codeur hors pair','Comme un métier ou la programmation, le développement de logiciels n\'a aucun secret.','Internet',NULL,NULL),(805,336,'131bda52-12bb-40d7-88f7-425cbf8477d4','Étudiant','2022','Institut universitaire les cours sonou','Système informatique et logiciel','Étudiant','Intermédiaire','Je voudrais suivre cette formation pour approfondir et acquérir des connaissances dans les technologies informatiques afin d\'être un très bon développeur et d\'avoir un bagage intellectuel informatique bien rempli','-Etre dans de bonnes conditions d\'apprentissage\r\n-Avoir beaucoup de temps pratiques\r\n-Et des enseignements de qualité','Ah je serai un très grand développeur informatique, avec un vrai bagage dense , Peut être serai dans une entreprise spécialisée informatique ou soit créer mon ne propre startup','C\'est un très bon métier\r\nEt cela permet de mettre en pratique toute les connaissances apprises et de programmer différents applis pour résoudre certains problèmes de la vie quotidienne','Par un ami',NULL,NULL),(806,337,'932687fb-1157-4450-a7a6-ef2c47afee05','Étudiant','2014','Université d\'Abomey-calavi','Chimie-Biologie-Geologie','Entrepreneur','Débutant','Je m\'étais inscrit dans une formation en robotique il y a quelques années. Mais juste à cause de la difficulté de réunir les moyens de scolarité, j\'ai dû abandonner. C\'est pour moi une opportunité d\'atteindre mes objectifs','Je souhaite qu\'à la fin de cette formation, que j\'ai la possibilité de créer des site internet performante, et mettre en place des systèmes robotiques','Dans une boîte à gérer pas mal de choses en développement et programmation','C\'est le future de notre humanité','Par un ami',NULL,NULL),(807,339,'3d807a93-bd6d-41aa-8069-297dbb7195ba','License','2022','University of Parakou','Statistique appliquée','Étudiant','Bilingue','Pour developer de nouvelles competences en programmation','Avoir de meilleur skils','Devenir in grand programmer pour la banque mondiale','Super excitant et passionnant Les programmers ont plus de chance d\'obtenir un emploi et favoriser la bonne evolution Des choses','Internet',NULL,NULL),(808,340,'b3730f50-bb2c-44b8-a5c6-66345cc03e55','License','2022','ESM-BENIN','Systèmes Informatiques et Logiciels (SIL)','Sans activité professionnelle','Intermédiaire','Nous aimerions suivre cette formation pour acquérir davantage de connaissances dans le monde du développement web.','Nous espérons vivement que ladite formation nous permettra d\'améliorer considérablement notre niveau en programmation web et nous rendra très actif sur le marché de l\'emploi.','Bon, d\'ici 3 ans nous nous voyons déjà et ceci grâce à Dieu détenteur d\'un diplôme de Master professionnel dans le domaine et être déjà en mesure d\'aider de part notre savoir-faire plusieurs entreprises de la place à mettre sur pied et concrétiser des projets informatiques. Dans 5 ans, nous nous voyons déjà en train de travailler au sein d\'un organisme international.','À vrai dire, le métier de développeur codeur pour nous est un métier très passionnant car il va beaucoup nourrit son homme. Aussi, il permettra de résoudre assez de problèmes dans plusieurs domaines puisque nous sommes à l\'ère du numérique. Voilà un peu.','Par un ami',NULL,NULL),(809,342,'7e0bf3af-7bef-42a8-b58f-36f2234af23c','Étudiant','2022','Institut universitaire \'Les cours SONOU\'','Système informatique et logiciels','Étudiant','Débutant','Je suis passionnée par l\'informatique mais n\'ayant pas les moyens requis je voudrais suivre la formation afin de pouvoir réaliser ma passion','Je veux un partenariat gagnant-gagnant j\'aimerais bien avoir une bonne connaissance afin d\'exploiter mes compétences','Je me vois avoir de nouvelles connaissances et utiliser mes compétences pour de bonnes causes','Le développeur est un professionnel des langages informatiques il produit des lignes de codes','Par un ami',NULL,NULL),(810,343,'4af113aa-86d6-4b9e-ad43-7a5f6d5ddb82','License','2019','UATM GASA FORMATION','Système Informatique et Logiciel','Sans activité professionnelle','Débutant','Je suis latoundji farouck.\r\nJ’ai récemment obtenu ma licence en système Informatique et logiciel, et j’ai remarqué que ma formation n’est pas totalement complète, c’est pour cela que je voudrais participer à la formation que vous proposez et être compétent','Mes attentes par rapport à cette formation et d’être un développeur web compétent','Dans 3 ans , je me projette d’être un développeur d’application web et mobile','Le développeur codeur crée des sites web à partir des langages de programmation','Par un ami',NULL,NULL),(811,347,'149a29d4-dfc5-4dd3-947a-f2930fc326c1','Licence','2021','Université d\'Abomey-Calavi','Anglais','Sans activité professionnelle','Courant','Je veux suivre cette formation parce que c\'est en adéquation avec le marché de de l\'emploi','A la fin de cette formation que je puisse être apte à atteindre les objectifs du marché de l\'emploi','Je projette donner le meilleur de moi-même lors de la formation pour être employé dans l\'une des entreprises relié à HIGHFIVE UNIVERSITY','C\'est un métier à l\'ère du numérique','Par un ami',NULL,NULL),(812,349,'51363078-fef0-48d9-b914-799c237f4010','Bac+1','2022','UATM GASA FORMATION','Licence 1 en Génie Électrique et Informatique, Option Système Informatique et logiciel','Étudiant','Intermédiaire','Étant passionné de la programmation depuis toujours, j\'ai commencé par m\'auto-former dans l\'espoir que mon rêve se réalise un jour: trouver une université spécialisée uniquement en programmation qui me permettra ensuite d\'acquérir les compétences nécessaires que doit avoir un programmeur professionnel. HIGHFIVE UNIVERSITY est alors le trésor si tant cherché pouvant me permettre de me concentrer uniquement sur ce qui me passionne vraiment.','La connaissance, la compétence. Je veux qu\'à la fin de ma formation, la promptitude, le sérieux et la rigueur de la part de l\'université m\'aident à m\'affirmer en tant que programmeur professionnel. Et de ce qui est de la garantie de l\'emploi, qu\'elle tienne parole.','Dans 3ans, je me vois en tant que développeur codeur professionnel dans une entreprise vu que c\'est le principal but final du parcours à HIGHFIVE UNIVERSITY\r\nDans 5ans, je me vois être en train de mettre en place ma structure spécialisée en Intelligence Artificielle afin d\'aider les personnes démunies (aveugles, sourdes, et analphabètes) à pouvoir communiquer avec qui ils veulent.','Le métier de développeur codeur est un métier qui te fait voyager dans un univers imaginaire et rempli d\'embûches. À chaque problème résolu, un autre survient, qu\'il faut à son tour résoudre aussi. La passion de ce métier se trouve dans le bonheur qu\'on ressent après avoir résolu un problème. Donc pour y parvenir, il faut être rigoureux sur soi, sérieux et très réactif.','Par un ami',NULL,NULL),(813,350,'39443ea2-4489-4f00-9b30-43023b9942b0','Bac+1','2022','UATM Gasa-Formation','Système informatique et logiciel','Étudiant','Débutant','Je voudrais suivre cette formation pour avoir plus de connaissances et m\'améliorer dans le développement des codes car je suis un jeune passionné pas le développements; les nouvelles technologies.','Mes attentes pour cette formation est qu\'à la fin je sois en mesure de créer une application mobile et une intelligence artificielle et être un développeur dans mon domaine et autres...','Dans 5 ans je pense me retrouver en train de bâtir ma propre institut de réalisation des sites Web et des applications mobiles.','Moi je vois le métier développeur codeur comme un métier passionnant; merveilleux; fabuleux qui nous permet de tous digitale dans le monde actuel.','Par un ami',NULL,NULL),(814,352,'302bf264-e2c6-49de-a77e-c19a668ac4a4','Bac+2','2017','École Supérieure de Gestion d\'Informatique et des Sciences (ESGIS)','Informatique de Gestion','Sans activité professionnelle','Intermédiaire','J\'ai arrêté mes études en 3ème année après l\'obtention de ma licence en Système Informatique et Logiciels (SIL). Je n\'avais pas les moyens pour poursuivre mes études. J\'ai donc commencé à chercher un ou plusieurs emplois pour de quoi joindre les deux bouts. Mais j\'avais l\'impression de ne pas être du tout qualifié pour la plupart des postes professionnels auxquels j\'étais placé alors que je fus un brillant étudiant tout au long de mon parcours. C\'est là que j\'ai découvert le fossé qui existe entre la théorie et la pratique surtout dans le domaine de l\'informatique.\r\nJe veux suivre cette formation d\'abord parce qu\'elle est axée essentiellement sur la pratique d\'après ce que j\'ai lu sur votre site (10% de théorie contre 90% de pratique).\r\nEnsuite, durant la formation, je serai en contact direct avec le monde professionnel. Ce qui facilitera mon insertion professionnelle.\r\nEnfin, je n\'aurai pas de soucis à me faire concernant la scolarité. Je pourrais donc me concentrer uniquement sur le travail.','Je m\'attends à ce que cette formation tienne effectivement le fruit de ses promesses. Qu\'elle m\'ouvre de nombreuses portes pour l\'insertion professionnelle et que je puisse pratiquer mon métier avec joie et satisfaction.','Après 3 ans, j\'aurais déjà terminé cette formation. Je me vois donc déjà dans la peau d\'un développeur passionné pour son domaine avec une carrière prometteuse.\r\nDans 5 ans, je me vois déjà accumulé énormément d\'expériences et donc être un expert dans ma spécialité.','Pour moi, le métier de développeur codeur exige la pratique, la discipline, la rigueur et surtout une ouverture d\'esprit.\r\nL\'informatique évolue très vite et les entreprises sont de plus en plus exigeantes en matière de compétences et d\'expériences.\r\nIl faut donc effectuer un travail important sur soi-même et se tenir prêt à s\'adapter aux circonstances. D\'où il faut être ouvert d\'esprit et curieux.','Par un ami',NULL,NULL),(815,353,'39df55b5-45a1-4d03-bb82-d2218c358db0','Licence','2022','INSTITUT UNIVERSITAIRE LES COURS SONOU','Banque, Finance et Assurance','Sans activité professionnelle','Intermédiaire','J\'ai toujours été passionné par la tech et le codage en particulier. Le faite de pouvoir donné vie à des interfaces en ligne me fascine. Malheureusement ma série du BAC ne me permettait pas de pouvoir m\'inscrire en école d\'informatique. J\'ai suivi quelques formations sur OpenClassrooms mais il me manquait le côté projet pour mieux pratiquer les connaissances acquises.','J\'attends de cette formation de pouvoir acquérir des connaissances en programmation mais aussi de l\'expérience pratique afin d\'être opérationnel dans le domaine.','Dans 3ans, 5ans je me vois comme un développeur opérationnel, auprès d\'une startup ou à mon compte dans le domaine de la Fintech.','Je pense que c\'est un métier où avant toute chose il faut chercher à comprendre les attentes du client et maintenant coder des interfaces qui se rapprocheront des attentes du client. C\'est pas un métier compliqué mais ce n\'est pas facile non plus car il faut faire assez d\'erreur et chercher la solution à ces erreurs avant d\'aboutir au résultat souhaité.','Internet',NULL,NULL),(816,354,'77d41732-d8c6-4d0b-ba9b-05e835d767a1','Bac+2','2022','Université d\'Abomey Calavi','Anglais','Sans activité professionnelle','Courant','Pour intégrer le monde du digitale. Très impatiente d\'avoir de nouvelles connaissances','Découvrir des modules peu développé au Bénin afin de les valoriser','Être une formatrice pour beaucoup d\'autres jeunes qui peinent au chômage. Donnez l\'accès à l\'emploi à beaucoup d\'autres jeunes','Un métier passionnant et recherché','Internet',NULL,NULL),(817,355,'bae08cf8-84ff-496d-a78a-e1c838dda03a','Licence','2019','Institut Supérieur de Management Adonaï','Marketing Communication et Commerce','Sans activité professionnelle','Intermédiaire','Passionné de l\'informatique, j\'ai toujours rêvé d\'apprendre le mystère qui se cache derrière la création d\'un site web. Dans un monde où la digitalisation touche les aspects vitaux de mon quotidien, il est important de s\'y conformer et de contribuer ainsi à l\'avancé de la technologie pour accroître le rendement de nos entreprises.','A la fin de cette formation, je dois pouvoir être en mesure d\'abord de concevoir un projet informatique, de le mener à bon terme et aussi maîtriser toute la technologie liée à la sécurité réseau.','Dans trois ans je me vois déjà comme étant une référence au sein de la boîte dans laquelle j\'exercerai mes compétences acquises dans les locaux HIGHFIVE University. En 5 ans comme un expert en matière de création de site web.','Pour moi, être un développeur codeur c\'est une passion. C\'est un métier qui demande beaucoup d\'intelligence et de concentration.','Internet',NULL,NULL),(818,356,'6035c8ca-7865-499f-8774-3f3540559bca','Licence','2022','Université d\'Abomey calavi','Grace Kosoba Ezin','Sans activité professionnelle','Bilingue','Je voudrais suivre cette formation pour augmenter mon savoir.Je suis aussi un fanatique du digital et des choses en ligne et j\'ai bien voulu comprendre.cela m\'aiderait à être ultra compétent sur le marché de l\'emploi','Maîtrise totale de tous les aspects du monde digital,la compétence et enfin la liberté financière.Etre utile à la société','Je projette être un développeur hors pair, et inconrtounable.Compétent d\'ici 3-5 ans','J\'imagine que le métier de développeur codeur est un métier d\'avenir qui peut nourrir son homme s\'y l\'on s\'y consacré corps et âme.','Par un ami',NULL,NULL),(819,455,'4360c832-b7b7-4dee-8477-e5239a5bece2','Bac+2','2018','HECM','Banque et finance','Sans activité professionnelle','Courant','Passionné du numérique, je désire apprendre à coder pour exercer seul ou en équipe les compétences acquises dans des projets passionnants.','Je m\'attends à une formation interactive de qualité qui débouchera sur des compétences pratiques actualisées.','Je me vois exercer une carrière de développeur PHP/ Full-stack au sein d\'une entreprise.','Rigoureux mais passionnant. Un mélange d\'art et de logique mathématique. C\'est un métier très challengeant mais bien rémunéré pour qui a de la compétence et de la discipline. Il demande un apprentissage continue chaque jour pour demeurer à la pointe.','Par un ami',NULL,NULL),(820,456,'744942fe-1c47-4378-9c74-e909f47776e2','Licence','2023','Université d\'Abomey-Calavi','Licence de Recherche en Anglais','Sans activité professionnelle','Intermédiaire','Je suis très intéressé par le domaine du digital et je pense que cette formation peut beaucoup m\'apporter dans ma quête de connaissances dans ce domaine.','J\'espère acquérir de bonnes connaissances pratiques pour mon développement personel et également pour une meilleure découverte de ce secteur qui attire ma curiosité.','Dans 3 ans, je me vois indépendant, travaillant dans un domaine où je me sens à l\'aise, ayant déjà acquis assez connaissances et continuant à apprendre. Dans 5 ans, je me vois un peu plus grand, accomplissant mes rêves avec mes propres moyens.','En prenant en compte l\'utilité du digital de nos jours, je pense que c\'est un métier un peu complexe à définir simplement, mais qui représente un atout majeur pour non seulement celui qui l\'exerce mais également pour les activités parallèles qui utilisent de plus en plus le digital et ses outils.','Par un ami',NULL,NULL),(821,457,'a8983d10-3c55-40ff-ba80-7297eadf3a92','Bac+2','2021','Université d\'Abomey calavi','Système informatique et logistique','Étudiant','Débutant','Je veux suivre cette formation parceque depuis mon bas âge j\'ai la passion en systèmes informatiques et logistique je me suis inscrit ,à cause de manque des moyens financier j\'ai stoppé maintenant je voulais réinscrire pour poursuivre mes compétences dans ce domaine','J\'aimerais avoir plus de connaissance sur les nouvelles technologies et me spécifier dans un domaine donné enfin de mettre mes compétences au service d\'un entreprise pour gagner des expériences','Dans ces intervalle de temps pour ce métier de mes rêves je prie Dieu pour pouvoir gagné ma vie quotidienne il me servira à être indépendant à découvrir beaucoup de techniques sur le progrès','J\'imagine bien que ce métier est un bon métier qui faut pour notre développement personnel et un atout très important pour le monde','Internet',NULL,NULL),(822,459,'5837d44c-71b9-47aa-ad05-3d4ab11b0ba4','Bac+2','2023','Université Polytechnique Internationale Obiang nguema Mbasogo','Banque finance Assurance','Étudiant','Courant','J\'avais pour objectif de suivre une formation comme celle là et vu qu\'elle est gratuite, je me dis que c\'est mon opportunité.','Devenir un bon développeur Web','Être une formatrice dans ce métier de développeur Web aussi','Je penses que ce serait compliqué mais je me mettrai à fond dedans.','Par un ami',NULL,NULL),(823,460,'6d69c6d5-eb54-4df4-8734-d39674cbe59f','Licence','2022','Ucao-uuc','Informatique de gestion','Sans activité professionnelle','Débutant','Parce que votre offre me semble vraiment intéressante et je voudrais acquérir plus de connaissance en développeur','Acquérir plus de connaissances','Avoir déjà les connaissances nécessaires et commencer à les exploités','C’est apprendre plusieurs language qui nous permettrons de créer par exemple des sites web, des applications et logiciels','Par un ami',NULL,NULL),(824,467,'df197a15-97a4-4e0e-909e-1f410f7f40ae','Bac+2','2022','Université d\'Abomey Calavi','Vente professionnel','Étudiant','Intermédiaire','J\'avais pour un objectif de suivre une formation pour être développeur Web et vu que celle là est gratuite, je me dis que c\'est mon opportunité.','Devenir un Bon développeur Web','Être Formateur dans ce même domaine','Compliqué mais je me donnerai à fond.','Par un ami',NULL,NULL),(825,468,'fac3b9cb-175b-48fa-87ce-371ed10ca17b','Bac+1','2022','Abomey Calavi','CBG','Étudiant','Débutant','Pour m\'en servir dans la vie courante,et mieux me developper','La connaissance pour rendre service aux autres qui en n\'ont besoin','Être un professionnel en développeur codeur','C\'est un bon métier','Par un ami',NULL,NULL),(826,469,'f3396fc5-c6a9-45e1-a8a0-0ddb2c3c59aa','Bac+2','2020','Uac/Abomey Calavi','Sciences politiques','Sans activité professionnelle','Intermédiaire','J\'adore les métiers du web en occurrence ceux qui touchent le digital, l\'informatique, le hacking, c\'est pour cette raison, que personnellement, je me forme en autodidacte en graphisme et en programmation, sans pouvoir me vanter, j\'ai déjà une bonne maîtrise en HTML 5, CSS3 et un début en java script, en PHP et phyton, cependant y a des questions que les tutos de YouTube ne pourront répondre, c\'est la raison pour laquelle j\'étais heureux lorsqu\'on m\'a fait part de l\'opportunité.\r\nJe veux être l\'un des plus grands programmeurs de ma génération.','J\'attends de cette formation tout le sérieux qu\'elle laisse paraître sur son site, de la rigueur, et des connaissances à jour dans le domaine, en gros tout ce qu\'il faut pour qu\'à la fin de cette formation, l\'on puisse se sentir fière d\'être un développeur codeur.','Dans 3 et 5 ans, mon objectif est de créer une boîte qui gère à la fois l\'animation (2D, 3D, court et long métrage) et à l\'étage du haut une entreprise spécialisée dans la programmation, la création de jeux vidéo, la cybersécurité.\r\nJ\'aime autant le cinéma d\'animation que la programmation.','Un développeur codeur, c\'est cette personne qui a la capacité et la qualité de rédiger ou d\'écrire un langage informatique pour développer un outil, un site internet, une application, un logiciel.','Par un ami',NULL,NULL),(827,470,'2ea59500-608f-4f54-9ebf-37e252e700b5','Bac+1','2021','Université d\'Abomey-Calavi','Science Politique','Sans activité professionnelle','Intermédiaire','En plus d\'être une opportunité formidable,cette formation a toujours un objectif pour moi. Un objectif que j\'ai pas encore atteint faute de moyen. Alors je serai heureux de participer à ce programme.','J\'espère qu\'elle nous permettra d\'être opérationnel une fois terminé.','Être l\'un des meilleurs programmeur qui puissent de ma génération','Ce métier doit être passionnant et va demander beaucoup de concentration à celui qui le pratique.','Par un ami',NULL,NULL),(828,471,'13075c88-25c3-4da4-9448-9cabd20d6af5','Bac+1','2022','Abomey Calavi','Gestion / Marketing et Stratégie','Étudiant','Intermédiaire','J\'aimerais suivre cette formation pour de nombreuses raison. D\'abord, c\'est pour être bon en développement Web. J\'avais déjà débuté la formation, mais malheureusement je n\'ai pas pu terminer. Je suis un passionné de l\'informatique. Ensuite continuer avec la carrière de la programmation.','J\'aimerais faire partir de cette promotion pour pouvoir réaliser mes rêves dans le domaine informatique.','Dans 3 ans, j\'aimerais pouvoir terminer ma plate-forme d\'e-commerce que j\'ai comme mon premier projet. Cette plate-forme permettra à l\'Afrique  et à l\'occident de pouvoir faire des différents achat sans se déplacer.','C\'est un métier dans lequel il faut être concentré et avoir un but précis. C\'est un métier qui demande de la discipline et de rigueur.','Par un ami',NULL,NULL),(829,472,'2deb2cee-baf8-40d9-8c23-443c396e2e01','Licence','2021','Institut National Supérieur de Technologie Industriel','Maintenance industriel','Sans activité professionnelle','Intermédiaire','Approfondir mes compétences en développement web et du digital','Être un professionnel confirmé en développement.','Être un entrepreneur à sucess','C\'est un métier d\'avenir amener à perdurer aujourd\'hui et pour de long moment encore. Puisque, de jour en jour, des sites web sont créer, des applications ou des logiciels se font développer avec l\'opportunité pour le professionnel d\'être en présent d\'un grand marché, où la demande afflue.','Internet',NULL,NULL),(830,473,'f4dc7421-75c4-4835-ad73-53d688a55a42','Bac+1','2017','Esgis','DT-IMI','Entrepreneur','Débutant','Pour me perfectionner davantage et avoir des bases solides.','Acquérir plus de compétences','Etres un grand développeur web a mon propre compte et contribuer au développement du domaine .','C’est un métier de l’avenir','Par un ami',NULL,NULL),(831,474,'21df78fd-6b55-49d7-a6f0-7437c8b725b0','Licence','2017','Institut universitaire de lokossa','Génie civil','Sans activité professionnelle','Intermédiaire','Pour élargir mes connaissances et assouvir mon intérêt vis à vis métier du métier de développeur','Devenir développeur et en faire une source de revenus','Dans 5 ans je me vois être un créateur d\'emploi pour une multitude au bénin','Cool intéressant et un peux stressant','Internet',NULL,NULL),(832,475,'99433f90-13da-475a-9b9e-984eb55b8c9f','Licence','2018','Université d\'Abomey-Calavi','Entrepreneuriat et Gestion des Petites et moyennes entreprises','Sans activité professionnelle','Intermédiaire','Suis une débutante en informatique et en maîtriser les rouages est très important pour l\'être humain. L\'informatique c\'est l\'histoire de toute une vie. Et je ne peux rien faire sans cela','Maîtriser le développement web, la création et la gestion de site web et être un pro','Être un pro dans le domaine\r\nFormer un tas de jeune qui feront fonctionner mon entreprise en informatique. Je me vois tisser des partenariats avec de grandes firmes dans le domaine','C\'est un très bon métier. Un développeur codeur pour est la tête de pensante de l\'informatique. Donc selon moi c\'est un métier parfait pour comprendre la magie derrière tout ce qui se passe sur le web','Par un ami',NULL,NULL),(833,476,'64e350db-0ad8-4631-a2bc-755c7d12b4a7','Bac+2','2001','Institut Supérieur de Technologie','BAC G1/SECRÉTARIAT','Sans activité professionnelle','Bilingue','Développement de carrière','Être apte à commencer une nouvelle carrière professionnelle','En freelance afin de servir comme Consultant','Très innovant et défiant. J\'aime les défis.','Presse',NULL,NULL),(834,477,'79634608-bbfa-4992-9f51-67f09b861dc5','Licence','2019','Institut HCUB','Analyses biomédicales','Entrepreneur','Débutant','Je voudrais suivre cette formation pour acquérir un bon niveau dans le domaine de développeur web','Cette formation me permettra d\'assimiler correctement les prérequis et les outils indispensable du codage.','Mon objectif actuel est de trouver un poste dans une entreprise où je peux évoluer et relever des défis au fil du temps.','Oui je m’imagine dans le métier de codeur. Il  s\'agit de développer  un site internet, une application ou bien un logiciel','Par un ami',NULL,NULL),(835,478,'24afe835-625d-4c50-b903-af4130c6c239','Licence','2016','ESGIS','Systèmes, Réseaux et Sécurité Informatique','Entrepreneur','Débutant','Je voudrais suivre cette formation parce que devenir développeur web à toujours été mon objectif.','A la fin de la formation je souhaiterais être développeur fullstack.','Dans 3 à 5ans je compte être développeur web fullstack qui travaille à son propre compte et qui est CEO de sa propre entreprise.','Le métier de développeur codeur consiste à apporter des solutions informatiques à certains problèmes en faisant du codage informatique.','Par un ami',NULL,NULL),(836,479,'5a8f0e2a-e180-4fca-8e05-6fc194680890','Bac+1','2019','Université d\'Abomey Calavi','Espagnol','Entrepreneur','Courant','Passionné du digital, je voudrais approfondir mes compétences en développement web afin d\'être un professionnel','Devenir un expert en Codage','Au vu de cette belle opportunité qu\'offre HIGHFIVE UNIVERSITY, je me donne comme objectif de devenir un professionnel Codeur d\'ici 3ans. Et mettre au profil de la communauté Béninoise voir africaine des solutions digital très utile.','Étant à l\'ère de numérique, le métier de Développeur Codeur très capital, vu l\'évolution de la technologie.','Presse',NULL,NULL),(837,480,'67386e90-3a0c-42ca-bd57-9997d3d27767','Licence','2020','ENA','Administration Générale','Salarié','Intermédiaire','Je voudrais suivre cette formation parceque j’aimerais faire une reconversion professionnelle et apprendre à coder.','J’espère que cette formation me permettra de maîtriser les langages de programmation afin de devenir développeur codeur et d’en faire une carrière.','Après ma formation à High five je compte dans un premier temps faire carrière puis par la suite monter peu à peu ma propre boîte','Pour moi le métier de développeur est en plein essort et s’avèrera être encore plus indispensable dans les années à venir','Par un ami',NULL,NULL),(838,481,'34e07b5e-fbf3-4a4a-a316-5e2925eb1739','Bac+2','2022','Université d\'Abomey-calavi','Lettres Modernes','Sans activité professionnelle','Débutant','Cher responsable du programme de formation en codage de High Five University,\r\n\r\nJe suis très enthousiaste à l\'idée de postuler pour votre programme de formation en codage, et je suis ravi de vous expliquer pourquoi je suis convaincu que ce programme est la prochaine étape idéale pour moi.\r\n\r\nJe suis actuellement BAC+2 en lettres modernes, mais j\'ai constaté que cette formation ne me donne pas beaucoup de choix en termes d\'employabilité. Bien que j\'aie acquis des compétences précieuses en communication, analyse et rédaction, j\'ai l\'impression que mes options de carrière sont limitées.\r\n\r\nC\'est pourquoi je suis si intéressé par votre programme de formation en codage. Je crois que cette formation me permettra d\'acquérir de nouvelles compétences hautement demandées sur le marché du travail. Le codage est une compétence qui est actuellement très recherchée par de nombreuses entreprises, et je crois que cette formation me donnera les outils pour trouver un emploi gratifiant et à long terme.\r\n\r\nJe suis passionné par les technologies de l\'information, et j\'ai hâte de découvrir les langages de programmation, les outils et les techniques que j\'apprendrai dans votre programme. Je suis prêt à m\'engager pleinement dans ce programme et à travailler dur pour acquérir les compétences nécessaires pour réussir dans ce domaine.','Je suis convaincu que votre programme de formation en codage me donnera l\'opportunité de changer de carrière et de trouver un emploi qui me passionne vraiment. Je suis reconnaissant de l\'opportunité de postuler à votre programme et j\'espère avoir la chance de travailler avec vous.','Pour moi dans 3 ans j\'aurai terminer ma formation en codage et je suis convaincu que je serai déjà employé et travaillerai à des projets concrets dans des entreprises passionnantes et que j\'aurai une rémunération stable.','Pour moi cela doit être très passionnant de pouvoir créer des sites internet et des applications. Et selon moi cela fais absolument parti des métiers du futur. Je me dis aussi que la charge de travail doit être absolument colossale mais j\'ai entendu dire aussi que la rémunération était aussi très intéressante selon l\'entreprise avec laquelle on travail.','Par un ami',NULL,NULL),(839,482,'585e5fd3-28d5-46f4-8f1c-b940e52d8aaf','Bac+1','2022','Université d\'Abomey Calavi','Analyse biomédicale','Étudiant','Débutant','Pour me garantir un avenir meilleur','Développer ma performance','Un grand développeur','Un bon métier qui vas garantie un bon avenir','Par un ami',NULL,NULL),(840,483,'7420665a-268e-465e-9478-48995c91b75c','Bac','2019','Collège catholique Pierre Joseph de Clorivière','Baccalauréat','Sans activité professionnelle','Débutant','Je veux suivre cette formation dans le but d\'approfondir mes connaissances dans le domaine du web design et finir par entreprendre à la fin de la formation','Je m\'attend à un atmosphère d\'entraide, à une bonne procédure d\'apprentissage et surtout viser la pratique','Je me vois d\'ici 5ans, à la tête d\'une société ou d\'une entreprise spécialisée dans le métier de développeur codeur','Pour moi je vois en ce métier un métier d\'avenir capable de me rendre utile face aux différents problèmes que présentent ce domaine','Par un ami',NULL,NULL),(841,484,'1a6fa6dd-605b-4eec-8920-d5e06913b6cc','Bac+2','2022','Université d\'Abomey Calavi','Physique','Étudiant','Intermédiaire','Je voudrais suivre cette formation afin de pouvoir réaliser mes rêves. Tous mes projets sont basés sur le numérique. Et je suis un passionné de l\'informatique.','J\'aimerais bien que mon dossier soit accepté et que je fais partir de cette promotion de formation pour pouvoir accomplir mes objectifs dans le développement.','Dans 3ans, je serai déjà à un niveau donner en matière de connaissance dans la programmation. Cela me permettra de mettre en place mes projets digitals afin de permettre à l\'Afrique et l\'occident un usage parfait.','Le métier de développeur codeur n\'est pas un métier trop compliqué mais cela nécessite beaucoup de discipline et de but précis. C\'est à dire il faut être précis et ponctuelle en toute chose.','Par un ami',NULL,NULL),(842,485,'23f87683-ae62-4896-a148-10ce2950c281','Bac+1','2022','Abomey-calavi','Mathématique','Étudiant','Courant','Pour approfondir le peu de connaissance que j\'ai dans le domaine','Surtout le java script et l\'hébergement des sites','Fier car j\'aurai déjà avoir ce dont je veux pour élargir le peut de connaissance que jai','Ça doit être un métier de technique , juste de bonne concentration','Par un ami',NULL,NULL),(843,486,'9701c6d2-cbc2-4d29-ba70-a8d9d747963d','Bac+2','2022','ENAM','Administration des finances','Étudiant','Courant','Je voudrais suivre cette formation parce que j’ai toujours eu une passion pour ce métier de développeur et n’ayant pas eu la chance de le faire après mon cursus secondaire je souhaiterais saisir cette opportunités','Beaucoup de sérieux et d’apprentissage afin de mieux assimiler les notions','Je me vois développeur pro?','C’est un métier paisible qui ouvre beaucoup de portes en terme de d’opportunités','Internet',NULL,NULL),(844,488,'d6fa32b8-b899-4d6e-a754-476be8fb8dd8','Master','2020','École Doctorale des Sciences Économique et de Gestion','DESS en Finances et Contrôle de Gestion','Sans activité professionnelle','Courant','Passionnée des outils d\'analyse, d\'aide à la prise de décision et de la digitalisation des systèmes , je suis convaincue que cette formation m\'aiderait énormément à améliorer mes compétences en informatique, en coding et surtout en développement Web.','Je voudrais à la fin de cette formation être en mesure de faire de l\'audit informatique, du coding Académy et surtout du développement Web.','Je souhaite dans 5ans développer mon entreprise en ligne et pourvoir apporter de l\'aide en développement web aux entreprises qui sont dans le besoin, faire de l\'audit digital.','Les métiers de développement web sont des métiers de l\'avenir car la digitalisation de toutes les entreprises serait bientôt une réalité dans le monde entier','Par un ami',NULL,NULL),(845,489,'55b0a499-21c3-42b7-9fbe-38889a439dcf','Bac+1','2022','UATM Gasa Formation','Système Informatique et Logiciel (SIL)','Étudiant','Débutant','Je veux suivre cette formation pour être plus performants dans mon domaine et à travailler pour l\'entreprise.','Être un grand programmeur','Dans 3 à 5 ans je serai un programmeur performants.','Le métier de développeur codeur est un bon métier.','Par un ami',NULL,NULL),(846,490,'0065ba57-d3a8-46fe-9569-b76cad2e2acb','Bac','2017','Pas d’université','BAC','Sans activité professionnelle','Intermédiaire','Je veux suivre cette formation car c’est tout d’abord une formation qui me passionne et aussi le monde du codage est très prometteur','Acquérir plus de connaissances pour élever mon niveau actuel dans la programmation','D’ici, 5ans je me vois être libre financièrement grâce à mes connaissances dans le codage. Faire parti des personnes qui vont faire développer la visibilité de grandes entreprises dans le monde digital','Le métier de développeur est un métier du monde futur. C’est en quelque sorte digitalisée l’imagination','Par un ami',NULL,NULL);
