,29,6,'checkbox'),(434,'eb9e09e2-9d35-45da-a93b-f74fb3aeefc8','Considérons le code suivant:<br><br><code>$userSessionState = $suer->isConnected() ? \"user\" : \"anonymous\";</code><br><br>Comment qualifier cette syntaxe',NULL,29,6,'checkbox'),(435,'6bc5a0cd-36f8-43e6-93d4-00cabb151f73','Qu\'affiche le code suivant ?<br><br><code>function sayHello(): void {<br>&emsp;echo(\"Salut\");<br>}<br><br>function sayGoodBye(): void {<br>&emsp;echo(\"Au revoir\");<br>}<br><br>$func = \"sayHello\";<br>$func();</code>',NULL,29,6,'checkbox'),(436,'77510649-7078-4936-b679-3ad686bd222c','Contrairement aux arguments de fonctions, les arguments de méthodes ne peuvent pas définir  de valeurs par défaut.',NULL,29,6,'checkbox'),(437,'23272ea3-5aa0-4fef-80b0-64a581353253','Qu\'affiche le code suivant ?<br><br><code>declare(strict_types = 1);<br><br>function square(int $x): int {<br>&emsp;return $x ** 2;<br>}<br><br>$result = square(1.62);<br>echo $result;</code>',NULL,29,6,'checkbox'),(438,'e27fdf18-aa46-4d18-b7d9-36e33d651978','Qu\'affiche le code suivant ?<br><br><code>try {<br>&nbsp;&nbsp;throw new \\Exception(\'Badaboom !\');<br>} catch(\\Exception $e) {<br>&nbsp;&nbsp;echo \'Pouf !\';<br>}</code>',NULL,29,6,'checkbox'),(439,'cc4db0a2-5644-4d41-9b07-d20c1316ac2d','En cas d\'exception lors de la tentative de connexion, qu\'affiche le code suivant ?<br><br><code>try {<br>&emsp;$conn = new PDO(\"mysql:host = localhost; dbname = cats; charset = utf8;\", \"catmaster\", \"azerty123456\");<br>} catch(\\Exception $e) {<br>&emsp;echo \"Pouf !\";<br>&emsp;die;<br>} finally {<br>&emsp;echo \"Boom !\";<br>}</code>',NULL,29,6,'checkbox'),(440,'def861c6-17f9-471a-94de-9976c9b30a31','En PHP, quel mot-clé permet de lever une exception ?',NULL,29,6,'checkbox'),(441,'f5cbd8e3-70db-4026-903c-a19ab9e0c18d','À quoi servent les namespaces',NULL,29,6,'checkbox'),(442,'9e11b93b-bcf0-4b66-945f-35bb2e489b68','Qu\'affiche le suivant:<br><br><code>interface WellMannered {<br>&emsp;public function sayHello(): str